INSERT INTO `destination_country` VALUES ('US','AC','GB','http://pe.usps.com/text/imm/ab_011.htm','No list furnished.','No list furnished.','None'),('US','AD',NULL,'http://pe.usps.com/text/imm/ab_004.htm','Arms and weapons.\nHuman remains.\nLive plants and animals.','No list furnished.','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box. For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.       \n'),('US','AE',NULL,'http://pe.usps.com/text/imm/tz_017.htm','Aerosol products.\nButane gas lighters and refills.\nFirearms, ammunition, and their components.\nGold, jewels, platinum, precious stones, and silver except in insured parcels. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPolished, whitened, artificial, or imitation pearls. \nPork products. \nPrinted matter offensive to Arabs and Muslims. \nRadioactive materials. \nRadio transmitters and receivers except under permit. ','Medicines require prior authorization. ','\nShipments, whose value does not exceed 500 dirhams and parcels that are not commercial and contain personal effects are generally exempt from all customs measures.  Shipments that exceed 500 dirhams in value and are commercial shipments must be accompanied by (a) the original invoices authenticated by the Consulates of the UAE; (b) authenticated certificate of origin; (c) list of the contents of the package; and (d) the certificate of exemption from duty, if applicable.  As of January 1, 2018, all items containing goods are subject to a value-added tax (VAT) payable by the addressee at the rate of 5 percent of the item’s total value. All mail must include the full address, including the addressee’s post office box number, the relevant emirate (e.g., Dubai), and the country name “United Arab Emirates.” All mail must display the addressee’s mobile telephone number and email address, if available.       \n'),('US','AF',NULL,'http://pe.usps.com/text/imm/ab_001.htm','Coins; banknotes; currency notes (paper money); securities payable to bearer; platinum, gold or silver, manufactured or not.\nInfectious materials.\nPerishable biological substances.\nRadioactive materials.','Traveler‘s checks, precious stones, jewelry, and other valuable articles are admitted only in First-Class Package International Service with Registered Mail service shipments.','First-Class Mail International and First-Class Package International Service shipments may not contain dutiable articles.'),('US','AG',NULL,'http://pe.usps.com/text/imm/ab_007.htm','Coins except when sent in insured Priority Mail International parcels. ','Fruits, nuts, dried, tinned, crystallized or otherwise preserved fruit must be accompanied by a certificate of origin issued by a competent authority and testifying that the articles originate from the U.S.A.','None'),('US','AI','GB','http://pe.usps.com/text/imm/ab_006.htm','Perishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials.','No list furnished.','None'),('US','AL',NULL,'http://pe.usps.com/text/imm/ab_002.htm','Currency of the Albanian State Bank (Banknotes in lek).\nExtravagant clothes and other articles contrary to Albanians’ taste. \nItems sent by political emigres. \nLiterature, publications, and other articles prejudicial to the State public order. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPhotographic films, including plates and paper intended for photography.\nPublications containing obscene or indecent articles.\nRadioactive materials. \nUsed articles. ','Hunting arms require an import permit. \nMedicines for personal use are admitted provided the addressee has a medical certificate. ','\nFirst-Class Mail International and First-Class Package International Service shipments may not contain dutiable articles.  Priority Mail International service extends only to:        \n\nBerat  Bilisht  Delvine  Durres  (Durazzo)  Elbasan  Fier  Gjirokaster  (Argirokastro)  Himare  Kavaje  Klos  Kolonje   \nKonispol  Korce  (Coritoza)  Kruje  Kucove  Kukes  Kurvelesh  Lesh (Alessio)  Leskovik  Libohove  Librazhd  Lushnje  Mallakaster   \nMilot  Peqin  Permet  Peshkopi  Puke  Sarande  Shijak  Shkoder  (Scutari)  Tepelene Tirana  Vlore   \n      \n\n\n\nBerat  Bilisht  Delvine  Durres  (Durazzo)  Elbasan  Fier  Gjirokaster  (Argirokastro)  Himare  Kavaje  Klos  Kolonje   \nKonispol  Korce  (Coritoza)  Kruje  Kucove  Kukes  Kurvelesh  Lesh (Alessio)  Leskovik  Libohove  Librazhd  Lushnje  Mallakaster   \nMilot  Peqin  Permet  Peshkopi  Puke  Sarande  Shijak  Shkoder  (Scutari)  Tepelene Tirana  Vlore   \n\nBerat \nBilisht \nDelvine \nDurres \n(Durazzo) \nElbasan \nFier \nGjirokaster \n(Argirokastro) \nHimare \nKavaje \nKlos \nKolonje \nKonispol \nKorce \n(Coritoza) \nKruje \nKucove \nKukes \nKurvelesh \nLesh (Alessio) \nLeskovik \nLibohove \nLibrazhd \nLushnje \nMallakaster \nMilot \nPeqin \nPermet \nPeshkopi \nPuke \nSarande \nShijak \nShkoder \n(Scutari) \nTepelene\nTirana \nVlore '),('US','AM',NULL,'http://pe.usps.com/text/imm/ab_009.htm','Explosive, combustible, or toxic materials. \nFood that spoils easily. \nNarcotics and other dangerous substances. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPhotosensitive materials. \nPostal items containing securities of any kind payable to the bearer; traveler’s cheques; platinum, gold or silver, whether manufactured or not; precious stones; jewels; or other valuable articles.\nPrinted and typographic materials and reproductions of paintings harmful to the interest of the State and to the rights of its citizens; immoral articles. \nRadioactive materials. \nThe dram (AMD) of the Republic of Armenia and foreign currencies. \nWeapons of all kinds, military ammunition, combat material, and uniforms. ','None furnished.','None'),('US','AO',NULL,'http://pe.usps.com/text/imm/ab_005.htm','Arms, ammunition.\nBanknotes, currency (paper money), and coins unless addressed to the National Bank of Angola.\nBooks, printed matter, films and drawings prejudicial to the law of the country. \nPerishable infectious biological substances. \nRadioactive materials. \nRoulette and other apparatus for games. \nTobacco.','Patent medicines are admitted only under permit issued by the Angola Department of Health. ','None'),('US','AR',NULL,'http://pe.usps.com/text/imm/ab_008.htm','Coins; banknotes; currency notes; securities payable to bearer; traveler’s checks; platinum, gold, and silver; precious stones; jewelry; and other valuable articles except in insured Priority Mail International. \nFurs and skins of chinchillas and vicunas.\nRadioactive materials.\nRadio and television receivers, phonographs and combinations.\nReady-made clothes and fabrics unless they are typical family presents and have no commercial value. \nPerishable infectious biological substances. ','Bees, plants, seeds must be accompanied by a health certificate countersigned by the Argentine Consul. ','\nArgentine customs legislation stipulates that in all cases the addressee must be present to authorize the opening, checking, and customs clearance of packages. To expedite the examination of such packages, the sender should write in a suitable place on the customs Declaration, the phrase “Peutetre Ouvert D’ Office” (May Be Opened Officially), followed by his signature.  Each commercial shipment must be accompanied by a consular invoice in duplicate. These invoices must include a declaration signed by the seller or his representative reading: “I declare under oath that all the information given in this invoice is true and the prices indicated are those that actually have been paid (or will have to be paid). I also declare that no arrangements have been made that would make possible any alterations in these prices.” The following articles do not require consular invoices:  \nBooks, reviews, newspapers, printed papers and scientific and literary periodicals, on condition that no import duty is payable.  New or used effects or articles imported for noncommercial purposes or not of a saleable nature or value, intended for personal use or consumption and which, by reason of their quantity or type, give no grounds for thinking that they are intended for sale, and which do not exceed the value above which import duty would have to be paid.  Goods in transit for other countries.  Samples without saleable value (unused).  Brochures, posters, printed papers, diaries, almanacs, negatives, photographs, films and other miscellaneous publicity articles advertising foreign goods or concerns, which are marked to prohibit their free sale.  Spare parts and accessories for supplying or repairing foreign ships or aircraft in Argentina, if these are considered indispensable for continuing the journey.  Customs, properties and other belongings of visiting theatrical companies.  Goods returned to Argentina after definitive or temporary export unless a return invoice was explicitly requested when authorization for temporary export was granted.  Educational equipment or materials intended for schools or scientific research institutes, whether as purchases, gifts, loans or technical or financial aid, on condition that the Argentine Ministry for Foreign Affairs and Religion gives permission beforehand. \nUsed linen and clothing must be accompanied by a certificate of disinfection issued by a competent authority in the country of origin and countersigned by an Argentine consular service. In areas without an Argentine consular service, a disinfection certificate issued by the competent authorities is sufficient. The wrapper must be marked “Disinfection Certificate Enclosed.”        \n'),('US','AT',NULL,'http://pe.usps.com/text/imm/ab_013.htm','Arms and weapons.\nCertain books and printed matter which are prohibited by order of the courts in Austria.\nFirearms, parts and accessories thereof, or replica firearms.\nForeign lottery tickets and publicity material relating thereto.\nHuman remains.\nLive bees, leeches, silkworms, and flies of the family Drosophilidae.\nLive plants and animals.','Articles made of precious metals (gold, silver or platinum) must be of the fineness required by the Austrian regulations.\nAustrian coins, gold coins require permission of the Austrian National Bank. \nMeat and animal products; plants and parts of plants; fruit, onion and flower bulbs; and other root plants must be accompanied by a certificate of origin and plant-health certificate. Shipments containing processed meat products (salami, tinned meats, etc.) up to a weight of 3 kg (6 lbs., 9 oz.) when sent to private persons are exempt from this requirement. \nMedicines intended for personal use are permitted only under an import license.','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For Priority Mail International parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  \nGifts shipments are exempt from charges and fees provided the value of the shipment does not exceed 29 EUR; they may not contain more than 40 cigarettes or 10 cigars or 50 grams of tobacco, or more than 50 grams of a selection of these products. Gift shipments should be clearly marked GESCHENKSENDUNG on the customs declaration.       \n'),('US','AU',NULL,'http://pe.usps.com/text/imm/ab_012.htm','Antiquities, art fossils, historical documents, numismatic material, specimens of flora and fauna, and similar cultural heritage objects that are significant to a nation’s identity.\nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (except for jewelry items meeting the requirement in “Restrictions” below); precious stones (except when contained in jewelry items meeting the requirement in “Restrictions” below); and other valuable articles are prohibited.\nDog collars with protrusions designed to puncture or bruise an animal’s skin.\nFruit cartons (used or new).\nFur, including raw, tanned, or processed furs or pelts, and goods that may contain such fur that are derived from domesticated cat and dog breeds.\nGoods bearing the name “Anzac.”\nGoods produced wholly or partly in prisons or by convict labor.\nLaser pointers and similar handheld devices designed or adapted to emit a laser beam with an accessible emission level greater than 1 megawatt (MW).\nMost food, plant, and animal products, including the use of products such as straw and other plant material as packing materials.\nPerishable infectious biological substances.\nRadioactive materials.\nRegistered philatelic articles with fictitious addresses.\nReplica firearms, including any article that has the appearance of a firearm that could reasonably be mistaken as a firearm.\nSeditious literature.\nSignal jammers capable of preventing or disrupting mobile telephone and satellite navigation services.\nSilencers for firearms.\nTobacco products, including cigarettes and loose-leaf tobacco. Exception: Cigars. Note: Although Australia also permits chewing tobacco and oral snuff in amounts up to 3.3 pounds (1.5 kg), the U.S. Postal Service does not permit these types of smokeless tobacco in international mail — see 136.4.\nUsed bedding.','Airsoft (BB) guns that do not have the appearance of fully automatic firearms require prior approval granted by relevant police representatives. The addressee must submit an application to import the item via the police certification test.\nDrugs, medicines, and therapeutic substances such as antibiotics, growth hormones, kava, psychoactive substances, and steroids require an import permit from the Australian Department of Health, Office of Drug Control. \nFish or parts of fish, including all species of bony fish, sharks, rays, crustaceans, mollusks, and other marine organisms (but not including marine mammals, marine reptiles, or toothfish), whether fresh, frozen, smoked, or preserved in airtight containers, require an import permit from the Australian Fisheries Management Authority (AFMA).\nJewelry is permitted only when sent as an insured parcel using Priority Mail International service. In addition, Australian Customs regulations prohibit importation of jewelry that is made with ivory or from endangered species, such as snake, elephant, or crocodile, that does not have an accompanying Import/Export Permit in relation to the Convention on International Trade in Endangered Species of Wild Fauna and Flora (CITES).\nKnives (such as daggers and throwing knives), throwing blades, or throwing axes require written Police Certification (B709B form or B709X form) from the Australian Police Firearms Registry.\nMeat and other animal products; powdered or concentrated milk; and other dairy products requires permission to import from the Australian quarantine authorities. \nPermission of the Australian Director-General of Health is required to import medicines.','Duty may be levied on catalogs, price lists, circulars, and all advertising introduced into Australia through the mail, regardless of the class of mail used.'),('US','AW',NULL,'http://pe.usps.com/text/imm/ab_010.htm','Coins; banknotes; currency; securities of any kind payable to bearer; traveler‘s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles, unless they are sent by First-Class Package International Service with Registered Mail service.\nCopper, bronze, or nickel coins.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','Importation of arms requires special permission. ','None'),('US','AX',NULL,'http://pe.usps.com/text/imm/fh_004.htm','Arms and weapons, including ammunition, firearm parts, barrels, bolts, breeches, clip magazines and silencers; active and deactivated firearms; live and deactivated ammunition; air, starter, and gas guns; replicas of firearms; explosive devices; and airsoft guns that imitate active firearms.\nHuman remains.\nLive plants and animals.\nRadioactive materials.','Medicines and drugs, including any substances that may be classed as pharmaceuticals by the Finnish authorities may only be addressed to authorized manufacturers, dealers, scientists, or public health officials for use or distribution in accordance with Finnish regulations. Such substances prepared in doses for use by patients must be clearly and correctly labeled showing the nature and quantity of the ingredients. \nThe authorization of the Finnish Ministry of Agriculture is required for the importation of meat and meat products. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  With regard to Finland’s list of prohibited arms and weaponry, for clarification, the following articles are not prohibited: paintball guns, toy guns, nail guns, bows, optical sights, empty holsters, and gun cleaning appliances. As of January 31, 2020, Finnish Customs charges addressees a customs clearance fee of 2.90 EUR for each individual item that meets all of the following criteria: It requires customs clearance, it has a value exceeding 22 EUR, and it arrives from outside the European Union (EU) or from special areas of the EU‘s excise duty and value-added taxation area.       \n'),('US','AZ',NULL,'http://pe.usps.com/text/imm/ab_014.htm','Articles for smoking opium and hashish.\nCoins; foreign currency; banknotes; credit notes or any securities payable to bearer; checks; precious metals (whether manufactured or not); precious stones; natural diamonds; jewels; or other valuable articles. Azerbaijan will accept no liability for loss of or damage to such items.\nExplosives.\nFilms containing technology on the manufacture of narcotics, psychotropic or toxic substances, explosives, or arms or ammunitions.\nFilms promoting immorality, violence, or terror.\nFirearms, ammunition, cutting and stabbing arms, and other articles designed for attack or defense (knuckledusters, stiletto blades, balls of paralyzing fluid, etc.), explosives, war materiel.\nNarcotics and psychotropic substances; articles for their use.\nPrinted matter (books, newspapers, pictures and other products of the printing industry; manuscripts, typescripts, and plans) promoting immorality, violence, or terror.\nRadioactive materials.\nRare plants listed in the Red Book of the Republic of Azerbaijan, antlers, and horns of the species Cervidae.','Articles subject to customs duty may not be sent in ordinary or registered First–Class Mail International items, First-Class Package International Service items, Priority Mail International Flat Rate Envelopes, or Priority Mail International Small Flat Rate Priced Boxes.\nBiological and veterinary products used in veterinary medicine and raw materials of animal or plant origin can be imported with authorization from the competent veterinary bodies and State bodies in charge of plant quarantine.\nHunting weapons and ammunition for them require prior authority of the Ministry of the Internal Affairs of Azerbaijan.\nMedicaments and vitamin preparations require authorization from the Ministry of Health of Republic of Azerbaijan.\nRadio-electronic media and high-frequency apparatus require prior authority by the Ministry of Posts and Telecommunications of the Republic of Azerbaijan.\nSeeds, plants, root tubers, bulk and other plant parts, fruits, legumes, and fresh vegetables must have prior authorization by the relevant State body in charge of plant quarantine in Azerbaijan.','All mail items that are received within a 30-day period and that contain merchandise with a total value of up to $1,000 may be imported free of duty. To assist the customs service in evaluating these items, it is recommended that customers attach relevant invoices or statements.'),('US','BA',NULL,'http://pe.usps.com/text/imm/ab_027.htm','The government of Bosnia-Herzegovina has instituted a temporary prohibition against mailing meats and meat products and milk and dairy products to Bosnia-Herzegovina.','No list furnished.','No list furnished.'),('US','BB',NULL,'http://pe.usps.com/text/imm/ab_018.htm','Radioactive materials. ','No list furnished.','None'),('US','BD',NULL,'http://pe.usps.com/text/imm/ab_017.htm','American cotton.\nArms, ammunition.\nBearer cheques, bank drafts, credit cards, cash, and foreign currency.\nCoffee plants, coffee seeds and coffee beans.\nCoins; banknotes; currency notes; traveler’s checks; gold, silver, platinum, manufactured or not; securities payable to bearer; precious stones; and other valuable articles. \nHemp. \nObscene books, pamphlets, papers, drawings, paintings, figures, or articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPiece goods ordinarily sold by the yard or by the piece manufactured outside of Bangladesh and not stamped to indicate the length in meters, yards, or fractions thereof.\nQuinine, colored pink. \nRadioactive materials. ','No list furnished.','None'),('US','BE',NULL,'http://pe.usps.com/text/imm/ab_020.htm','Arms and weapons.\nBronze, copper, and nickel coins not legal tender in Belgium, unless imported for collections. \nCommercial shipments containing any form of tobacco, including electronic or vapor cigarettes that contain nicotine.\nHuman remains. \nLive plants and animals. \nPerishable infectious biological substances. \nRadioactive materials. ','No list furnished. ','\nPriority Mail International parcels must have a street address. Delivery cannot be made to post office boxes. A local telephone number for the addressee should be provided.  For Priority Mail International parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  Import permits or licenses are required for many types of goods; therefore, the sender should ascertain from the addressee before mailing whether the necessary documents are held.  Gift shipments for private individuals for their personal use are exempt from the license requirement provided the value of the shipment does not exceed 74 EUR.        \n'),('US','BF',NULL,'http://pe.usps.com/text/imm/ab_033.htm','Perishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Coins; banknotes; currency notes; traveler’s checks; securities payable to the bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles may only be sent in registered shipments. ','First-Class Package International Service items containing dutiable articles must be sent with Registered Mail service. '),('US','BG',NULL,'http://pe.usps.com/text/imm/ab_032.htm','Arms and ammunition; explosive, flammable, or other hazardous materials.\nArticles of food and foodstuffs in hermetically sealed containers unless the contents are visible. \nBulgarian currency except with the permission of the Ministry of Finance of Bulgaria. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s cheques; platinum, gold, and silver, whether manufactured or not; precious stones; jewels; or other valuable articles in uninsured parcels.\nGift shipments mailed by commercial firms. \n“Musical” cards (cards that play a sound recording when opened). \nNarcotics, psychotropic substances, anesthetics, or toxic materials.\nObscene or immoral articles.\nPrinted matter, photographs, films, sound recordings, manuscripts, drawings, musical notes, and similar articles, except single copies for the personal use of the addressees and not contrary to Bulgarian laws and customs. \nRadioactive materials. \nReligious materials connected with prohibited or unregistered sects or organizations.\nSamples of merchandise. \nUsed clothing, footwear, and bed coverings. ','Import licenses are required for all commercial shipments, and for gift shipments if the customs duty thereon exceeds 100 leva. \nMedicines must be approved by the Bulgarian Ministry of Health. \nPostage stamps may only be exchanged between philatelists through the intermediary of the Postal Philatelic Service of Bulgaria. The articles must be addressed to that service, which delivers them to the addressees. ','First-Class Mail International and First-Class Package International Service items may not contain dutiable articles. '),('US','BH',NULL,'http://pe.usps.com/text/imm/ab_016.htm','Arms and ammunition.\nCultured, imitation, artificial, or bleached pearls.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','No list furnished.','None'),('US','BI',NULL,'http://pe.usps.com/text/imm/ab_035.htm','Coins; currency notes; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewels; expensive jewelry; and other valuable articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. ','Addressees in Burundi are required to obtain special permission to receive arms, medicines, saccharine and distilling apparatus. \nBanknotes; securities payable to bearer; and traveler’s checks, up to a total of 50 Burundi francs; are admitted in registered shipments. ','None'),('US','BJ',NULL,'http://pe.usps.com/text/imm/ab_022.htm','Arms and ammunition. \nCoins; banknotes; paper money; traveler’s checks; gold, platinum, silver, (manufactured or not); precious stones; jewelry; and other valuable articles. \nGold and gold articles.\nGramophone records.\nMedals and coins; machinery used for minting coins.\nMineral waters.\nPerishable infectious biological substances.\nRadioactive materials.\nSaccharine.\nUncut diamonds.','No list furnished.','\nFirst-Class Package International Service items containing dutiable articles must be sent with Registered Mail service.  Postal authorities of Benin collect domestic postage from addressees for inbound shipments.  Parcel service is limited to the following offices:     \n\n\nAbomey   \nCotonou   \nOuidah   \n\n\nAbomey-Calavi   \nCove   \nParahoue  \n\n\nAdjohon   \nDassa-Zoume   \nParakou  \n\n\nAllada   \nDjougou   \nPobe   \n\n\nAthieme   \nGrand-Popo   \nPorto-Novo   \n\n\nAttogon   \nKandi   \nSakete   \n\n\nBimbereke  \nNatitingou   \nSavalou   \n\n\nBohicon  \nNikki  \nSave  \n\n      \n\n\n\n\nAbomey   \nCotonou   \nOuidah   \n\n\nAbomey-Calavi   \nCove   \nParahoue  \n\n\nAdjohon   \nDassa-Zoume   \nParakou  \n\n\nAllada   \nDjougou   \nPobe   \n\n\nAthieme   \nGrand-Popo   \nPorto-Novo   \n\n\nAttogon   \nKandi   \nSakete   \n\n\nBimbereke  \nNatitingou   \nSavalou   \n\n\nBohicon  \nNikki  \nSave  \n\n\nAbomey \nCotonou \nOuidah \nAbomey-Calavi \nCove \nParahoue\nAdjohon \nDassa-Zoume \nParakou\nAllada \nDjougou \nPobe \nAthieme \nGrand-Popo \nPorto-Novo \nAttogon \nKandi \nSakete \nBimbereke\nNatitingou \nSavalou \nBohicon\nNikki\nSave'),('US','BL','FR','http://pe.usps.com/text/imm/fh_018.htm','Arms in general, except certain arms for hunting; military supplies of all kinds. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewels; and other valuable articles. \nCremated remains.\nFeeding bottles and feeding bottles with glass tubes.\nGardenia plants and seeds.\nPolice whistles.\nPowder of all kinds.\nTelegraphic apparatus.','No list furnished. ','Tape, adhesive strips, or gummed paper should not be used to seal registered items unless the signature or name of the sender is written or stamped on the tape. '),('US','BM','GB','http://pe.usps.com/text/imm/ab_023.htm','Perishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials.','No list furnished.','None'),('US','BN',NULL,'http://pe.usps.com/text/imm/ab_031.htm','Coins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Books, magazines, religious materials, cassettes, and video tape are subject to clearance from the Controller of Publications or the Religious Affairs Department. ','A license must be obtained from the Director of Medical Services for the importation of medicines, drugs, and insecticides, whether consigned to commercial firms or private individuals. \nA license must be obtained from the Director of Agriculture for the importation of agricultural and veterinary products. The importation of plants, seeds, etc. are subject to permit issued in advance by the Department of Agriculture. '),('US','BO',NULL,'http://pe.usps.com/text/imm/ab_025.htm','Arms and ammunition. \nArticles that violate the Bolivian trademark laws. \nBooks, pamphlets or other printed matter, paintings and illustrations, figures and objects of an obscene or immoral nature. \nCoins; banknotes; paper money; traveler’s checks; gold, platinum, silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nCounterfeit or illegal currency; advertisements imitating currency or postage stamps, except for philatelic or numismatic catalogs. \nGambling devices. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPocket lighters. \nRadioactive materials. \nTobacco in any form, cigarettes or cigarette papers or packaging. ','Pharmaceutical and medicinal products must be approved by the Bolivian health authorities. Senders should ascertain from the addressees in advance of mailing whether the medicine they desire to send will be admitted. \nUsed clothing must be accompanied by a certificate of disinfection issued by a competent authority (for example: Local Board of Health), or must be by a firm with facilities for disinfecting the articles involved. Senders must endorse the wrapper of shipments containing used clothing to show that a certificate of disinfection is enclosed. ','\nA commercial invoice signed by a Bolivian consulate is required for shipments exceeding U.S. $100 in value. The invoice must be in the form prescribed by the Bolivian consular regulations. If senders are not familiar with the requirements, they should be advised to consult one of the Bolivian consulates located in principal cities of the United States. Information may also be obtained from the American Republics Division, Bureau of International Commerce, Department of Commerce, Washington, D.C. 20230, or any field office of the Department. No invoices are required for shipments of lesser value.  Import permit is required when the value of a shipment exceeds U.S. $500.        \n'),('US','BQ',NULL,'http://pe.usps.com/text/imm/ab_026.htm','Coins; banknotes; currency; securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles, unless they are sent by First-Class Package International Service with Registered Mail service.\nCopper, bronze, or nickel coins.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','Importation of arms requires special permission. ','None '),('US','BR',NULL,'http://pe.usps.com/text/imm/ab_029.htm','Banknotes; currency notes; paper money; securities payable to bearer; and traveler’s checks. \nCoins; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewels; expensive jewelry; and other valuable articles. \nCommercial samples that promote tobacco products or smoking-related merchandise. \nCommercial shipments that contain cigarettes, cigarillos, cigars, loose and packaged tobacco, pipes, and other smoking devices. \nItems whose fragility (due either to nature or inadequate packing) could cause harm to individuals or equipment.\nMedicines whose formulas are not listed in the official pharmacopeias or not licensed by the Brazilian Department of Public Health. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPlaying cards.\nPoniards, stilettos, poniard blades; canes, umbrellas, or any other articles containing swords, daggers, or guns; handcuffs, and blackjacks. \nPrimary educational books not written in Portuguese. \nRadioactive materials. \nRegulation arms and munitions of Brazil and parts. Air guns. Reducing tubes and silencers for firearms. \nSalted or smoked meat, and other foodstuffs of animal origin. \nSeeds and seedlings of coffee, shrubs. \nUsed consumer goods (see Observation #6 for exception). ','Medicines must be accompanied by a prescription from the attendant Brazilian doctor. This prescription should be on a chemist’s form, bearing the name, private address or office of the doctor, his registration number with the Brazil National Medical Council and a Portuguese translation of the instructions, as necessary. Postal packages containing medicaments and not satisfying the above-mentioned conditions will be returned to the senders or, if abandoned, treated as undeliverable items. \nPostage stamps are admitted only in First-Class Package International Service with Registered Mail service shipments. \nSaccharine and other artificial sweeteners for artificial beverages require permission from the Brazilian Department of Public Health for importation.','\nEmpresa Brasileira de Correios e Telégrafos (ECT) is introducing a “Fee for Postal Dispatch” with a current value of 15 Brazilian reals (BRL) for items presented to customs. If the addressee has not properly paid this fee, ECT will return the item to the sender.  Import licenses are required for many kinds of goods. ECT recommends that the sender ascertain from the addressee before mailing that the addressee holds the necessary documents. A shipment that does not have a required import permit is subject to confiscation as contraband. The mailer must affix all necessary or relevant documents including invoices, export/import licenses, certificates of origin, health certificates, etc., to the outside of the item. Imports are allowed by mail, including mail order catalog shipments, up to a value of U.S. $500 (U.S. $1,000 for computer software) without the requirement of an import license provided the item is not for resale. Shipments valued at no more than U.S. $50 are duty-free and are delivered to the addressee; shipments above U.S. $50 can be picked up at the post office upon payment of import duties. Imports that are prohibited or subject to special regulations must comply with applicable Brazilian government provisions. Identical shipments from the same source to the same person or address in Brazil within a 90-day period are considered part of the same shipment and may be subject to confiscation. Other merchandise that usually enters duty-free includes items such as newspapers, maps, books, and magazines. The mailer must fully and accurately complete the customs declarations, including the landline or mobile telephone number of the addressee, if available, and detailed information concerning the contents and value of the item, such as branded product description, model, serial number, and value of each individual article within the item. ECT immediately returns to the sender an item that does not have a properly completed customs declaration. \nThe importer tax identification (ID) number is required for all items containing goods. In Brazil, the importer tax ID number is known as “CPF” (format: 000.000.000-00) for natural persons and as “CNPJ” (format: 00.000.000/0000-00) for legal persons. This information must be provided either by the mailer in the importer reference field of the customs declaration form or on the commercial invoice, or by the importer through the Correios website at https://www2.correios.com.br/sistemas/rastreamento. Shipments that do not indicate the applicable postage and fees on PS Form 2976-A will hinder the customs clearance process, causing delays to clear the items. Used consumer goods may only be sent to charitable organizations that are recognized by the Brazilian government as being entities which serve the public interest.       \n'),('US','BS',NULL,'http://pe.usps.com/text/imm/ab_015.htm','Obscene or indecent articles, books, pictures, printed matter.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.\nSkimmed milk in tins.','No list furnished.','None'),('US','BT',NULL,'http://pe.usps.com/text/imm/ab_024.htm','Perishable infectious biological substances. \nRadioactive materials.','No list furnished.','In order to facilitate customs clearance and delivery of postal items containing merchandise of any kind, all items sent to private individuals in Bhutan from businesses abroad, and all commercial items, should be accompanied by the relevant invoice(s). Items that are not accompanied by the corresponding invoice could be delayed, so it is recommended that the mailer include on the invoice the phone number of the sender and the phone number and e–mail address of the addressee.'),('US','BW',NULL,'http://pe.usps.com/text/imm/ab_028.htm','Butane gas cigarette lighters. \nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles are prohibited in all classes of mail, including Priority Mail Express International shipments, that are mailed to Botswana. \nHoney and preparations of honey including royal jelly, preserves sweetened with honey, and flypaper. \nPrison-made goods. \nUsed clothing for sale; used boots and shoes. ','None','\nImport licenses are required for many kinds of goods and senders should ascertain from the addressee before mailing that the necessary documents are held.  Import licenses are not required for bona fide gift shipments not exceeding 11 pounds.        \n'),('US','BY',NULL,'http://pe.usps.com/text/imm/ab_019.htm','Alcohol products, including ethyl alcohol and alcoholic beverages.\nAll weapons, arms and ammunition, and parts and accessories thereof, or articles similar in construction to civilian or service weapons.\nArticles of cultural value.\nCurrencies of the Republic of Belarus and the Russian Federation.\nExplosive or combustible substances or other dangerous matter.\nHazardous waste.\nMetalized yarn made with or made of gold thread; ornamental trimming or woven fabric made with or made of gold thread.\nNarcotics, psychotropic substances and their precursors, as well as plants and mushrooms containing narcotics, psychotropic substances and their precursors of any kind and in any form, including their fruits, seeds, and spores.\nOpium and other substances containing narcotics.\nPathogenic or potentially pathogenic organisms.\nPerishable items.\nPhotographic and cinematographic films, undeveloped photographic plates, photographic paper.\nPlants and plant seeds.\nPrecious stones in any form and condition; natural diamonds, except for jewelry.\nPrinted books, newspapers, pictures and other products of the printing industry; manuscripts, typescripts, and plans containing information that may be harmful to the political and economic interests of the country and to the health and morality of its citizens.\nRadioactive materials.\nSubstances harmful to the ozone layer.\nThe government of Belarus has instituted a temporary ban against the importation of all animal products that are for human and animal consumption. This includes meats, poultry, milk and dairy products, feeds, and other animal byproducts.\nTobacco, manufactured tobacco products, and smoking mixtures of all kinds.','Articles subject to customs duty may not be sent in ordinary or registered First-Class Mail International items, First-Class Package International Service items, Priority Mail International Flat Rate Envelopes, or Priority Mail International Small Flat Rate Priced Boxes.\nCanceled and uncanceled stamps may be sent as part of a prescribed philatelic exchange. \nCoins, bank notes, currency notes (paper money); securities of any kind payable to bearer; traveler’s checks, platinum, gold, and silver (manufactured or not); precious stones, jewelry, and other valuable articles are admitted only in insured Priority Mail International parcels. Importation of foreign currency is limited to a maximum equivalent of 200 USD. \nGoods ordered online must be accompanied by a pro forma invoice (an invoice that includes a description of the enclosed goods and their value).\nMedicaments and vitamin preparations require authorization issued by the Public Health of Belarus. \nVeterinary preparations, biological materials, and collectors’ items of animal origin require written authorization issued by the State Veterinary Inspectorate of the Ministry of Agriculture and Foods in Belarus. ','\nDepending on the nature and origin, many articles are regulated and admitted only on presentation of permission from the authorized bodies in Belarus. As of January 1, 2019, the value and weight limits for goods sent to a private individual in one package are 22 EUR and 10 kg (22 pounds), respectively. For goods sent to one addressee within a calendar month, the total duty-free value and weight limits are 200 EUR and 31 kg (68 pounds), respectively — customs duties apply to the amounts exceeding 200 EUR and 31 kg.       \n'),('US','BZ',NULL,'http://pe.usps.com/text/imm/ab_021.htm','Arms and ammunition. \nCoins; platinum, gold, silver; precious stones; jewelry; and other valuable articles; coins; or bullion are permitted if clearly intended for purposes of ornament. \nSaccharine and similar substances and articles containing them. \nTobacco packed with other merchandise; tobacco sweetened with leaves of other plants. ','No list furnished.','None'),('US','CA',NULL,'http://pe.usps.com/text/imm/ce_003.htm','An issue of a publication in which more than 5 percent of its total advertising space is primarily directed to a Canadian market and which indicates: \n\nSpecifically where goods or services may be obtained in Canada, or  Specific items or conditions relating to the sale or provision of goods or services in Canada.  \n\nAll alcoholic beverages including wines, etc. \nAn issue of a publication that contains an advertisement primarily directed to a Canadian market is a prohibited import if that advertisement does not appear in identical form in all editions of the issue distributed in the country of origin. \nArticles so marked as to create the false impression that they were made in Canada, the United Kingdom, or any other British country. \nCommercial tags of metal.\nFirearms, except as follows: Firearms may be mailed to Canada if the importer has the required documentation and if the firearms meet the requirements in Publication 52, subchapter 43 and part 632. Before mailing, customers must visit cbsa-asfc.gc.ca/import/iefw-iefa-eng.html to review Canadian import requirements.\nGold bullion, gold dust, and nonmanufactured precious metals. \nNon-refillable lighters or any other lighter that contains fuel. New lighters with no fuel may be sent. \nOleomargarine and other butter substitutes, including altered or renovated butter. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPlumage and skins of wild birds. \nPrison-made goods being sold or intended for sale by a person or firm. \nRadioactive materials. \nReplica or inert munitions, as well as other devices that simulate explosive devices or munitions, including replica or inert grenades or other simulated military munitions, whether or not such items are for display purposes.\nReprints of Canadian or British works copyrighted in Canada. \nReproductions of Canadian postage stamps unless printed in publications in black and white only and with a defacing line drawn across each reproduction. \nShipments bearing caution labels indicating the contents are flammable. \nSmoke-making devices for motor vehicles and boats. \nUsed or secondhand hives or bee supplies. \nVaping liquids containing 66 mg/g or more nicotine by weight. Note: The U.S. Postal Service measures the concentration of nicotine solutions by volume rather than by weight, so it is possible that a product that does not exceed Canada’s weight restriction would exceed the Postal Service’s volume restriction. Nicotine solutions with a concentration of 16.67 percent (166 mg/ml) or more, when nicotine is the only toxic material in the liquid, are classified as “dangerous goods” (see 136.1) and as such are prohibited in international mail. (See also Observation 1.)','Coins; banknotes; currency notes; securities payable to bearer; traveler’s checks; gold, silver, platinum, manufactured or not; jewelry; and other valuable articles may be sent only by First-Class Package International Service with Registered Mail service.Exceptions:Coins sent to or from collectors or dealers may be mailed in ordinary (uninsured) parcels.\nDrugs and medicines must comply with Canadian law. \nEggs for hatching must be packed in new, clean containers and accompanied by a certificate issued by a veterinarian of the U.S. Department of Agriculture, or one issued by a State veterinarian and endorsed by a veterinarian of that Bureau, stating that to the best of his or her knowledge the eggs come from a flock that is free from Newcastle disease, fowl pest, or fowl typhoid. See 135.3 for method of packing. \nMeat and meat food products must be accompanied by an export certificate issued by the U.S. Department of Agriculture and labeled in accordance with Canadian regulations. Exception to these requirements are: \n\nbona fide sample shipments weighing less than 10 kg;  meat products addressed to a government department or agency;  meat products intended for personal consumption when they enter Canada in the possession of the importer. \n\nPet food that contains biologically appropriate raw food or bones and raw food — such as heat-processed, shelf-stable pet foods, treats, and compound chews — must be accompanied by an import permit from the Canadian Food Inspection Agency and a zoo sanitary certificate from the United States Department of Agriculture (USDA) Animal and Plant Health Inspection Service (APHIS) Veterinarian Services. Attach a copy of both documents to the outside of the mailpiece for review by the Canada Border Service Agency.\nPrecious stones, set or not set; all items used as dress ornaments and coming under the term “jewelry” including articles of gold or other precious metal for personal use such as cigarette holders, cases, powder cases, card cases, opera glasses, fountain pens, watches, etc., are permitted in insured parcels provided the articles have value not over $5 U.S. A parcel containing a number of such articles valued at $5 or less may be insured for the total value of the contents up to a maximum of $200. \nVeterinary biological products including serums and vaccines must be accompanied by a permit issued by the Veterinary Director General, Ministry of Agriculture of Canada. ','\n\nAs noted in the Prohibitions section, Canada prohibits certain vaping products. However, vaping products, otherwise known as electronic smoking products (i.e., electronic products for the vaporization and administration of inhaled doses of nicotine including electronic cigarettes, cigars, cigarillos, and pipes, as well as cartridges of nicotine solutions and related products), that make health claims are subject to the Canadian Food and Drugs Act (FDA). “Health claims” refers to any statement that represents the product as a drug or device under section 2 of the FDA — for example, a statement that the product will help someone quit smoking. Vaping products that make health claims require authorization under the FDA before being commercially imported, advertised, or sold in Canada. A vaping product that makes health claims is considered a prescription drug, and before importation to Canada, it requires a Drug Establishment License and an assigned corresponding Drug Identification Number (DIN). For more information, visit canada.ca/en/health-canada/topics/licensing-authorizing-manufacturing-drug-health-products.html. Vaping products with no health claims and no drugs other than nicotine are not subject to the FDA. Banknotes valued at $100 or more must be put up in a compact package and securely tied with strong twine before wrapping. The wrapper must be linen or other strong, woven material, linen lined paper, or two thicknesses of strong kraft paper. After wrapping, the package must be again securely tied or stitched and sealed at the points of closing.  The name of the Canadian province in which the office of destination is located must appear as part of the address.  The following must not be accepted for insurance: Bees, postage stamps (canceled and uncanceled) and albums in which they are mounted, and parcels addressed to CFPOs. Canadian Forces Mail (CFPO) is processed through Canadian military post offices and must be addressed in the following manner:  \n NUMBER, RANK, NAME UNIT   CFPO (NUMBER)   BELLEVILLE ON K0K 3R0   CANADA  \nMaximum weight limits for mail addressed to members of the Canadian Forces based outside of Canada (CFPO) is 22 pounds. Parcels for CFPO addresses may not be insured. Direct sacks of printed matter (M-bags) are not permitted for CFPO addresses.  A letter fully prepaid and bearing the same address as that of a parcel may be tied or otherwise securely attached to the outside of the parcel. Stamps to cover postage on the parcel must be affixed to the wrapper of the parcel. Stamps to pay postage on the letter must be affixed to the envelope thereof.  Certain types of merchandise must be marked to show country of origin in the manner prescribed by the Canadian customs regulations.  Goods valued under 20 Canadian dollars are duty and excise tax exempt. Goods over 20 Canadian dollars will be subject to the applicable duties and excise taxes. Gift shipments received by mail that are valued under 60 Canadian dollars are duty and excise tax exempt.  \nFor all casual and commercial goods valued at or under 1,600 Canadian dollars, Canada Post will collect assessed duties, excise taxes, and a handling fee from the addressee. This handling fee is set by Canada Post (see canadapost.ca/tools/pg/manual/PGcustoms-e.asp). All commercial mail items over 1,600 Canadian dollars will be held by Canada Customs and Excise until proper invoice and accounting documentation is provided by the addressee.  \nThe Canada Customs Invoice can be obtained from stationery, office supply, or printing companies. If mailers are unable to obtain the Canada Customs Invoice locally, they should visit the following Web site: canadapost.ca. In addition, commercial invoices are acceptable provided that each invoice has the required information for customs purposes.  Information on Canadian customs regulations may be obtained from the Office of International Marketing/223, Bureau of International Commerce, Department of Commerce, Washington, DC 20230, or any field office of that Department.  Obtaining post code information: \nInformation on Canadian post code directories can be obtained from:  NATIONAL PHILATELIC CENTERCANADA POST CORPORATION STATION 1 ANTIGONISH NS B2G 2R8 Telephone: 1-800-565-4362 Fax: 1-902-863-6796 \nTo obtain Canadian post codes for specific addresses, call the General Information line at 1-416-979-8822 or access the Canada Post Corporation Web site on the Internet at canadapost.ca. \nPursuant to the Canada Customs Act and a need to heighten border security, Canada will deny entry of all postal items (except postcards) that do not bear complete sender and addressee information in roman letters and arabic numerals.    \n\nMaximum weight limits for mail addressed to members of the Canadian Forces based outside of Canada (CFPO) is 22 pounds. Parcels for CFPO addresses may not be insured. Direct sacks of printed matter (M-bags) are not permitted for CFPO addresses. \nA letter fully prepaid and bearing the same address as that of a parcel may be tied or otherwise securely attached to the outside of the parcel. Stamps to cover postage on the parcel must be affixed to the wrapper of the parcel. Stamps to pay postage on the letter must be affixed to the envelope thereof. \nCertain types of merchandise must be marked to show country of origin in the manner prescribed by the Canadian customs regulations. \nGoods valued under 20 Canadian dollars are duty and excise tax exempt. Goods over 20 Canadian dollars will be subject to the applicable duties and excise taxes. Gift shipments received by mail that are valued under 60 Canadian dollars are duty and excise tax exempt. \n\nFor all casual and commercial goods valued at or under 1,600 Canadian dollars, Canada Post will collect assessed duties, excise taxes, and a handling fee from the addressee. This handling fee is set by Canada Post (see canadapost.ca/tools/pg/manual/PGcustoms-e.asp). All commercial mail items over 1,600 Canadian dollars will be held by Canada Customs and Excise until proper invoice and accounting documentation is provided by the addressee. \n\nThe Canada Customs Invoice can be obtained from stationery, office supply, or printing companies. If mailers are unable to obtain the Canada Customs Invoice locally, they should visit the following Web site: canadapost.ca. In addition, commercial invoices are acceptable provided that each invoice has the required information for customs purposes. \nInformation on Canadian customs regulations may be obtained from the Office of International Marketing/223, Bureau of International Commerce, Department of Commerce, Washington, DC 20230, or any field office of that Department. \nObtaining post code information:\n\nInformation on Canadian post code directories can be obtained from:  NATIONAL PHILATELIC CENTERCANADA POST CORPORATION STATION 1 ANTIGONISH NS B2G 2R8 Telephone: 1-800-565-4362 Fax: 1-902-863-6796 \nTo obtain Canadian post codes for specific addresses, call the General Information line at 1-416-979-8822 or access the Canada Post Corporation Web site on the Internet at canadapost.ca. \n\nPursuant to the Canada Customs Act and a need to heighten border security, Canada will deny entry of all postal items (except postcards) that do not bear complete sender and addressee information in roman letters and arabic numerals.\nNATIONAL PHILATELIC CENTERCANADA POST CORPORATION STATION 1 ANTIGONISH NS B2G 2R8 Telephone: 1-800-565-4362 Fax: 1-902-863-6796\n\nTo obtain Canadian post codes for specific addresses, call the General Information line at 1-416-979-8822 or access the Canada Post Corporation Web site on the Internet at canadapost.ca.'),('US','CD',NULL,'http://pe.usps.com/text/imm/ce_012.htm','Perishable infectious biological substances. \nRadioactive materials. ','Arms of all kinds require the authorization of the Democratic Republic of the Congo Ministry of the Interior. \nMedicines and biological products require the authorization of the medical authorities of the Democratic Republic of the Congo. \nSaccharine and products containing it require the authorization of the Ministry of Economic Affairs. ','None'),('US','CF',NULL,'http://pe.usps.com/text/imm/ce_006.htm','Arms and ammunition. \nCoins; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewelry; and other valuable articles. \nPamphlets and leaflets containing propaganda derogatory to the countries of Equatorial Africa. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPreserved fish, vegetables and plums not clearly marked with the country of origin or contained in tins of more than 1 kg. \nRadioactive materials. ','Medical or pharmaceutical products, may only be addressed to licensed pharmacists. \nTobacco products are admitted provided the import duties and taxes are paid. The immediate container (box, case or cigarette package) must be marked “Vente en U.D.E.” (Sale in Equatorial Customs Union) below the trademark. ','\nFirst-Class Mail International and First-Class Package International Service items may not contain dutiable articles.  Postal authorities of Central African Rep. collect domestic postage from addressees for inbound shipments.       \n'),('US','CG',NULL,'http://pe.usps.com/text/imm/ce_013.htm','Coins; currency notes (paper money); securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewelry; and other valuable articles. \nPamphlets and leaflets containing propaganda derogatory to the countries of Equatorial Africa. \nRadioactive materials. ','Arms importation must be authorized by Republic of the Congo authorities. \nMedical or pharmaceutical products may only be addressed to licensed pharmacists. \nTobacco products. The immediate container (box, case, or cigarette package) must be marked “Vente en U.D.E.” (Sale in Equatorial Customs Union) below the trademark. ','None'),('US','CH',NULL,'http://pe.usps.com/text/imm/ps_041.htm','Arms and weapons. \nFiring caps and loaded metal cartridges for portable firearms, nonexplosive parts of artillery fuses, flammable films, or articles made of celluloid. \nHuman remains. Only cremated remains (human ashes) are permitted.\nLive plants and animals.\nLottery tickets and advertisements for lotteries.\nMini-spies (miniature wireless transmitters).\nRadar detectors.','No list furnished. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  A letter or card fully prepaid and bearing the same address as that of a Priority Mail International parcel may be tied to or otherwise securely attached to the outside of the parcel in such manner as to prevent its separation therefrom and not to interfere with the address of the parcel. Stamps to cover postage on the parcel must be affixed to the wrapper of the parcel. Stamps to pay postage on the letter must be affixed to the envelope thereof, or in the case of a postcard, to the address side of the card, preferably the upper-right portion. Priority Mail International parcels to which such letters or cards are attached are treated as parcel post. As of January 1, 2019, foreign mail order companies, including from the United States, with an annual turnover of at least 100,000 Swiss Francs (CHF) originating from small consignments (tax amount not exceeding 5 CHF) to Switzerland must pay a value-added tax (VAT) and register with the Swiss Federal Tax Administration.       \n'),('US','CI',NULL,'http://pe.usps.com/text/imm/ce_015.htm','Articles bearing the Red Cross or Geneva Cross as a \ntrademark. \nButane lighters. \nDaggers, sword-canes, brass knuckles, blackjacks, and other secret weapons; firing caps; and loaded metal cartridges. \nForeign products, natural or manufactured, having markings, labels, or wrappings of any kind that may give the impression that they are of Ivory Coast origin. \nLoose, uncleft or uncut diamonds.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.\nWeights and measures not of the decimal system.','Arabic books and prints are subject to special checking on importation. \nGold and gold articles (except jewelry and gold articles that are personal belongings in current use) require an import license from the Ministry of Economics and Finance. \nTinned fish, vegetables, and plums must bear on each container an indication of the country of origin in raised or sunken letters at least 4 millimeters (3/8 inch) high, in the middle of the lid and of the bottom, in a space not bearing any inscription. Cases and wrappers containing these products must bear adhering letters indicating the country of origin. ','\nFirst-Class Package International Service items containing dutiable articles must be sent with Registered Mail service. Postal authorities of Ivory Coast collect domestic postage from addressees for inbound shipments.       \n'),('US','CK',NULL,'http://pe.usps.com/text/imm/mo_024.htm','Ammunition. \nCoins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry, and other valuable articles unless sent in insured Priority Mail International. \nCommunist material or literature. \nForeign lottery tickets. \nLighters. \nPharmaceutical specialties not registered in Nicaragua: pharmaceutical preparations or secret remedies of unknown composition whose formulas have not been made public. \nPolice whistles. \nTelegraph equipment. ','Firearms require the permission of the Government. \nPlant- and animal-based substances are subject to seizure unless they are accompanied by a phytosanitary export certificate from the country of origin.','Tape, adhesive strips, or gummed paper should not be used to seal registered items unless the signature or name of the sender is written or stamped on the tape. '),('US','CL',NULL,'http://pe.usps.com/text/imm/ce_008.htm','Beverages and foodstuffs containing saccharine and similar substances. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Seeds are required to be accompanied by a phytosanitary certificate. A U.S. mailer must obtain the phytosanitary certificate from the United States Department of Agriculture (USDA) Animal and Plant Health Inspection Service (APHIS).','\nFirst-Class Mail International and First-Class Package International Service items may not contain dutiable articles.  Shipments must be accompanied by commercial invoices that bear a declaration of origin in English or Spanish, signed by the mailer, in the following terms:  “Under oath, we declare that we are the owners (or shippers) of the above mentioned merchandise; that the prices and other details are exact; that the said merchandise is a product of the soil or industry of (country of origin) and that we accept the legal consequences that might arise through any inexactitude contained in this account.”  Persons desiring to mail shipments should be advised to consult the addressees in advance of mailing to ascertain whether their articles will be admitted.       \n\n“Under oath, we declare that we are the owners (or shippers) of the above mentioned merchandise; that the prices and other details are exact; that the said merchandise is a product of the soil or industry of (country of origin) and that we accept the legal consequences that might arise through any inexactitude contained in this account.” \nPersons desiring to mail shipments should be advised to consult the addressees in advance of mailing to ascertain whether their articles will be admitted.'),('US','CM',NULL,'http://pe.usps.com/text/imm/ce_002.htm','Coins; gold; jewelry; platinum; precious stones; and silver.\nRadioactive materials.\nUsed clothing.','Banknotes, currency notes, and securities payable to bearer may be sent only as First-Class Package International Service with Registered Mail service. ','None'),('US','CN',NULL,'http://pe.usps.com/text/imm/ce_009.htm','Animal-derived fertilizer, animal carcasses, animal specimens, and animal-derived waste.\nAnimals (live), including mammals, birds, fish, amphibians, reptiles, insects, and other invertebrates; and animal genetic materials.\nArms, ammunition, weapons. Firearms and firearm components (including replica firearms); prohibited knives and edged weapons; crossbows; defensive chemical dispensers (mace, pepper spray, tear gas, etc.); and electric stun guns.\nArticles in hermetically sealed, nontransparent containers.\nBiochemical products.\nChinese currency.\nCoins; banknotes; securities payable to bearer; traveler’s checks; gold, silver, platinum, manufactured or not; precious stones; jewelry; and other valuable articles, unless sent as an insured post.\nCubilose (edible birds’ nests).\nEggs and egg products.\nFresh fruits and vegetables.\nGenetically modified biomaterials.\nManuscripts, printed matter, photographic negatives, gramophone records, films, magnetic tapes, video tapes, etc., which could do political, economical, cultural, or moral harm to the People’s Republic of China.\nMeat and meat products, including raw or cooked meat (including viscera), fat, grease, hides, hooves, bones, horns, animal derived feedstuffs (such as meat meal, fish meal, bone meal, and whey powder), and animal-derived Chinese medicinal materials.\nMilk and dairy products.\nPerishable infectious and noninfectious biological substances including microbial strains, virus strains, and other animal and plant pathogens; pests and other harmful organisms; cells, organs, and tissues; blood and blood products; and other biological materials.\nRadioactive materials.\nRadio receivers, transmitters or receivers of all kinds, walkietalkies and parts thereof; valves, antennae, etc.\nSeeds, seedlings, nursery stocks, and other plant propagating materials.\nSoil and organic cultivation media.\nTobacco leaves (except cut tobacco).\nToxic substances.\nUsed clothing and bedding.\nWrist-watches, cameras, television sets, radio sets, tape records, bicycles, sewing machines, and ventilators.','The importation of personal articles is limited to those intended for personal use and imported in reasonable quantities. The value of the items contained in each shipment must not exceed RMB (renminbi) 100 yuan and the total value of the shipment received annually by each family may not exceed RMB (renminbi) 800 yuan. However, the following articles are admitted in the quantities/values indicated, and any articles that do not meet the requirements mentioned below will be returned to origin or confiscated in accordance with China’s internal laws: \n\n\n\nDescription of Articles  \nQty. or Value per Item  \nComment   \n\n \nPocket electronic calculator \n \n1 per year   \nThe addressee must submit a prior request to Customs.   \n\n \nMagnetic tape  \n \n5 cassettes   \n   \n\n \nCotton or synthetic fabric \n \n10-1/4 yd (10 m)   \nWidth must not exceed 50 inches (130 cm).   \n\n \nMedicines or materials used in Chinese medicine \n \nRMB 40 yuan   \n   \n\n \nPhilatelic stamps \n \n100 stamps   \n   \n\n\nDescription of Articles\nQty. or Value per Item\nComment \n1 per year \nThe addressee must submit a prior request to Customs. \n5 cassettes \n10-1/4 yd (10 m) \nWidth must not exceed 50 inches (130 cm). \nRMB 40 yuan \n100 stamps ','\nItems that contain powders, liquids, lithium batteries, or lithium cells are prohibited for carriage by domestic air transport within China. Any of these items that are approved for international air transport and arrive at the initial gateways in China will be forwarded via ground transportation to their next destination. China Post will accept no liability for the delay in delivering these items.  As of November 30, 2018, the General Administration of Customs of the People’s Republic of China (GACC) will dispose of any inbound mail item that lacks proper customs information or that the recipient refuses or does not claim in a timely manner. In addition, GACC will dispose of any item that it cannot deliver or return (including undeliverable liquids that fail aviation security checks). Mailers should be aware of the following customs requirements in China: \nItems for personal use mailed to China are subject to duty and tax. However, items imported for personal use are exempt from duty and tax, if such duties and taxes are equal to or less than 50 CNY. Items for personal use imported into China (not including items imported from Hong Kong, Macau, and Taiwan) may not exceed 1,000 CNY. When items imported for personal use exceed the allowed value limit, three outcomes are possible: \nThe items will be returned. If Customs determines that the items are not for personal use but are actually intended for commercial use, the items will be cleared using commercial customs procedures. If Customs determines that the items are actually intended for personal use, then supporting documents such as a trade contract, commercial invoice, packing list, waybill, customs declaration brokerage authorization agreement, import and export license, or other similar documentation will need to be provided. \nIf imported items are intended for commercial use, commercial customs clearance will be applied. China Customs permits only shippers and consignees that are registered declarants or other registered enterprises to present items that must be accompanied by the documents mentioned in paragraph 3c above. Individuals or companies that are not registered with China Customs to affect clearance are advised to entrust the customs clearance process to enterprises that are specifically registered with China Customs for this purpose. \n   \n'),('US','CO',NULL,'http://pe.usps.com/text/imm/ce_010.htm','Cash; coins; bank notes; molds for bank notes; pieces of paper representing real bank notes or any other bearer bonds; coinage machines; other articles of value such as platinum, gold, or silver, whether manufactured or not; precious stones; jewelry; other valuable articles; and counterfeit and pirated articles.\nColoring powders and similar. \nDocuments having the character of current and personal correspondence exchanged between persons other than the sender and the addressee or persons living with them.\nFats.\nLive animals, and dead animals not stuffed. Exemptions: Bees, leeches, and silkworms, as well as parasites and destroyers of noxious insects exchanged between officially recognized scientific institutions. \nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.\nNote: Colombia prohibits many types of goods, or subjects them to an import license; therefore, the sender should ascertain from the addressee before mailing whether the contents are permitted and whether the addressee holds the necessary documents.','New and used clothing is permitted when mailed as unaccompanied baggage. The words “Equipaje no acompanado” and the owner’s passport number must be shown on the address label and the accompanying documents. Used clothing must have a certificate of disinfection enclosed. ','\nFirst-Class Mail International and First-Class Package International Service items may not contain dutiable articles.  Books and other printed matter, if valued over $20, require consular invoices, and the addressees must obtain import licenses.  A commercial invoice, numbered, certified and signed by the sender, must accompany each package containing books and periodicals of a commercial nature. In addition, the value of each item, the number of packages comprising the shipment, and gross weight must be shown on the invoice. One copy of the invoice should be sent to the post office of destination. A note must be made on each package of the number of books contained therein, its weight and the total number of packages comprising the shipment.  Packages must be addressed directly to the addressee, as the Colombian regulations do not permit customs entry to be effected by anyone except the addressee or an authorized representative.  Each shipment valued at $20 or less requires two copies of the sender’s commercial invoice, one of which must be enclosed in the parcel and the other sent under separate cover to the addressee. Consular legalization is not needed but the invoice must include a declaration of origin of the merchandise, in Spanish, reading as follows:  “Certificamos bajo juramento que los precios de esta factura son los mismos que cargamos al cliente y que la mercancia a que se refiere esta misma factura es originaria de (Country of Origin). En fe de lo expuesto firmamos la presente declaracion en (City, State) (Day) de (Month) de (Year) (Signature of shipper)”.  (Translation: We certify under oath that the prices in this invoice are the same that we charge our customers, and that the merchandise in this same invoice comes from (Country of origin). In faith of which we sign the present declaration at (City, State), on (Date).  For shipments valued over $20, the sender must have a copy of his or her commercial invoice legalized by a Colombian Consulate, and must prepare 4 copies of a consular invoice, one of which must be sent direct to the addressee with the legalized commercial invoice.  The addressees in Colombia are required in most cases to obtain import licenses in order to secure delivery of shipments. For shipments exceeding $20 in value the addressee is required to send a copy of the import license to the sender, who must submit it to the Colombian Consul when obtaining the consular invoice. If a sender receives a copy of a Colombian import license for a parcel whose value does not exceed $20, he or she must return it to the addressee in Colombia.  Consular invoice forms may be obtained and commercial invoices legalized at Colombian Consulates, which are located in principal cities of the United States.       \n\n“Certificamos bajo juramento que los precios de esta factura son los mismos que cargamos al cliente y que la mercancia a que se refiere esta misma factura es originaria de (Country of Origin). En fe de lo expuesto firmamos la presente declaracion en (City, State) (Day) de (Month) de (Year) (Signature of shipper)”. \n(Translation: We certify under oath that the prices in this invoice are the same that we charge our customers, and that the merchandise in this same invoice comes from (Country of origin). In faith of which we sign the present declaration at (City, State), on (Date). \nFor shipments valued over $20, the sender must have a copy of his or her commercial invoice legalized by a Colombian Consulate, and must prepare 4 copies of a consular invoice, one of which must be sent direct to the addressee with the legalized commercial invoice. \nThe addressees in Colombia are required in most cases to obtain import licenses in order to secure delivery of shipments. For shipments exceeding $20 in value the addressee is required to send a copy of the import license to the sender, who must submit it to the Colombian Consul when obtaining the consular invoice. If a sender receives a copy of a Colombian import license for a parcel whose value does not exceed $20, he or she must return it to the addressee in Colombia. \nConsular invoice forms may be obtained and commercial invoices legalized at Colombian Consulates, which are located in principal cities of the United States.'),('US','CR',NULL,'http://pe.usps.com/text/imm/ce_014.htm','Blank invoices. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewelry; and other valuable articles. \nDual-graduation feeding bottles.\nFirearms (including parts and accessories) except those destined to a competent organization or entity that is officially authorized to handle them. Note: The mailer is responsible for determining whether the recipient organization or entity is authorized to handle such items.\nFlammable or explosive substances.\nMedical samples containing psychotropic substances.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive Materials.','A certificate of disinfection must be enclosed in packages containing used clothing. Senders should endorse the wrapper to show that a certificate of disinfection is enclosed. ','Commercial shipments must be accompanied by a commercial invoice in duplicate. These invoices must be attached to the item or enclosed inside the item.'),('US','CU',NULL,'http://pe.usps.com/text/imm/ce_017.htm','Coins; banknotes; currency notes; securities payable to bearer; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewelry; and other valuable articles.\nMusical letters or cards that play a sound recording when opened.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','The maximum value of any mailed item sent to Cuba must not exceed $200 in value or else it will be subject to confiscation by Cuban General Customs.','Items not eligible for import into Cuba may be confiscated upon entering Cuba or returned to sender.'),('US','CV',NULL,'http://pe.usps.com/text/imm/ce_004.htm','Coins; banknotes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry and other valuable articles. \nMedicines and pharmaceutical drugs unless authorized by the Ministry of Health. \nPerishable infectious biological substances. \nRadioactive materials. ','Fresh and frozen fruit; fats and vegetable oils, except olive oil; tinned meat; fish and preserved fish; and salt require authorization by the Cape Verde Secretary of State for Commerce. ','None'),('US','CW',NULL,'http://pe.usps.com/text/imm/ce_018.htm','Coins; banknotes; currency; securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles, unless they are sent by First-Class Package International Service with Registered Mail service.\nCopper, bronze, or nickel coins.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','Importation of arms requires special permission. ','None '),('US','CX',NULL,'http://pe.usps.com/text/imm/ab_012.htm','Antiquities, art fossils, historical documents, numismatic material, specimens of flora and fauna, and similar cultural heritage objects that are significant to a nation’s identity.\nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (except for jewelry items meeting the requirement in “Restrictions” below); precious stones (except when contained in jewelry items meeting the requirement in “Restrictions” below); and other valuable articles are prohibited.\nDog collars with protrusions designed to puncture or bruise an animal’s skin.\nFruit cartons (used or new).\nFur, including raw, tanned, or processed furs or pelts, and goods that may contain such fur that are derived from domesticated cat and dog breeds.\nGoods bearing the name “Anzac.”\nGoods produced wholly or partly in prisons or by convict labor.\nLaser pointers and similar handheld devices designed or adapted to emit a laser beam with an accessible emission level greater than 1 megawatt (MW).\nMost food, plant, and animal products, including the use of products such as straw and other plant material as packing materials.\nPerishable infectious biological substances.\nRadioactive materials.\nRegistered philatelic articles with fictitious addresses.\nReplica firearms, including any article that has the appearance of a firearm that could reasonably be mistaken as a firearm.\nSeditious literature.\nSignal jammers capable of preventing or disrupting mobile telephone and satellite navigation services.\nSilencers for firearms.\nTobacco products, including cigarettes and loose-leaf tobacco. Exception: Cigars. Note: Although Australia also permits chewing tobacco and oral snuff in amounts up to 3.3 pounds (1.5 kg), the U.S. Postal Service does not permit these types of smokeless tobacco in international mail — see 136.4.\nUsed bedding.','Airsoft (BB) guns that do not have the appearance of fully automatic firearms require prior approval granted by relevant police representatives. The addressee must submit an application to import the item via the police certification test.\nDrugs, medicines, and therapeutic substances such as antibiotics, growth hormones, kava, psychoactive substances, and steroids require an import permit from the Australian Department of Health, Office of Drug Control. \nFish or parts of fish, including all species of bony fish, sharks, rays, crustaceans, mollusks, and other marine organisms (but not including marine mammals, marine reptiles, or toothfish), whether fresh, frozen, smoked, or preserved in airtight containers, require an import permit from the Australian Fisheries Management Authority (AFMA).\nJewelry is permitted only when sent as an insured parcel using Priority Mail International service. In addition, Australian Customs regulations prohibit importation of jewelry that is made with ivory or from endangered species, such as snake, elephant, or crocodile, that does not have an accompanying Import/Export Permit in relation to the Convention on International Trade in Endangered Species of Wild Fauna and Flora (CITES).\nKnives (such as daggers and throwing knives), throwing blades, or throwing axes require written Police Certification (B709B form or B709X form) from the Australian Police Firearms Registry.\nMeat and other animal products; powdered or concentrated milk; and other dairy products requires permission to import from the Australian quarantine authorities. \nPermission of the Australian Director-General of Health is required to import medicines.','Duty may be levied on catalogs, price lists, circulars, and all advertising introduced into Australia through the mail, regardless of the class of mail used.'),('US','CY',NULL,'http://pe.usps.com/text/imm/ce_019.htm','Books or other publications giving instructions regarding the construction, operation, maintenance, or care of any prohibited firearm, other than a harpoon gun used for fishing purposes, and excluding books and publications imported by the Cyprus Police Force or any Cyprus Department of Government. \nDaggers. \nExplosives and flammable substances. \nLeeches and silkworms. \nPostcards of private manufacture having illustrated designs not previously approved by the Cyprus Post Office. \nRadioactive materials. \nRifles and repeating firearms. \nSeditious publications. ','Articles for the manufacture of cigarettes require permission of the Cyprus customs authorities. \nBees, honey and substances containing uncooked honey require permission of the Ministry of Agriculture. \nRags and used clothing require a permit from the Cyprus Ministry of Health. \nRegistered items containing coins; banknotes; currency notes or securities of any kind payable to bearer; traveler’s checks; manufactured or unmanufactured platinum, gold, or silver; or precious stones, jewelry, or other valuable articles are admitted only under a license from the Cyprus Central Bank. ','Commercial shipments must be accompanied by relevant invoices, attached to the outside of the item, preferably in an unsealed envelope.'),('US','CZ',NULL,'http://pe.usps.com/text/imm/ce_020.htm','Chain letter items. \nPerishable infectious substances. \nPerishable noninfectious substances. \nPlaying cards.\nPublications, drawings, photographs, records, sheets of music, etc., contrary to the State public order. \nRadioactive materials. ','Coins; paper money; securities and other paper values of any kind; as well as savings-bank booklets; and unmanufactured gold, silver, and platinum may be imported only by authorization of the State Bank. \nGift shipments must be sent by private individuals. Those sent by commercial firms are not admitted. \nImport permits are required for gift shipments exceeding three per year for one addressee, or for any shipment exceeding 3,000 Czech Republic crowns in value. Permits may be issued to addressees or withheld at the discretion of the customs authorities after the shipment arrives. \nMedicines are admitted provided the addressee is in possession of an import permit granted by the Czech Republic health authorities. \nPhilatelic articles and stamps exchanged between member philatelists must not exceed 1,000 Czech Republic crowns in any calendar year. Gift packages containing philatelic articles are restricted to 3 per year and the shipment cannot exceed a total of 100 stamps or philatelic articles and 100 Czech Republic crowns in value. ','\nImport licenses and quantity restrictions are applicable for many articles sent to the Czech Republic. Therefore, senders should ascertain from the addressee before mailing whether the contents are permitted and whether the necessary documents are held.  Gift shipments for the personal use of the addressee or the addressee’s family do not require an import permit if the contents do not exceed 5,000 Czech Republic crowns. When the total exceeds 2,000 Czech Republic crowns, the addressee must provide a gift certificate authenticated by an authorized agent in that country. Czech Republic customs decides the value of the contents on the basis of internal prices of identical articles.  Articles imported in postal items are exempt from customs duties if their total value does not exceed 300 Czech Republic crowns.       \n'),('US','DE',NULL,'http://pe.usps.com/text/imm/fh_011.htm','Absinthe.\nArms and weapons, including firearms, parts of arms, ammunition, and imitation arms.\nArticles bearing political or religious notations on the address side. \nHuman remains. \nLithium cells and batteries — including items containing lithium cells and batteries under 135.6.\nLive plants and animals. \nMelatonin. \nPerishable infectious biological substances. \nPlaying cards, except in complete decks properly wrapped.\nPulverized coca beans. \nRadioactive materials. ','Importation of medicines requires special authorization by German authorities. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For Priority Mail International parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  Mailpieces delivered through international bulk mail services must be addressed with the correct postcode number or delivery zone number, if one exists. Without this number, the German postal administration will return such pieces to the sender or the country of origin due to insufficient addressing.  Import licenses or certificates are required for meat and meat products; pasta products; dairy products; egg and egg products; plant and plant products; tobacco products; and cigarette paper. Senders should ascertain before mailing whether the necessary documents are held by the addressee.  The customs treatment of gift parcels will be facilitated if the customs declaration is marked by the sender “Private Geschenksendung” (personal gift package).  Customs authorities require invoices with books valued at 26 EUR or more.  Germany will not accept any Priority Mail Express International or Priority Mail International insured item valued at more than $500. Items valued at more than $500 will be returned to sender.        \n'),('US','DJ',NULL,'http://pe.usps.com/text/imm/ce_022.htm','Perishable infectious biological substances. \nRadioactive materials. ','Paper money and other instruments of payment; letters of credit; securities; or deeds must be accompanied by a permit issued by the French exchange-control authorities, or imported by a bank. ','On the address label or customs form of each item sent with Registered Mail service, First-Class Package International Service, Priority Mail International service, or Priority Mail Express International service, display the addressee’s landline or mobile telephone number, if available. This contact information enables La Poste de Djibouti to notify the addressee, particularly via short message service (SMS), that the item is due to be delivered or is available for collection.'),('US','DK',NULL,'http://pe.usps.com/text/imm/ce_021.htm','Almanacs (except for single copies) that do not bear the University almanac stamp. \nArms, weapons, and firearms, including air rifles, airsoft guns, gun barrels, breeches, cross bows; knives of any kind with blades of more than 12 cm (approximately 4.7 in.); switch-blade knives, push daggers, thrusting, or stabbing weapons regardless of blade length; knuckledusters, truncheons, clubs, and other similar articles. \nDried or powdered milk, and food mixtures containing it. \nFine-cut tobacco in small packages to which cigarette papers are attached. \nHuman remains. \nLighters utilizing a catalyst for ignition. \nLive plants and animals. \nPlaying cards.\nRadioactive materials. ','Danish and foreign stocks, bonds, and coupons may not be imported unless the addressee possesses a permit issued by the National Bank of Denmark. \nMedicines may be imported in amounts costing less than 100 Danish kroner only by pharmacists, laboratories recognized by the State, or authorized dealers. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.       \n'),('US','DM',NULL,'http://pe.usps.com/text/imm/ce_023.htm','Aerosols.\nCoins.\nLithium batteries mailed to or sent via Dominica, including those properly installed in the equipment they are intended to operate.\nPerishable infectious biological substances.\nRadioactive materials.','No list furnished. ','Include both the addressee’s and sender’s telephone number and email address on all mail items, if available. This contact information assists Dominica Postal Service to expedite delivery.'),('US','DO',NULL,'http://pe.usps.com/text/imm/ce_024.htm','Books addressed to bookshops in care of banking institutions. \nCoins; banknotes; currency notes; manufactured and unmanufactured platinum, gold, silver; precious stones; jewels; expensive jewelry; and other valuable articles. \nPoniards, daggers, stilettos, sticks, or fans with concealed blades or firearms. \nRoulette games and other gambling devices. ','No list furnished.','None'),('US','DZ',NULL,'http://pe.usps.com/text/imm/ab_003.htm','Articles made of tortoise-shell, mother of pearl, ivory, bone meerschaum and amber (succin), natural or reconstructed, worked jade and mineral substances similar to jade. \nCanned vegetables, fish, plums and nuts. \nFuneral urns.\nHousehold articles made of tin.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nPictures and printed matter of pornographic or immoral nature, or which tend to incite crime or juvenile delinquency. \nRadioactive materials. \nSaccharine in tablets or packets. \nUsed clothing, accessories, blankets, linen, textile furnishings, footwear and headwear.\nWatches and clocks. ','Articles of gold or platinum, jewelry and precious stones must be licensed by the Algerian Ministry of Finance. \nCoins, banknotes, negotiable securities, checks and other instruments of payment, may only be imported by the Central Bank of Algeria or approved intermediary banks. \nMedicines for human or veterinary use, dietetic products, serums, vaccines and similar produce; medical, surgical, and dental instruments and prostheses require prior approval from the Ministry of Public Health and subject to the visa of the Central Algerian Pharmacy. ','Import permits or licenses are required for many types of goods; therefore, the sender should ascertain from the addressee before mailing whether the necessary documents are held. '),('US','EC',NULL,'http://pe.usps.com/text/imm/ce_025.htm','All maps showing the territory of Ecuador with incorrect boundaries. \nBits and mouthpieces made of copper or any alloy containing copper. \nCoins, banknotes, currency notes. \nFeeding bottles with rubber or glass tube. \nLeaf or manufactured tobacco and cigarette paper except with the authorization of the Government. \nLeather shoes in general; cloth and rubber shoes. \nMobile telephones.\nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPharmaceutical products and compound medicines whose formula is not known. \nPreparations for erasing ink and handwriting. \nRoulette games, gambling paraphernalia, labels, imprints. \nSo-called “Panama” and “Mocora” hats and the straw used for making them. \nUncanceled postage stamps in ordinary mail. \nUnrefined salt. \nWeapons, sticks, fans, and other objects containing hidden razors, daggers, or firearms. ','Any item containing vegetable components in any form whatsoever must be accompanied by a health certificate as prescribed by the internal legislation of Ecuador. \nMailable perfume and creams (i.e., non-flammable and non-alcohol based) are limited to a maximum of three units. Each unit cannot exceed 3 ounces per package. Packages containing over three units will be deemed to be for commercial purposes and must be accompanied by the appropriate license, with import duty charged regardless of value or weight.\nSecurities payable to bearer; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewels; jewelry; or other valuable articles may only be sent in Registered Mail.\nUsed clothing is prohibited unless items weighing no more than 44 pounds are declared as personal effects, and the sender and the addressee are the same person. All other used clothing items will be seized by Customs.\nUsed shoes and clothes may be sent, but only in parcels weighing no more than 4 kilos (approximately 8.9 pounds).','\nArticles valued over 2,000 dollars require 5 copies of the Consular invoice, 3 copies must be countersigned and stamped by the Consul; for the other two copies only the consulate’s official stamp is required. All copies must bear the date of certification and the serial number of the consulate. In the absence of these invoices, shipments are subject to very high customs duty and consular and import duties. Regardless of mail class or contents, items containing goods require a commercial invoice.       \n'),('US','EE',NULL,'http://pe.usps.com/text/imm/ce_030.htm','Arms, munitions, and parts and accessories thereof. \nCoins, bank notes, currency notes; traveler’s checks; securities payable to bearer; platinum, gold, or silver (manufactured or not); precious stones, jewelry, and other valuable articles. \nExplosive and pyrotechnics articles; combustible materials. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Articles subject to customs duty may not be sent in ordinary or registered First-Class Mail International items, First-Class Package International Service items, Priority Mail International Flat Rate Envelopes, or Priority Mail International Small Flat Rate Priced Boxes.\nFlour and preparations of cereals are permitted to private persons subject to inspection by quarantine officials. \nMedicines, narcotic and psychotropic substances; other products used in medical treatment are subject to prior authorization by the Estonian Ministry of Social Maintenance Health Department or by the Estonian State Department of Veterinary. \nWireless transmission equipment is subject to addressee’s compliance with import restrictions, permits, or quota conditions. ','Estonia Post requests that each registered or nonregistered small packet, parcel, or Priority Mail Express International item addressed to a parcel locker contain the addressee’s telephone or mobile phone number and e-mail address on the customs declaration form. This contact information is crucial to pre-advise addressees of delivery or to notify them that their items are ready for collection.'),('US','EG',NULL,'http://pe.usps.com/text/imm/ce_026.htm','Coins; banknotes; currency notes; securities payable to bearer; travelers’ checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewelry; and other valuable articles unless sent in insured parcels. \nLiquids.\nLithium batteries.\nMedals resembling Egyptian or foreign currency.\nObscene or immoral books, engravings or printed matter.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','Import permits issued in advance by the appropriate Egyptian authorities are required for gramophone records of Arabic songs, cinema films and recording tapes; medicines, plants and parts of plants. \nMinted coins and gold and silver ingots may only be sent in insured parcels. ','\nImport permits are required for all kinds of goods and for gift shipments with a value of more than 20 Egyptian pounds. No import permit is required for items with a value less than 20 Egyptian pounds on condition that they are intended for personal use and have no commercial value.  To facilitate customs treatment, all documents (bills, licenses, certificates) should be inserted in each shipment.        \n'),('US','ER',NULL,'http://pe.usps.com/text/imm/ce_029.htm','Coins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewelry; and other valuable articles. \nMatches of white phosphorus. ','Cassettes, video tapes, books, and magazines require authorization of the Ministry of Information and Education. \nGold (non-ornamental) having commercial value is admitted by a special authorization of the Bank of Eritrea. \nRadio communication apparatus requires authorization from the Telecommunications Authority. \nMerchandise valued more than 50 Birr require authorization of the National Bank. \nPrepared foods and beverages, used clothes, medicines require authorization of the Ministry of Public Health. ','\nFirst-Class Mail International and First-Class Package International Service items may not contain dutiable articles.  Postal authorities of Eritrea may collect domestic postage from addressees for inbound shipments.  In order to facilitate customs clearance and delivery, senders must enclose in their mailpieces a copy of an invoice covering the contents. Such invoices must be attested by an appropriate authority of the country of origin (chamber of commerce, board of trade, etc.).  Packing and Packaging — All shipments must be very strongly packed. Contents liable to be affected by dampness should be enclosed in two separate waterproof covers.       \n'),('US','ES',NULL,'http://pe.usps.com/text/imm/ps_035.htm','Arms, including spare parts and ammunition. \nInfectious substances, including exempt patient specimens (human or animal) and Category B infectious substances under 135.1.\nGambling items, such as playing cards, poker chips, and games of chance.\nNarcotics, including those prescribed by a doctor.\nRadioactive materials, including radioactive materials under 135.5.','No list furnished. ','All goods sent to South Sudan are subject to a customs clearance fee of 450 South Sudan Pounds (SSP) and an administration fee of 550 SSP.'),('US','ET',NULL,'http://pe.usps.com/text/imm/ce_031.htm','Arms; ammunition, and fuses for firearms. \nButane gas cigarette lighters. \nCigarettes exceeding 2 kg per thousand pieces. \nCoins, banknotes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nDiamonds or gems (mounted or not), metallic currency, and gold in powder or in nuggets. \nHoney and preparations of honey including “royal jelly,” preserves sweetened with honey, and flypaper. \nPerishable infectious biological substances. \nPrison-made goods. \nRadioactive materials. ','No list furnished. ','None '),('US','FI',NULL,'http://pe.usps.com/text/imm/fh_004.htm','Arms and weapons, including ammunition, firearm parts, barrels, bolts, breeches, clip magazines and silencers; active and deactivated firearms; live and deactivated ammunition; air, starter, and gas guns; replicas of firearms; explosive devices; and airsoft guns that imitate active firearms.\nHuman remains.\nLive plants and animals.\nRadioactive materials.','Medicines and drugs, including any substances that may be classed as pharmaceuticals by the Finnish authorities may only be addressed to authorized manufacturers, dealers, scientists, or public health officials for use or distribution in accordance with Finnish regulations. Such substances prepared in doses for use by patients must be clearly and correctly labeled showing the nature and quantity of the ingredients. \nThe authorization of the Finnish Ministry of Agriculture is required for the importation of meat and meat products. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  With regard to Finland’s list of prohibited arms and weaponry, for clarification, the following articles are not prohibited: paintball guns, toy guns, nail guns, bows, optical sights, empty holsters, and gun cleaning appliances. As of January 31, 2020, Finnish Customs charges addressees a customs clearance fee of 2.90 EUR for each individual item that meets all of the following criteria: It requires customs clearance, it has a value exceeding 22 EUR, and it arrives from outside the European Union (EU) or from special areas of the EU‘s excise duty and value-added taxation area.       \n'),('US','FJ',NULL,'http://pe.usps.com/text/imm/fh_003.htm','Arms and ammunition, flick knives. \nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; and traveler’s checks are prohibited in registered and unregistered First-Class Mail International, First-Class Package International Service, insured and uninsured parcels, as well as Priority Mail Express International shipments, that are mailed to Fiji. \nDyes and coloring materials.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','Tobacco, cigars, cigarettes, and snuff may not exceed 11 pounds or be packed with other merchandise. ','Each commercial shipment must be accompanied by a certified invoice (original or copy), written in English or French and attached to the outside of the article. The invoice must not be enclosed in the article.'),('US','FK','GB','http://pe.usps.com/text/imm/fh_001.htm','Radioactive materials. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nOtherwise, same as for the United Kingdom. ','Same as for the United Kingdom, except for prohibitions listed above and Priority Mail International service that is suspended because transportation is unavailable. ','None'),('US','FO',NULL,'http://pe.usps.com/text/imm/fh_002.htm','Radioactive materials. \nSame as for Denmark. ','Coins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewelry; and other valuable articles may only be sent in First-Class Package International Service with Registered Mail service items or insured parcels.\nSame as for Denmark. ','Same as for Denmark.'),('US','FR',NULL,'http://pe.usps.com/text/imm/fh_005.htm','Arms, ammunition.\nBanknotes, coins that are current and legal tender in France, and precious metals.\nCigarette lighters using butane gas.\nFeeding bottles.\nFuneral urns.\nGoods bearing false marks of French manufacture or origin.\nHuman remains.\nImitation pearls containing lead salts and any articles of jewelry made with pearls of this type.\nLive plants and animals.\nMeasuring instruments marked in units not complying with French law.\nPerishable infectious biological substances except as noted in Restrictions below.\nPerishable noninfectious biological substances except as noted under Restrictions below.\nRadioactive materials.\nSaccharine in tablets or packets.','Bees, honey, and beeswax must be accompanied by a certificate of origin and noninfection issued by a qualified official approved by the Government. Shipments of honey not exceeding 2 kilograms do not require the certificate.\nBooks in the French language printed abroad must have the names of the publisher and printer shown as prescribed by the French copyright laws.\nCanned vegetables, fish, plums, and nuts not bearing an indication of the country of origin by stamping, in plain raised or sunken letters at least 4 millimeters high, in the middle of the top or bottom and in a place not bearing any inscription.\nGold coins or other articles of gold require that the addressee have a permit issued by the Bank of France (not required for gold-plated articles or for ornaments or jewelry containing only small amounts of gold and weighing 500 grams or less).\nMedicines and medicinal products require an import license issued by the Central Pharmaceutical Service of the Ministry of Health.\nPerishable biological substances, infectious and noninfectious, are admitted when addressed to the following laboratories:\n\nPasteur Institute  25 rue du docteur Roux  75724 Paris CEDEX 14  FRANCE Pasteur Institute  1 rue du Professeur Calmette  59019 Lille CEDEX BB 245  FRANCE Pasteur Institute  77 rue Pasteur  69365 Lyon CEDEX  FRANCE \n\n25 rue du docteur Roux \n75724 Paris CEDEX 14 \nFRANCE\nPasteur Institute \n1 rue du Professeur Calmette \n59019 Lille CEDEX BB 245 \nFRANCE\nPasteur Institute \n77 rue Pasteur \n69365 Lyon CEDEX \nFRANCE\nPlants, seeds, bulbs must be accompanied by plant health certificate. \nThe importation of tobacco leaves and stems, manufactured tobaccos, cigars, cigarettes, chewing and smoking tobacco is permitted only on behalf of the State Monopoly, with the following exception: Manufactured tobaccos, including cigars and cigarettes, may be sent to individuals in France for personal use up to 10 kilograms (22 pounds) per person per year, subject to special customs authorization.','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box. For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration. It is recommended that all articles bear, as part of the address, the name of the Province in which the office of destination is located. Printed matter of value should have Form 2976 affixed, and it can be cleared more readily through French customs if an invoice is enclosed. Parcels whose senders or addressees are designated by initials will not be admitted. Shipments must not be fastened by means of wire, but straps not having sharp edges may be used, provided they are tightly fastened so that no sharp ends or corners are exposed.       \n'),('US','GA',NULL,'http://pe.usps.com/text/imm/fh_008.htm','All articles prohibited to France. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nPamphlets and leaflets containing propaganda derogatory to the countries of Equatorial Africa. \nRadioactive materials. \nTobacco, cigars and cigarettes. ','Medical or pharmaceutical products may only be addressed to licensed pharmacists. ','None'),('US','GB',NULL,'http://pe.usps.com/text/imm/tz_018.htm','Aerosols.\nAmmunition, except lead pellets.\nAnimals, live (including reptiles).\nArms and parts of arms, or any component classified as munitions of war; imitations and antiques; paint-ball or toy guns; taser guns; air rifles, air pistols, components of firearms, and all other items similar to or resembling the foregoing.\nArticles, goods infringing British trademarks or copyright laws.\nAsbestos items of any kind.\nChristmas crackers (holiday popper).\nClinical and medical waste (e.g., contaminated dressings, bandages, and needles).\nCoins; platinum, gold, or silver (manufactured or not); precious stones; jewels; and other valuable articles.\nCounterfeit currency, bank notes, and postage stamps.\nDies and equipment for making imitations, etc., of any current postage stamp for denoting any rate of postage.\nFish, live.\nFrozen food.\nFrozen water (including bags of ice).\nGoods made in foreign prisons, except those imported for a noncommercial purpose or of a kind not manufactured in the United Kingdom.\nIndecent and obscene prints, paintings, books, cards, lithographs, and other engravings, films, video tapes, or any other indecent or obscene articles.\nLead acid batteries (e.g., car batteries) and sealed lead acid batteries.\nLottery tickets and related advertisements for illegal lotteries.\nMedicines classified as flammable or toxic.\nRadioactive materials and samples that are classified as radioactive using Table 2-12 of the latest edition of the International Civil Aviation Organization’s Technical Instructions — e.g., fissile material (uranium 235, etc.), radioactive waste material, thorium, or uranium ores and luminous dials from aircraft.\nSoil.\nSoiled clothes and rags.\nStun gun, electric.\nSwitchblade knives (also known as flick knives) and gravity knives.\nWaste, dirt, filth, or refuse, including household waste or rubbish.','A consignment of live bees must contain only queen bees and their attendant workers; colonies are not permitted. Each consignment must be accompanied by an import license issued by the Dept. of Agriculture (DEFRA) and a health certificate issued by the country of origin.\nCaterpillars, cockroaches, crickets, destroyers of noxious pests, earthworms, fish fry and eggs, flies of the family Drosophilidae, leeches, lugworms, maggots, mealworms, pupae and chrysalides, rag worms, silkworms, spiders, and stick insects are admissible only for biomedical research (see license requirement for bees).\nHuman and animal cremated remains (ashes) must not exceed 50 grams and must be in a sift-proof container and securely closed. Items must be tightly packed in strong outer packaging and must be secured or cushioned to prevent any damage. The sender’s name and return address must be clearly visible on the outer packaging. Her Majesty’s Revenue and Customs (HMRC) recommends that cremated human remains should be accompanied by a certificate of cremation from a crematorium authority.\nMedicines and drugs when sent for scientific purposes must be sent by a practitioner, registered dental practitioner, veterinary surgeon, registered nurse, or recognized laboratory or institution.\nPlants and parts of plants require an import permit issued by the appropriate Agricultural Department in the United Kingdom.\nVaccines may be sent only by, or at the specific request of, a qualified medical practitioner, registered dental practitioner, veterinary surgeon, registered nurse, or recognized laboratory or institution.','\nThe following is a list of the names of the counties and city names in Northern Ireland. The County names are in capital letters. The geographic identifiers should be used in addressing mail to Northern Ireland:       \n\n\nANTRIM:   \nDOWN:   \nLONDONDERRY:   \n\n\nAntrim   \nBanbridge   \nColeraine   \n\n\nBallymena   \nBangor   \nKilrea   \n\n\nBelfast   \nDownpatrick   \nLimavady   \n\n\nCarrickfergus   \nKilkeel   \nLondonderry   \n\n\nLarne   \nNewcastle   \nMagherafelt   \n\n\nLisburn   \nNewry   \nPortstewart   \n\n\nPortrush   \nNewtownards   \nTYRONE:   \n\n\nToomebridge   \nFERMANAGH:   \nCookstown   \n\n\nWhitehead   \nEnniskillen   \nDugannon   \n\n\nARMAGH:   \n   \nMoy   \n\n\nArmagh   \n   \nOmagh   \n\n\nLurgan   \n   \nStrabane   \n\n\nPortsdown   \n   \n   \n\nMany types of merchandise, unless sent as unsolicited gifts, require import licenses that the addressees must obtain from the British Board of Trade. Before mailing commercial shipments, senders should be assured that the addressees can obtain licenses if needed.  All goods sent to the UK are liable to customs duty and Value Added Tax on importation whether or not the package is marked as a “gift.” Packages are admitted free of customs charges, however, if they meet the following conditions:  \nGift packages of small value provided they do not contain any tobacco goods, spirits or wine;  Gift packages containing only well-worn clothing (excluding garments of high value), limited quantities of foodstuffs (other than caviar), soap or consumable medical supplies.  \nPostal packages without a customs declaration that contain goods liable to customs duty or control may be seized by the customs authorities.  Firearms that are intended for sporting purposes are mailable to the United Kingdom, provided the prospective addressee has obtained the required import license.  The United Kingdom limits the weight of M-bags to 20 kg (44 lbs.).  As of November 5, 2018, Parcelforce Worldwide, part of Royal Mail Group Ltd., charges a single-import customs clearance fee of 12 pounds sterling (GBP) for all low-value parcels subject to customs charges that it delivers — i.e., parcels whose declared value is more than 15 GBP (for merchandise) or 39 GBP (for gifts), but not more than 873 GBP. Parcelforce Worldwide charges a flat fee of 25 GBP for high-value goods of more than 873 GBP.       \n\n\n\n\nANTRIM:   \nDOWN:   \nLONDONDERRY:   \n\n\nAntrim   \nBanbridge   \nColeraine   \n\n\nBallymena   \nBangor   \nKilrea   \n\n\nBelfast   \nDownpatrick   \nLimavady   \n\n\nCarrickfergus   \nKilkeel   \nLondonderry   \n\n\nLarne   \nNewcastle   \nMagherafelt   \n\n\nLisburn   \nNewry   \nPortstewart   \n\n\nPortrush   \nNewtownards   \nTYRONE:   \n\n\nToomebridge   \nFERMANAGH:   \nCookstown   \n\n\nWhitehead   \nEnniskillen   \nDugannon   \n\n\nARMAGH:   \n   \nMoy   \n\n\nArmagh   \n   \nOmagh   \n\n\nLurgan   \n   \nStrabane   \n\n\nPortsdown   \n   \n   \n\n\nMany types of merchandise, unless sent as unsolicited gifts, require import licenses that the addressees must obtain from the British Board of Trade. Before mailing commercial shipments, senders should be assured that the addressees can obtain licenses if needed. \nAll goods sent to the UK are liable to customs duty and Value Added Tax on importation whether or not the package is marked as a “gift.” Packages are admitted free of customs charges, however, if they meet the following conditions: \n\nGift packages of small value provided they do not contain any tobacco goods, spirits or wine;  Gift packages containing only well-worn clothing (excluding garments of high value), limited quantities of foodstuffs (other than caviar), soap or consumable medical supplies.  \n\nPostal packages without a customs declaration that contain goods liable to customs duty or control may be seized by the customs authorities. \nFirearms that are intended for sporting purposes are mailable to the United Kingdom, provided the prospective addressee has obtained the required import license. \nThe United Kingdom limits the weight of M-bags to 20 kg (44 lbs.). \nAs of November 5, 2018, Parcelforce Worldwide, part of Royal Mail Group Ltd., charges a single-import customs clearance fee of 12 pounds sterling (GBP) for all low-value parcels subject to customs charges that it delivers — i.e., parcels whose declared value is more than 15 GBP (for merchandise) or 39 GBP (for gifts), but not more than 873 GBP. Parcelforce Worldwide charges a flat fee of 25 GBP for high-value goods of more than 873 GBP.\nANTRIM: \nDOWN: \nLONDONDERRY: \nAntrim \nBanbridge \nColeraine \nBallymena \nBangor \nKilrea \nBelfast \nDownpatrick \nLimavady \nCarrickfergus \nKilkeel \nLondonderry \nLarne \nNewcastle \nMagherafelt \nLisburn \nNewry \nPortstewart \nPortrush \nNewtownards \nTYRONE: \nToomebridge \nFERMANAGH: \nCookstown \nWhitehead \nEnniskillen \nDugannon \nARMAGH: \nMoy \nArmagh \nOmagh \nLurgan \nStrabane \nPortsdown '),('US','GD',NULL,'http://pe.usps.com/text/imm/fh_016.htm','Ammunition, firing-caps, and charged metal cartridges. \nCoins. ','No list furnished. ','None '),('US','GE',NULL,'http://pe.usps.com/text/imm/fh_010.htm','Articles and materials of an immoral nature. \nBees, leeches, silkworms, and parasites. \nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles in all mail. \nExplosives, inflammable substances, toxic substances, and other dangerous substances. \nNarcotics, psychotr