es containing only well-worn clothing (excluding garments of high value), limited quantities of foodstuffs (other than caviar), soap or consumable medical supplies.  \nPostal packages without a customs declaration that contain goods liable to customs duty or control may be seized by the customs authorities.  Firearms that are intended for sporting purposes are mailable to the United Kingdom, provided the prospective addressee has obtained the required import license.  The United Kingdom limits the weight of M-bags to 20 kg (44 lbs.).  As of November 5, 2018, Parcelforce Worldwide, part of Royal Mail Group Ltd., charges a single-import customs clearance fee of 12 pounds sterling (GBP) for all low-value parcels subject to customs charges that it delivers — i.e., parcels whose declared value is more than 15 GBP (for merchandise) or 39 GBP (for gifts), but not more than 873 GBP. Parcelforce Worldwide charges a flat fee of 25 GBP for high-value goods of more than 873 GBP.       \n\n\n\n\nANTRIM:   \nDOWN:   \nLONDONDERRY:   \n\n\nAntrim   \nBanbridge   \nColeraine   \n\n\nBallymena   \nBangor   \nKilrea   \n\n\nBelfast   \nDownpatrick   \nLimavady   \n\n\nCarrickfergus   \nKilkeel   \nLondonderry   \n\n\nLarne   \nNewcastle   \nMagherafelt   \n\n\nLisburn   \nNewry   \nPortstewart   \n\n\nPortrush   \nNewtownards   \nTYRONE:   \n\n\nToomebridge   \nFERMANAGH:   \nCookstown   \n\n\nWhitehead   \nEnniskillen   \nDugannon   \n\n\nARMAGH:   \n   \nMoy   \n\n\nArmagh   \n   \nOmagh   \n\n\nLurgan   \n   \nStrabane   \n\n\nPortsdown   \n   \n   \n\n\nMany types of merchandise, unless sent as unsolicited gifts, require import licenses that the addressees must obtain from the British Board of Trade. Before mailing commercial shipments, senders should be assured that the addressees can obtain licenses if needed. \nAll goods sent to the UK are liable to customs duty and Value Added Tax on importation whether or not the package is marked as a “gift.” Packages are admitted free of customs charges, however, if they meet the following conditions: \n\nGift packages of small value provided they do not contain any tobacco goods, spirits or wine;  Gift packages containing only well-worn clothing (excluding garments of high value), limited quantities of foodstuffs (other than caviar), soap or consumable medical supplies.  \n\nPostal packages without a customs declaration that contain goods liable to customs duty or control may be seized by the customs authorities. \nFirearms that are intended for sporting purposes are mailable to the United Kingdom, provided the prospective addressee has obtained the required import license. \nThe United Kingdom limits the weight of M-bags to 20 kg (44 lbs.). \nAs of November 5, 2018, Parcelforce Worldwide, part of Royal Mail Group Ltd., charges a single-import customs clearance fee of 12 pounds sterling (GBP) for all low-value parcels subject to customs charges that it delivers — i.e., parcels whose declared value is more than 15 GBP (for merchandise) or 39 GBP (for gifts), but not more than 873 GBP. Parcelforce Worldwide charges a flat fee of 25 GBP for high-value goods of more than 873 GBP.\nANTRIM: \nDOWN: \nLONDONDERRY: \nAntrim \nBanbridge \nColeraine \nBallymena \nBangor \nKilrea \nBelfast \nDownpatrick \nLimavady \nCarrickfergus \nKilkeel \nLondonderry \nLarne \nNewcastle \nMagherafelt \nLisburn \nNewry \nPortstewart \nPortrush \nNewtownards \nTYRONE: \nToomebridge \nFERMANAGH: \nCookstown \nWhitehead \nEnniskillen \nDugannon \nARMAGH: \nMoy \nArmagh \nOmagh \nLurgan \nStrabane \nPortsdown '),('US','GH',NULL,'http://pe.usps.com/text/imm/fh_012.htm','Arms and ammunition.\nCurrency: banknotes, treasury notes, currency notes, and coins.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','Manufactured and unmanufactured platinum, gold, and silver; precious stones; and jewelry may only be sent in insured Priority Mail International parcels. ','None '),('US','GI','GB','http://pe.usps.com/text/imm/fh_013.htm','Arms and weapons.\nHuman remains.\nLighters containing butane gas and refills therefor.\nLive plants and animals.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','None ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For Priority Mail International parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.        \n'),('US','GL',NULL,'http://pe.usps.com/text/imm/fh_015.htm','Radioactive materials. \nSame as for Denmark. ','Same as for Denmark. ','Shipments containing items subject to ad valorem duty require an invoice, which should be sent to the addressee in advance. '),('US','GM',NULL,'http://pe.usps.com/text/imm/fh_009.htm','Coins, West African paper money. \nFirearms and firearm parts. ','Banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewelry; and other valuable articles may be sent only in First-Class Package International Service with Registered Mail service shipments. ','None '),('US','GN',NULL,'http://pe.usps.com/text/imm/fh_019.htm','Arms, ammunition, daggers, sword-canes, brass knuckles, blackjacks, and other secret weapons. \nArticles bearing the “Red Cross” or “Geneva Cross” as a trademark. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewels; and other valuable articles. \nForeign products, natural or manufactured, having markings, labels, or wrappings of any kind that may give the impression that they are of French origin. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. \nWeights and measures not of the metric system. ','Foreign products from a place having the same name as a place in France must bear, in addition to the name of that place, the name of the country of origin and the word “imported” in clearly visible letters. \nTinned fish, vegetables, and plums must bear on each container an indication of the country of origin in raised or sunken letters at least 4 millimeters (3/8 inch) high, in the middle of the lid and of the bottom, in a space not bearing any inscription. Cases and wrappers containing these products must bear adhering letters indicating the country of origin. ','None '),('US','GP','FR','http://pe.usps.com/text/imm/fh_017.htm','Perishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Coins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewels; expensive jewelry; and other valuable articles may only be sent in First-Class Package International Service with Registered Mail service shipments. \nSame as for France. ','Invoices and certificates of origin are required as for France. '),('US','GQ',NULL,'http://pe.usps.com/text/imm/ce_028.htm','No list furnished.','No list furnished.','None'),('US','GR',NULL,'http://pe.usps.com/text/imm/fh_014.htm','Aluminum foil for tobacco manufacturing. \nArms and weapons. \nCoins; traveler’s checks; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles, except banknotes, currency notes (paper money), and securities payable to bearer may be sent in First-Class Package International Service with Registered Mail service shipments. \nFirearms, swords, and any articles containing them. \nFresh meat, preserved meat, rawhides, wool, and other animal products must be accompanied by a certificate showing the place of origin and stating that it is free of disease. \nHuman remains. \nLive plants and animals. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPlaying cards; saccharine; tobacco, cigars, cigarettes; and cigarette papers. \nRadioactive materials. ','Banknotes, currency notes, and securities payable to bearer may only be sent in First-Class Package International Service with Registered Mail service shipments. \nCans of condensed milk require a label in the Greek language indicating the directions for its use. \nHunting arms and other commercial arms require special permission from the Greek authorities. \nMedicines must be packaged in the manufacturer’s container bearing his or her distinctive marks. Since admissible medicines must be licensed or specially authorized by the Greek authorities for importation, mailers should ascertain in advance whether the addressees will be able to take delivery. \nUsed clothing, bedding, and rags must be accompanied by a certificate of origin stating that they have been disinfected. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For Priority Mail International parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  Greece reserves the right to collect a “presentation-to-Customs charge” from customers for any item submitted to customs control, even if no customs charges are levied. Many types of merchandise are subject to import licenses and are not delivered without permission of the Greek authorities. Senders should ascertain from the addressees in advance of mailing, that their shipments will be delivered.        \n'),('US','GS','GB','http://pe.usps.com/text/imm/fh_001.htm','Radioactive materials. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nOtherwise, same as for the United Kingdom. ','Same as for the United Kingdom, except for prohibitions listed above and Priority Mail International service that is suspended because transportation is unavailable. ','None'),('US','GT',NULL,'http://pe.usps.com/text/imm/fh_018.htm','Arms in general, except certain arms for hunting; military supplies of all kinds. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewels; and other valuable articles. \nCremated remains.\nFeeding bottles and feeding bottles with glass tubes.\nGardenia plants and seeds.\nPolice whistles.\nPowder of all kinds.\nTelegraphic apparatus.','No list furnished. ','Tape, adhesive strips, or gummed paper should not be used to seal registered items unless the signature or name of the sender is written or stamped on the tape. '),('US','GW',NULL,'http://pe.usps.com/text/imm/fh_020.htm','Perishable infectious biological substances. \nRadioactive materials. ','Arms, munitions, and war material require the authorization of the military authorities. ','None '),('US','GY',NULL,'http://pe.usps.com/text/imm/fh_021.htm','All kinds of linen.\nBees and silkworms.\nCirculars, advertisement, or tickets relating to lotteries.\nClocks, watches, or other articles bearing any imitation of a British assay mark. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewelry; and other valuable articles. \nFurniture and fixtures.\nMost foodstuffs including, meats, fish, vegetables, nuts, fruit, bakery products, and confectionery. \nNewsprint paper. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','No list furnished. ','\nMany articles are prohibited entry or restricted entry into Guyana. Senders should ascertain from the addressee before mailing whether the articles will be admitted.  All applications for import licenses must be made to the Ministry of Trade, 18 Brickdam, Georgetown, Guyana.  Tape, adhesive strips, or gummed paper should not be used to seal registered items unless the signature or name of the sender is written or stamped on the tape.        \n'),('US','HK',NULL,'http://pe.usps.com/text/imm/fh_024.htm','Lithium cells and batteries.\nPerishable infectious biological substances.\nRadioactive materials.','Value of coins or of bullion is limited to HK$100. ','Although Hong Kong is a Special Administrative Region of the People’s Republic of China, senders should address their mail to Hong Kong directly.'),('US','HN',NULL,'http://pe.usps.com/text/imm/fh_023.htm','Coins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewelry; and other valuable articles. \nFirearms, parts thereof, and war material.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','No list furnished.','Used clothing must be accompanied by a certificate of disinfection from the local board of health or from a firm with facilities for disinfecting the articles. Senders must endorse the wrappers of such shipments to show that the certificate of disinfection is enclosed.'),('US','HR',NULL,'http://pe.usps.com/text/imm/ce_016.htm','The Croatian government has instituted a temporary ban against the importation of all meat, milk, and dairy products derived from cows, goats, sheep, pigs, hogs, or other animal species that are susceptible to foot and mouth disease. ','No list furnished. ','No list furnished.'),('US','HT',NULL,'http://pe.usps.com/text/imm/fh_022.htm','Arms, ammunition.\nArticles, documents, pamphlets, posters, books, printed papers of a seditious, insulting, or immoral nature.\nJewelry.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','No list furnished.','If addressees in Haiti fail to pay the import duties after acceptance and verification of their shipments, the contents may be sold at auction by the customs authorities. '),('US','HU',NULL,'http://pe.usps.com/text/imm/fh_025.htm','Coins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold, and silver, manufactured or not; precious stones; jewelry; and other valuable articles, unless sent in insured Priority Mail International parcels.\nRadioactive materials. ','No list furnished.','Gift shipments may be sent without import licenses provided they are for the personal use of the addressee or members of his or her family; customs duty is exempt on gift shipments not exceeding a total value of Ft 500 Hungarian Forint and on gift shipments addressed to Hungarian Red Cross. \nMany articles are subject to an import license. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held.\nTo expedite customs clearance, a sales invoice should accompany each shipment that is sent to a private individual from a business.'),('US','ID',NULL,'http://pe.usps.com/text/imm/il_003.htm','Books and periodicals printed in any Indonesian language and published outside of Indonesia, except educational books approved by the Indonesian Department of Commerce. \nCloth and batik designs and sarongs. \nCocoa leaves, dried, undried, or powdered. \nCoins; banknotes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, or silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nIndonesian national currency (rupiahs). \nPerishable infectious biological substances. \nRadioactive materials. \nUsed articles including clothing. ','Import licenses are required for commercial shipments. The following articles are not permitted in commercial shipments: articles of gold or silver, including tableware; pens and pencils ornamented with precious metal; calendar watches; linen clothing; natural silk goods; children’s toys operated by steam or electricity; leather goods; coffee essences; and coffee substitutes; and molasses and sugar substitutes. ','\nCustoms declarations must show both the gross weight of the entire shipment and the net weight of each item in the shipment.  Addressees are required to obtain special authorization to receive gift shipments that contain any articles that are considered “luxury or semi-luxury” items (e.g., various kinds of haberdashery, technical goods, foodstuffs, office supplies, cameras and projectors) by the Indonesian authorities.  Gift shipments must be endorsed “Gift shipment — For the personal use of the addressee.”  Many articles are subject to an import license or special authorization by the Indonesian authorities. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held.  As of January 30, 2020, all items containing goods sent to Indonesia are subject to customs duty, value-added tax (VAT), and personal income tax as follows: \nItems with a value not exceeding 3 USD are subject to a VAT at the rate of 10 percent of the goods’ value (no customs duty or personal income tax applies). Items with a value exceeding 3 USD but not exceeding 1,500 USD are subject to a VAT at the rate of 10 percent of the goods’ value and the following customs duty and personal income tax:  \n\n\n\nItem  \nCustoms Duty  \nPersonal Income Tax  \n\n\nBags  \n15–20 percent  \n7.5–10 percent  \n\n\nShoes  \n25–30 percent  \n7.5–10 percent  \n\n\nTextiles  \n15–25 percent  \n7.5–10 percent  \n\n\nAll other items  \n7.5 percent  \nN/A  \n\n      Items with a value exceeding 1,500 USD are required to undergo a self-assessment procedure. \n\nItem\nCustoms Duty\nPersonal Income Tax\nBags\n15–20 percent\n7.5–10 percent\nShoes\n25–30 percent\n7.5–10 percent\nTextiles\n15–25 percent\n7.5–10 percent\nAll other items\n7.5 percent\nN/A\nItems with a value exceeding 1,500 USD are required to undergo a self-assessment procedure.'),('US','IE',NULL,'http://pe.usps.com/text/imm/il_006.htm','Arms and weapons. \nArticles bearing false trademarks or lacking the indication of origin required by the Irish regulations. \nCoins minted in a foreign country, except gold and silver; false or counterfeit coins. \nHay, straw, including articles made of straw. \nHuman remains. \nLive plants and animals. \nPeat moss litter except under license. \nPrison-made goods. \nSafety fuses; fireworks. \nTobacco, cigars, or cigarettes packed with other articles; cut and compressed, sweetened, or adulterated tobacco.','Carbon paper, except for typewriter carbon paper that must be described on the customs declaration as follows: “Typewriter carbon paper coated with wax and containing no oxidizable or fatty substances.” \nCirculars or advertisements relating to the prevention or treatment of venereal disease must be addressed to physicians or pharmacists. \nImport licensing information is contained in the Irish Customs and Excise Tariff, which may be obtained from the Secretary, Revenue Commissioners, Dublin Castle, Dublin 2 and from the Government Publications Sales Office, GPO Arcade, Dublin 1. \nImportation of tea is subject to certain customs regulations. \nMany other goods, including certain fruit, vegetables and other foodstuffs, plants and seeds, and certain pharmaceutical products are subject to special regulations. \nMargarine, skimmed milk, and other diluted or adulterated foodstuffs must be suitably labeled. \nOiled or varnished cloth or similar articles must be accompanied by a certificate as follows: “The oilcloth or similar articles in this parcel have been stored at a temperature of 140ºF until completely dried, and then cured for at least a month before packing.” Only in Priority Mail International parcels. \nThe following goods are subject to quota restrictions and require an import license: boots and shoes, brushes, electric lamp bulbs, screws, tapered thread; felt hats and caps for women and girls; brushes and mops; wheaten flour and any commodity or product of wheat; rubber proofed wearing apparel; sparking plugs and component parts; silk and artificial silk hose; and certain woven fabrics.','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For Priority Mail International parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  The names of the counties in Ireland are as follows: Carlow, Cavan, Clare, Cork, Donegal, Dublin, Galway, Kerry, Kildare, Kilkenny, Leitrim, Laioghis, Limerick, Longford, Louth, Mayo, Meath, Monaghan, Offaly, Roscommon, Sligo, Tipperary, Waterford, Westmeath, Wexford, and Wicklow.  The names of the county and the delivery office must form a part of the address of all mail articles. In the case of articles liable to customs duty that are eligible for preference, the preferential tariff will not be applied unless the customs declaration is inscribed in bold characters: “Preference claimed — Certificate of origin enclosed.” Otherwise, the full customs duties will be applied to the articles.  The same applies to goods imported under permit, unless the declaration is clearly marked “Imported under license,” and unless the relative license is produced at the time of customs examination. In such cases the license should be produced before the goods are imported.       \n'),('US','IL',NULL,'http://pe.usps.com/text/imm/il_007.htm','Agricultural tools and accessories. \nBank and currency notes at present in circulation in Israel. \nBlank invoices with headings. \nCigarettes exceeding 600. \nDairy products, except for canned powdered milk. \nFresh fruits and vegetables. \nGames of chance. \nIndecent or obscene marks, paintings, photographs, books, cards, lithographs, or engravings. \nInfectious perishable biological substances. \nLive plants and seeds. \nLottery tickets and advertisements. \nMeats.\nOrganic fertilizers. \nRadioactive materials. \nSeafood and fish (includes canned fish or seafood).\nSoil and sand. \nSpices exceeding 1 kg. \nTobacco, in various forms, exceeding 600 grams. \nUsed beehives.','Coins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold, or silver, manufactured or not; precious stones; jewelry; and other valuable articles may only be sent in First-Class Package International Service with Registered Mail service shipments. \nFood products not listed in the Prohibitions section may be mailed in quantities not to exceed 3 kilograms (6.6 pounds) per food item or 15 kilograms (33 pounds) per total food shipment. To import larger quantities from abroad, the prospective recipient must obtain an import license issued by the Israeli government.\nImport licenses are not required for bona fide gifts, namely, all articles for the recipients’ personal use provided that the import of the articles is permitted or for immigrant’s personal effects. \nImport licenses are required for many articles including radios, televisions and other transmitters; medical or scientific instruments; underwater equipment and cinematographic film; postal stamps exceeding 100 Israeli pounds; and plants.\nRecords, films, recording wire, computer cards, QSL cards, and magnetic film are admitted only if sent in First-Class Package International Service shipments.\nSpices may be mailed in quantities not to exceed 0.5 kilograms (1.1 pounds) per spice. To import larger quantities from abroad, the prospective recipient must obtain an import license issued by the Israeli government.\nVitamins, minerals, and food supplements may be mailed in quantities not to exceed 100 grams (3.5 ounces) or one package per product. To import larger quantities from abroad, the prospective recipient must obtain an import license issued by the Israeli government. ','Invoices and documents relating to commercial items must be attached to the outside of the items or to the customs declaration and not enclosed in the item. '),('US','IM',NULL,'http://pe.usps.com/text/imm/tz_018.htm','Aerosols.\nAmmunition, except lead pellets.\nAnimals, live (including reptiles).\nArms and parts of arms, or any component classified as munitions of war; imitations and antiques; paint-ball or toy guns; taser guns; air rifles, air pistols, components of firearms, and all other items similar to or resembling the foregoing.\nArticles, goods infringing British trademarks or copyright laws.\nAsbestos items of any kind.\nChristmas crackers (holiday popper).\nClinical and medical waste (e.g., contaminated dressings, bandages, and needles).\nCoins; platinum, gold, or silver (manufactured or not); precious stones; jewels; and other valuable articles.\nCounterfeit currency, bank notes, and postage stamps.\nDies and equipment for making imitations, etc., of any current postage stamp for denoting any rate of postage.\nFish, live.\nFrozen food.\nFrozen water (including bags of ice).\nGoods made in foreign prisons, except those imported for a noncommercial purpose or of a kind not manufactured in the United Kingdom.\nIndecent and obscene prints, paintings, books, cards, lithographs, and other engravings, films, video tapes, or any other indecent or obscene articles.\nLead acid batteries (e.g., car batteries) and sealed lead acid batteries.\nLottery tickets and related advertisements for illegal lotteries.\nMedicines classified as flammable or toxic.\nRadioactive materials and samples that are classified as radioactive using Table 2-12 of the latest edition of the International Civil Aviation Organization’s Technical Instructions — e.g., fissile material (uranium 235, etc.), radioactive waste material, thorium, or uranium ores and luminous dials from aircraft.\nSoil.\nSoiled clothes and rags.\nStun gun, electric.\nSwitchblade knives (also known as flick knives) and gravity knives.\nWaste, dirt, filth, or refuse, including household waste or rubbish.','A consignment of live bees must contain only queen bees and their attendant workers; colonies are not permitted. Each consignment must be accompanied by an import license issued by the Dept. of Agriculture (DEFRA) and a health certificate issued by the country of origin.\nCaterpillars, cockroaches, crickets, destroyers of noxious pests, earthworms, fish fry and eggs, flies of the family Drosophilidae, leeches, lugworms, maggots, mealworms, pupae and chrysalides, rag worms, silkworms, spiders, and stick insects are admissible only for biomedical research (see license requirement for bees).\nHuman and animal cremated remains (ashes) must not exceed 50 grams and must be in a sift-proof container and securely closed. Items must be tightly packed in strong outer packaging and must be secured or cushioned to prevent any damage. The sender’s name and return address must be clearly visible on the outer packaging. Her Majesty’s Revenue and Customs (HMRC) recommends that cremated human remains should be accompanied by a certificate of cremation from a crematorium authority.\nMedicines and drugs when sent for scientific purposes must be sent by a practitioner, registered dental practitioner, veterinary surgeon, registered nurse, or recognized laboratory or institution.\nPlants and parts of plants require an import permit issued by the appropriate Agricultural Department in the United Kingdom.\nVaccines may be sent only by, or at the specific request of, a qualified medical practitioner, registered dental practitioner, veterinary surgeon, registered nurse, or recognized laboratory or institution.','\nThe following is a list of the names of the counties and city names in Northern Ireland. The County names are in capital letters. The geographic identifiers should be used in addressing mail to Northern Ireland:       \n\n\nANTRIM:   \nDOWN:   \nLONDONDERRY:   \n\n\nAntrim   \nBanbridge   \nColeraine   \n\n\nBallymena   \nBangor   \nKilrea   \n\n\nBelfast   \nDownpatrick   \nLimavady   \n\n\nCarrickfergus   \nKilkeel   \nLondonderry   \n\n\nLarne   \nNewcastle   \nMagherafelt   \n\n\nLisburn   \nNewry   \nPortstewart   \n\n\nPortrush   \nNewtownards   \nTYRONE:   \n\n\nToomebridge   \nFERMANAGH:   \nCookstown   \n\n\nWhitehead   \nEnniskillen   \nDugannon   \n\n\nARMAGH:   \n   \nMoy   \n\n\nArmagh   \n   \nOmagh   \n\n\nLurgan   \n   \nStrabane   \n\n\nPortsdown   \n   \n   \n\nMany types of merchandise, unless sent as unsolicited gifts, require import licenses that the addressees must obtain from the British Board of Trade. Before mailing commercial shipments, senders should be assured that the addressees can obtain licenses if needed.  All goods sent to the UK are liable to customs duty and Value Added Tax on importation whether or not the package is marked as a “gift.” Packages are admitted free of customs charges, however, if they meet the following conditions:  \nGift packages of small value provided they do not contain any tobacco goods, spirits or wine;  Gift packages containing only well-worn clothing (excluding garments of high value), limited quantities of foodstuffs (other than caviar), soap or consumable medical supplies.  \nPostal packages without a customs declaration that contain goods liable to customs duty or control may be seized by the customs authorities.  Firearms that are intended for sporting purposes are mailable to the United Kingdom, provided the prospective addressee has obtained the required import license.  The United Kingdom limits the weight of M-bags to 20 kg (44 lbs.).  As of November 5, 2018, Parcelforce Worldwide, part of Royal Mail Group Ltd., charges a single-import customs clearance fee of 12 pounds sterling (GBP) for all low-value parcels subject to customs charges that it delivers — i.e., parcels whose declared value is more than 15 GBP (for merchandise) or 39 GBP (for gifts), but not more than 873 GBP. Parcelforce Worldwide charges a flat fee of 25 GBP for high-value goods of more than 873 GBP.       \n\n\n\n\nANTRIM:   \nDOWN:   \nLONDONDERRY:   \n\n\nAntrim   \nBanbridge   \nColeraine   \n\n\nBallymena   \nBangor   \nKilrea   \n\n\nBelfast   \nDownpatrick   \nLimavady   \n\n\nCarrickfergus   \nKilkeel   \nLondonderry   \n\n\nLarne   \nNewcastle   \nMagherafelt   \n\n\nLisburn   \nNewry   \nPortstewart   \n\n\nPortrush   \nNewtownards   \nTYRONE:   \n\n\nToomebridge   \nFERMANAGH:   \nCookstown   \n\n\nWhitehead   \nEnniskillen   \nDugannon   \n\n\nARMAGH:   \n   \nMoy   \n\n\nArmagh   \n   \nOmagh   \n\n\nLurgan   \n   \nStrabane   \n\n\nPortsdown   \n   \n   \n\n\nMany types of merchandise, unless sent as unsolicited gifts, require import licenses that the addressees must obtain from the British Board of Trade. Before mailing commercial shipments, senders should be assured that the addressees can obtain licenses if needed. \nAll goods sent to the UK are liable to customs duty and Value Added Tax on importation whether or not the package is marked as a “gift.” Packages are admitted free of customs charges, however, if they meet the following conditions: \n\nGift packages of small value provided they do not contain any tobacco goods, spirits or wine;  Gift packages containing only well-worn clothing (excluding garments of high value), limited quantities of foodstuffs (other than caviar), soap or consumable medical supplies.  \n\nPostal packages without a customs declaration that contain goods liable to customs duty or control may be seized by the customs authorities. \nFirearms that are intended for sporting purposes are mailable to the United Kingdom, provided the prospective addressee has obtained the required import license. \nThe United Kingdom limits the weight of M-bags to 20 kg (44 lbs.). \nAs of November 5, 2018, Parcelforce Worldwide, part of Royal Mail Group Ltd., charges a single-import customs clearance fee of 12 pounds sterling (GBP) for all low-value parcels subject to customs charges that it delivers — i.e., parcels whose declared value is more than 15 GBP (for merchandise) or 39 GBP (for gifts), but not more than 873 GBP. Parcelforce Worldwide charges a flat fee of 25 GBP for high-value goods of more than 873 GBP.\nANTRIM: \nDOWN: \nLONDONDERRY: \nAntrim \nBanbridge \nColeraine \nBallymena \nBangor \nKilrea \nBelfast \nDownpatrick \nLimavady \nCarrickfergus \nKilkeel \nLondonderry \nLarne \nNewcastle \nMagherafelt \nLisburn \nNewry \nPortstewart \nPortrush \nNewtownards \nTYRONE: \nToomebridge \nFERMANAGH: \nCookstown \nWhitehead \nEnniskillen \nDugannon \nARMAGH: \nMoy \nArmagh \nOmagh \nLurgan \nStrabane \nPortsdown '),('US','IN',NULL,'http://pe.usps.com/text/imm/il_002.htm','Appliances (including pistols, pistol pencils, etc.) for discharging gas, except on behalf of the Government. \nArms and military equipment, except for the Indian Government. \nArticles of gold or silver. \nCoins; banknotes; currency notes; traveler’s checks; securities payable to bearer; precious stones; jewelry; and other valuable articles. \nCoins or ingots exceeding 65 rupees in value, except coins obviously intended for ornament. \nConsumer electronic items, (except hearing aids and life-saving equipment, apparatus, and appliances and parts thereof). Shipments containing these goods up to the value of 200 Indian rupees (gift value) are at present released after the words “Released on caution” have been stamped on the item. \nPistol-shaped articles such as toy guns.\nRadioactive materials. ','Addressees in India are required to obtain import licenses for all goods except those intended for their personal use and not exceeding 100 rupees in value. If the license is not obtained when required, the articles are considered as prohibited. \nCommercial shipments of tobacco, manufactured or not may only be sent to licensed importers or wholesalers. \nIndian banknotes, require permission of the Reserve Bank of India. \nPerishable articles or edible substances are admitted only by airmail. \nPiece goods and certain manufactured articles must be marked to show country of origin as prescribed by the Indian trademark regulations. \nWorks of art (including photographs); forms ruled or printed; account and manuscript books; labels; advertising matter (except trade catalogs and circulars); almanacs in sheets or in cards; and other cards, as well as waste paper and old newspaper for packing, are considered to be merchandise, and may be liable to customs duty.','\nIn India, a very small number of articles is admitted free of customs duty and the tariffs of these duties vary considerably. The general rate of import duty is 30 percent but many articles are liable to a higher rate.  Import duty is chargeable even if the articles are received as free gifts. The fact that goods are old or second-hand or gifts or articles intended for personal use does not entitle them per se to exemption from import duty. However, the collection of duty is waived in cases where the total duty on a shipment does not exceed 3 rupees. Books and magazines are generally exempt from import duty.  Shipments can be more speedily released if their contents and value are clearly and correctly declared by the sender.  Insured Priority Mail International parcels addressed to the post office boxes of Draw, Kargil and Leh in the State of Kashmir are not accepted from November 1 to May 31.       \n'),('US','IQ',NULL,'http://pe.usps.com/text/imm/il_005.htm','Arms, including air guns; and parts of arms and munitions.\nBinoculars.\nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; gold, silver, platinum, manufactured or not; precious stones; jewelry; and other valuable articles.\nLighters containing butane gas. \nNon-preserved meats and soft fruits. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. \nTapes or cassettes. ','For shipments containing goods valued at more than 1 Iraqi dinar, the addressee must obtain a special import license from the Ministry of Supply, Import Department, Baghdad. \nRadio apparatus, and their accessories, and knives having blades over 76 millimeters (about 3 inches) in length, require permission to be obtained by the addressees from the Iraqi authorities. ','Many articles are subject to an import permit/license. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held. '),('US','IR',NULL,'http://pe.usps.com/text/imm/il_004.htm','Alcoholic beverages. \nBooks, newspapers, printed matter, writing, records, pictures, emblems, and any other articles of a seditious or immoral nature or contrary to the principles of the Islamic religion or accepted customs. \nCoins; banknotes; currency notes; travelers checks; securities payable to bearer; gold, silver, platinum, whether manufactured or not; jewelry, precious stones, or other valuable articles. Iran will accept no liability for loss of or damage to such items.\nFashion newspapers. \nFirearms of all kinds; weapons; and ammunition. \nGames involving profit and loss (for example, dice or card games). \nMusical instruments. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadio systems that are equipped with a single sideband; upper sideband; lower sideband; beat frequency oscillator; continuous air wave band; police band; or an FM band having a frequency range of 76 to 87 MHz. \nRadioactive materials. \nSkins of animals the consumption of whose flesh is prohibited by Islam. \nSugar, brown sugar. \nUsed clothing. ','Banknotes other than Iranian may be imported only with the permission of the Iranian National Bank.','\n\nCustoms duties will not be levied for the clearance of postal items of a non-commercial nature provided the value does not exceed $50.00. There are exceptions for those goods that are prohibited by law. More clarification is available at irica.gov.ir, the official customs Web site of the Islamic Republic of Iran. Postage covers conveyance only to the Iranian frontier offices. Additional charges for conveyance into the interior are levied by the Iranian Administration.  The importation of a wide range of general merchandise is prohibited or subject to import quotas, and senders are advised in their own interests to ascertain before mailing whether their goods are admissible. The importation of certain telecommunication products (wireless phones, transmitting and receiving sets, and other similar items) is subject to permission from the Ministry of Information and Communications of the Islamic Republic of Iran. The importation of drugs, foods, cosmetics, hygiene products, and beverages is subject to permission from the Ministry of Health of the Islamic Republic of Iran. The importation of books, publications, films, tapes, and CDs containing scientific information which are not illegal according to the laws and regulations of Iran, and other products concerning technical and scientific matters in the fields of printing, distribution and copying, which are not illegal according to the laws and regulations of Iran are subject to authorization from the Ministry of Science, Research and Technology, the Ministry of Health and Medical Education, or the Ministry of Culture and Islamic Guidance, as appropriate. The importation of seeds, insecticides, etc. is subject to permission from the Ministry of Agricultural Jahad. The importation of radioactive goods and equipment is subject to permission from the Atomic Energy Organization of the Islamic Republic of Iran. The importation of weapons is subject to permission from the Ministry of Defense of the Islamic Republic of Iran. The importation of animal foods is subject to permission from the Veterinary Organization of the Islamic Republic of Iran.       \n'),('US','IS',NULL,'http://pe.usps.com/text/imm/il_001.htm','Bees and silkworms. \nIcelandic coins and banknotes, as well as any values payable in Icelandic currency. \nMeat products including sausages.\nTobacco products. \nToys made of lead. \nWireless receivers and their accessories, parts, or batteries.','No list furnished.','All merchandise imported by mail must be accompanied by an invoice in duplicate signed by the seller in case of a sales transaction, otherwise, by the mailer. The invoice must describe the merchandise and give the selling price of each type of goods. The addressee is required to present the invoice with other documents in order to effect customs clearance. '),('US','IT',NULL,'http://pe.usps.com/text/imm/il_008.htm','Albums of any kind (of photographs, postcards, postage stamps, etc.). \nArms and weapons. \nArticles of platinum or gold; jewelry; and other valuable articles unless sent as insured Priority Mail International parcels. \nArtificial flowers and fruits and accessories for them. \nBells and other musical instruments and parts thereof. \nCartridge caps; cartridges. \nClocks and supplies for clocks. \nCompound medicaments and medicines. \nCoral mounted in any way. \nEther and chloroform. \nExposed photographic and cinematographic films. \nFootwear of any kind. \nHaberdashery and sewn articles of any kind, including trimmings and lace; handkerchiefs; scarves; shawls, needlework including stockings and gloves; bonnets, caps, and hats of any kind. \nHair and articles made of hair. \nHuman remains. \nLeather goods. \nLighters and their parts, including lighter flints. \nLithium cells and batteries — including items containing lithium cells and batteries under 135.6.\nLive bees, leeches, and silkworms. \nLive plants and animals. \nNutmeg, vanilla; sea salt, rock salt; saffron. \nParasites and predators of harmful insects. \nPerfumery goods of all kinds (except soap). \nPlaying cards of any kind. \nPostage stamps in sealed or unsealed First-Class Mail International or First-Class Package International Service shipments. \nRadioactive materials. \nRibbons for typewriters. \nRoasted or ground coffee and its substitutes; roasted chicory. \nSaccharine and all products containing saccharine. \nSalted, smoked or otherwise prepared meats; fats; and lard. \nTobacco. \nToys not made wholly of wood. \nTreated skins and furs. \nWeapons of any kind and spare parts for them.','Coins; bank notes; currency notes (paper money); traveler’s checks; jewelry; and other precious or valuable articles must be enclosed in an insured Priority Mail International parcel in order to be mailable to addressees in Italy. \nPostage stamps for philatelic purposes are admitted in First-Class Package International Service with Registered Mail service shipments on condition that the package bears a completed PS Form 2976 and the addressee complies with the Italian financial regulations. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For Priority Mail International parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  First-Class Mail International and First-Class Package International Service shipments may not contain dutiable articles.  Shipments containing books must bear a PS Form 2976.  Many articles are subject to an import license or quantity restrictions. Senders should ascertain from the addressee before mailing whether the articles will be admitted or whether the necessary documents, if required, are held.       \n'),('US','JE','GB','http://pe.usps.com/text/imm/tz_018.htm','Aerosols.\nAmmunition, except lead pellets.\nAnimals, live (including reptiles).\nArms and parts of arms, or any component classified as munitions of war; imitations and antiques; paint-ball or toy guns; taser guns; air rifles, air pistols, components of firearms, and all other items similar to or resembling the foregoing.\nArticles, goods infringing British trademarks or copyright laws.\nAsbestos items of any kind.\nChristmas crackers (holiday popper).\nClinical and medical waste (e.g., contaminated dressings, bandages, and needles).\nCoins; platinum, gold, or silver (manufactured or not); precious stones; jewels; and other valuable articles.\nCounterfeit currency, bank notes, and postage stamps.\nDies and equipment for making imitations, etc., of any current postage stamp for denoting any rate of postage.\nFish, live.\nFrozen food.\nFrozen water (including bags of ice).\nGoods made in foreign prisons, except those imported for a noncommercial purpose or of a kind not manufactured in the United Kingdom.\nIndecent and obscene prints, paintings, books, cards, lithographs, and other engravings, films, video tapes, or any other indecent or obscene articles.\nLead acid batteries (e.g., car batteries) and sealed lead acid batteries.\nLottery tickets and related advertisements for illegal lotteries.\nMedicines classified as flammable or toxic.\nRadioactive materials and samples that are classified as radioactive using Table 2-12 of the latest edition of the International Civil Aviation Organization’s Technical Instructions — e.g., fissile material (uranium 235, etc.), radioactive waste material, thorium, or uranium ores and luminous dials from aircraft.\nSoil.\nSoiled clothes and rags.\nStun gun, electric.\nSwitchblade knives (also known as flick knives) and gravity knives.\nWaste, dirt, filth, or refuse, including household waste or rubbish.','A consignment of live bees must contain only queen bees and their attendant workers; colonies are not permitted. Each consignment must be accompanied by an import license issued by the Dept. of Agriculture (DEFRA) and a health certificate issued by the country of origin.\nCaterpillars, cockroaches, crickets, destroyers of noxious pests, earthworms, fish fry and eggs, flies of the family Drosophilidae, leeches, lugworms, maggots, mealworms, pupae and chrysalides, rag worms, silkworms, spiders, and stick insects are admissible only for biomedical research (see license requirement for bees).\nHuman and animal cremated remains (ashes) must not exceed 50 grams and must be in a sift-proof container and securely closed. Items must be tightly packed in strong outer packaging and must be secured or cushioned to prevent any damage. The sender’s name and return address must be clearly visible on the outer packaging. Her Majesty’s Revenue and Customs (HMRC) recommends that cremated human remains should be accompanied by a certificate of cremation from a crematorium authority.\nMedicines and drugs when sent for scientific purposes must be sent by a practitioner, registered dental practitioner, veterinary surgeon, registered nurse, or recognized laboratory or institution.\nPlants and parts of plants require an import permit issued by the appropriate Agricultural Department in the United Kingdom.\nVaccines may be sent only by, or at the specific request of, a qualified medical practitioner, registered dental practitioner, veterinary surgeon, registered nurse, or recognized laboratory or institution.','\nThe following is a list of the names of the counties and city names in Northern Ireland. The County names are in capital letters. The geographic identifiers should be used in addressing mail to Northern Ireland:       \n\n\nANTRIM:   \nDOWN:   \nLONDONDERRY:   \n\n\nAntrim   \nBanbridge   \nColeraine   \n\n\nBallymena   \nBangor   \nKilrea   \n\n\nBelfast   \nDownpatrick   \nLimavady   \n\n\nCarrickfergus   \nKilkeel   \nLondonderry   \n\n\nLarne   \nNewcastle   \nMagherafelt   \n\n\nLisburn   \nNewry   \nPortstewart   \n\n\nPortrush   \nNewtownards   \nTYRONE:   \n\n\nToomebridge   \nFERMANAGH:   \nCookstown   \n\n\nWhitehead   \nEnniskillen   \nDugannon   \n\n\nARMAGH:   \n   \nMoy   \n\n\nArmagh   \n   \nOmagh   \n\n\nLurgan   \n   \nStrabane   \n\n\nPortsdown   \n   \n   \n\nMany types of merchandise, unless sent as unsolicited gifts, require import licenses that the addressees must obtain from the British Board of Trade. Before mailing commercial shipments, senders should be assured that the addressees can obtain licenses if needed.  All goods sent to the UK are liable to customs duty and Value Added Tax on importation whether or not the package is marked as a “gift.” Packages are admitted free of customs charges, however, if they meet the following conditions:  \nGift packages of small value provided they do not contain any tobacco goods, spirits or wine;  Gift packages containing only well-worn clothing (excluding garments of high value), limited quantities of foodstuffs (other than caviar), soap or consumable medical supplies.  \nPostal packages without a customs declaration that contain goods liable to customs duty or control may be seized by the customs authorities.  Firearms that are intended for sporting purposes are mailable to the United Kingdom, provided the prospective addressee has obtained the required import license.  The United Kingdom limits the weight of M-bags to 20 kg (44 lbs.).  As of November 5, 2018, Parcelforce Worldwide, part of Royal Mail Group Ltd., charges a single-import customs clearance fee of 12 pounds sterling (GBP) for all low-value parcels subject to customs charges that it delivers — i.e., parcels whose declared value is more than 15 GBP (for merchandise) or 39 GBP (for gifts), but not more than 873 GBP. Parcelforce Worldwide charges a flat fee of 25 GBP for high-value goods of more than 873 GBP.       \n\n\n\n\nANTRIM:   \nDOWN:   \nLONDONDERRY:   \n\n\nAntrim   \nBanbridge   \nColeraine   \n\n\nBallymena   \nBangor   \nKilrea   \n\n\nBelfast   \nDownpatrick   \nLimavady   \n\n\nCarrickfergus   \nKilkeel   \nLondonderry   \n\n\nLarne   \nNewcastle   \nMagherafelt   \n\n\nLisburn   \nNewry   \nPortstewart   \n\n\nPortrush   \nNewtownards   \nTYRONE:   \n\n\nToomebridge   \nFERMANAGH:   \nCookstown   \n\n\nWhitehead   \nEnniskillen   \nDugannon   \n\n\nARMAGH:   \n   \nMoy   \n\n\nArmagh   \n   \nOmagh   \n\n\nLurgan   \n   \nStrabane   \n\n\nPortsdown   \n   \n   \n\n\nMany types of merchandise, unless sent as unsolicited gifts, require import licenses that the addressees must obtain from the British Board of Trade. Before mailing commercial shipments, senders should be assured that the addressees can obtain licenses if needed. \nAll goods sent to the UK are liable to customs duty and Value Added Tax on importation whether or not the package is marked as a “gift.” Packages are admitted free of customs charges, however, if they meet the following conditions: \n\nGift packages of small value provided they do not contain any tobacco goods, spirits or wine;  Gift packages containing only well-worn clothing (excluding garments of high value), limited quantities of foodstuffs (other than caviar), soap or consumable medical supplies.  \n\nPostal packages without a customs declaration that contain goods liable to customs duty or control may be seized by the customs authorities. \nFirearms that are intended for sporting purposes are mailable to the United Kingdom, provided the prospective addressee has obtained the required import license. \nThe United Kingdom limits the weight of M-bags to 20 kg (44 lbs.). \nAs of November 5, 2018, Parcelforce Worldwide, part of Royal Mail Group Ltd., charges a single-import customs clearance fee of 12 pounds sterling (GBP) for all low-value parcels subject to customs charges that it delivers — i.e., parcels whose declared value is more than 15 GBP (for merchandise) or 39 GBP (for gifts), but not more than 873 GBP. Parcelforce Worldwide charges a flat fee of 25 GBP for high-value goods of more than 873 GBP.\nANTRIM: \nDOWN: \nLONDONDERRY: \nAntrim \nBanbridge \nColeraine \nBallymena \nBangor \nKilrea \nBelfast \nDownpatrick \nLimavady \nCarrickfergus \nKilkeel \nLondonderry \nLarne \nNewcastle \nMagherafelt \nLisburn \nNewry \nPortstewart \nPortrush \nNewtownards \nTYRONE: \nToomebridge \nFERMANAGH: \nCookstown \nWhitehead \nEnniskillen \nDugannon \nARMAGH: \nMoy \nArmagh \nOmagh \nLurgan \nStrabane \nPortsdown '),('US','JM',NULL,'http://pe.usps.com/text/imm/il_009.htm','Bees and materials used by beekeepers. \nCitrus fruits and plants and parts thereof \nCocoa; coffee; condensed milk; cornmeal; edible oils; honey and beeswax; paints; and sugar. \nCotton seed and plants and parts thereof. \nLighters containing butane gas. \nMeats. \nRadioactive materials. \nSwitchblade knives. ','Electronic items, including cellular telephones, are not accepted unless they are sent in the original manufacturer‘s packaging. In addition, the items must be packed in accordance with UPU requirements.\nMedications must have the name and formula printed in English on the container and wrapper. Also, medications for treatments of venereal disease must be accompanied with directions for their use.','Many types of merchandise require authorization to import, which the addressee must obtain from the Trade Administrator at Kingston. Senders must be assured that the addressee has such a permit or can obtain one if needed.'),('US','JO',NULL,'http://pe.usps.com/text/imm/il_011.htm','Advertisements concerning treatment of venereal diseases or medicinal preparations intended to serve as preventives against those diseases. \nArms.\nEssences and oils for use in making adulterated or imitated beverages. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Bees and silkworms must be accompanied by an official certificate that they are free from disease.','None'),('US','JP',NULL,'http://pe.usps.com/text/imm/il_010.htm','Hoverboards or gyroboards.\nItems that infringe on patent rights, utility model rights, design rights, trademark rights, copyrights, neighboring rights, or layout design rights.\nNarcotics, unless the intended recipient has received prior permission from the competent authority in the prefecture in which that person resides.','Banknotes; securities payable to bearer; coins, gold bullion; bills of exchange; letters of credit; and other payment orders are subject to the conditions laid down in the law concerning foreign exchange and trade control. \nCoins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold, or silver, manufactured or not; precious stones; jewelry; and other valuable articles may only be sent in First-Class Package International Service with Registered Mail service shipments or insured Priority Mail International parcels.\nFirearms, including handguns, pistols, machine guns, and rifles; other types of weapons, including daggers, swords, spears, and switch blade knives; and the components of firearms and weapons may not be imported into Japan unless the intended recipient has received prior permission from the competent authority (i.e., the Public Safety Commission) in the prefecture in which that person resides. \nMeat products are prohibited unless accompanied by an inspection certificate issued by the U.S. Department of Agriculture.\nPlants are prohibited unless accompanied by a phytosanitary certificate issued by the country of origin, in accordance with Japan’s national legislation. For a U.S. mailer, the phytosanitary certificate must come from the United States Department of Agriculture (USDA). Japan’s national legislation authorizes the destruction of items that do not have the proper documentation.','\nHuman ashes may be accepted if presented for mailing by a licensed crematory or licensed mortuary. The ashes must be packed in a sealed metal container enclosed in a substantial outer container. There must be enclosed within the outer container, but outside the metal container, a certified copy of the death certificate and a statement or certificate executed by the crematory or mortuary to the effect that the ashes are those of the person named in the death certificate.  Many articles are subject to an import license. Senders should ascertain from the addressee before mailing whether the necessary documents are held. Import permits are not required for articles intended for personal use and in quantities such that they could not be used for commercial purposes; articles for the relief of disaster victims; ashes of the dead; and publications sent to libraries as part of an exchange between countries. A sales invoice is required for all articles valued at more than U.S. $1,600.00. The invoice must be affixed to the outside of the parcel or may be enclosed with the customs declaration in the plastic envelope of PS Form 2976-E. The sales invoice must not obscure the customs declaration, which must show through the plastic envelope. \n'),('US','KE',NULL,'http://pe.usps.com/text/imm/il_013.htm','Coins; banknotes; currency notes (paper money); traveler’s checks; platinum, gold, or silver (manufactured or not); precious stones; jewelry; and other valuables. \nFirearms and articles resembling deadly weapons.\nIndecent or obscene material.\nRadioactive materials. \nUsed clothing, bedding and other similar items, textile and fabrics.','Articles bearing Boy Scout or Girl Scout insignia must have authorization of the Kenya Boy Scout or Girl Guide Commissioner. \nMilitary or civil uniforms and clothing resembling them require permit of the Kenya government. \nRestrictions apply to the importation of second-hand clothes for sale. This restriction does not apply to personal effects. \nTraps capable of killing or capturing game must have permission of the Chief Game Warden of Kenya.','\nA plant import permit must be obtained prior to shipment to Kenya from the Kenyan Ministry of Agriculture at the following address: The Director, National Plant Quarantine Station, P.O. Box 30148, Nairobi, Kenya.  Many types of merchandise require authorization to import, which the addressee must obtain from the Director of Trade and Supplies, P.O. Box 30430, Nairobi, Kenya. Senders should be assured that the addressee has such a permit or can obtain one if needed.        \n'),('US','KG',NULL,'http://pe.usps.com/text/imm/il_019.htm','Explosive, flammable, or dangerous substances. \nMilitary-type firearms, and ammunitions therefor, other than hunting weapons, knives and blades, sheaths therefor, specially intended for attack (truncheons, stilettos). \nNarcotics, psychotropic and other substances that encourage drug addiction, and hashish. \nPerishable goods. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPrinted matter, plates, negatives, films for exposure, phonographs, tapes, video cassettes and video discs, information for electronic calculators, manuscripts, disks and other sound recordings, drawings and other printing and plastic arts products containing information that may prejudice the constitutional order of the State, public, political, or economic interests, or State sovereignty; in defense of war, terrorism, incitement to racial hatred such as Zionism, anti-Semitism, fascism, national exclusion, and religious provocation; and pornographic publications. \nRadioactive materials.','Coins; currency notes or securities of any kind payable to bearer; traveler’s checks; platinum, gold, or silver (whether manufactured or not); precious stones; jewels; or other valuable articles may be mailed only as insured Priority Mail International parcels. Kyrgyzstan will not accept liability in cases of loss or damage to such items if they are accepted.\nHigh-frequency radio-electronic devices and apparatus; ultrasonic apparatus; industrial, scientific, and medical generators; detection devices used to measure transport speed (radar) are admitted only on the authorization of the Ministry of Transport and Communications. \nPostage stamps, whether canceled or uncanceled, are prohibited when sent by Registered Mail service. Kyrgyz Post will accept no liability for any loss or damage to incoming registered items containing such articles.\nSeeds and parts of plants intended for planting require authorization of the Ministry of Agriculture.','None'),('US','KH',NULL,'http://pe.usps.com/text/imm/ce_001.htm','Coins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewels; expensive jewelry; and other valuable articles. \nRadioactive materials. ','None','First-Class Mail International and First-Class Package International Service items may not contain dutiable articles. '),('US','KI',NULL,'http://pe.usps.com/text/imm/il_014.htm','Dyestuffs obtained from coal tar.','No list furnished.','Many categories of goods are either completely prohibited or admitted only under special permit. Senders are advised not to dispatch goods until they are sure that the importer possesses or is able to obtain the necessary license issued by the Resident Commissioner, Tarawa, Kiribati, or that no such license is required. '),('US','KM',NULL,'http://pe.usps.com/text/imm/ce_011.htm','Cigarettes and tobacco except when sent by private individuals and intended for personal use of the addressee. \nNarcotics except for medical reason. \nNewspapers, publications, and works that may jeopardize the Moslem religion or security of the state. \nPerishable infectious biological substances. \nRadioactive materials. \nWeapons and ammunitions of war. ','Importation of gold ingots require authorization by the Central Bank. \nWeapons and ammunitions for other than war require a special import permit. ','None'),('US','KN',NULL,'http://pe.usps.com/text/imm/ps_016.htm','Radioactive materials. ','No list furnished. ','None '),('US','KR',NULL,'http://pe.usps.com/text/imm/il_016.htm','Counterfeit postage stamps. \nDocuments, books, printed papers, engravings or other articles contrary to public security. \nFirearms, sabres, and swords for military use. \nFiring caps and loaded metal cartridges for portable firearms. \nFresh fruits, including apples, limes, mangoes, oranges, and papayas.\nFresh vegetables, including unripe beans, rice seeds, potatoes, and walnuts with shells.\nFruit trees, including seedlings and cuttings (scions).\nLive animals.\nLive insects, including pet insects.\nMachines and paper for making cigarettes. \nPathogens.\nSalt. \nSeeds of weeds. For information regarding other types of seeds, see Restrictions.\nSoil or plants with soil attached.\nTextile fabrics. \nWeights and measures. ','Agricultural products — including fruits and vegetables (except fresh fruits and fresh vegetables, which are prohibited); herbs (including herbs for medicinal use); and grains — are required to be accompanied by an export certificate. A U.S. mailer must obtain the export certificate from the United States Department of Agriculture (USDA) Animal and Plant Health Inspection Service (APHIS).\nAnimal products (such as antlers, bones, and feathers) are required to be accompanied by an export certificate. A U.S. mailer must obtain the export certificate from the United States Fish and Wildlife Service or the USDA APHIS. For more information, see 592.\nCoins; paper currency; banknotes; currency notes; securities payable to bearer; jewelry; manufactured and unmanufactured platinum, gold, and silver; precious stones; and other valuable articles are admitted only if sent in First-Class Package International Service with Registered Mail service shipments. \nDairy and other similar products (including cheese and butter) are required to be accompanied by an export certificate. A U.S. mailer must obtain the export certificate from the United States Food and Drug Administration.\nEggs and processed egg products (including egg powder) are required to be accompanied by an Egg Products Export Certificate of Wholesomeness. A U.S. mailer must obtain the export certificate from the USDA Food Safety and Inspection Service (FSIS).\nLumber, including wood packing material, is required to be accompanied by a phytosanitary certificate. A U.S. mailer must obtain the phytosanitary certificate from the USDA APHIS.\nMeat and processed meat products (including dried, fried, marinated, raw, and steamed) are required to be accompanied by a Meat Wholesomeness Certificate. A U.S. mailer must obtain the export certificate from the USDA FSIS.\nMonthly or weekly journals are admitted to the extent of three copies per person and per issue; they are subject to a permit from the government if they exceed the limit of three copies. \nPet food (feed), including snacks and nutritional supplements, is required to be accompanied by an export certificate. A U.S. mailer must obtain the export certificate from the USDA APHIS.\nPlants used for planting or for propagation, including seeds, seedlings, and bulbs, are required to be accompanied by a phytosanitary certificate. A U.S. mailer must obtain the phytosanitary certificate from the USDA APHIS.\nTobacco and ginseng may only be imported by the Korean government.','\nArticles addressed for delivery in Korea should show the name of the addressee, street, district, town and province in Korea. The address should be shown also in Korean characters, if known.  Service is available only to the provinces comprising the Republic of Korea, i.e., provinces south of the 38th parallel of latitude.  The following is a list of the provinces comprising the Republic of Korea:     \n\nCheju-do  Cholla-namdo Cholla-pukto Ch’ungch’ong-namdo  Ch’ungch’ong-pukto  \n*Kangwon-do *Kyonggi-do Kyongsang-namdo Kyongsang-pukto  \nThe provinces marked with the asterisk (*) are divided by the 38th parallel of latitude, and it is the responsibility of the mailers to determine that the post offices to which their parcels are addressed are located south of the 38th parallel. Mail addressed to offices north of the 38th parallel will not be forwarded to destination but will be treated as undeliverable.       \n\n\n\nCheju-do  Cholla-namdo Cholla-pukto Ch’ungch’ong-namdo  Ch’ungch’ong-pukto  \n*Kangwon-do *Kyonggi-do Kyongsang-namdo Kyongsang-pukto  \n\nThe provinces marked with the asterisk (*) are divided by the 38th parallel of latitude, and it is the responsibility of the mailers to determine that the post offices to which their parcels are addressed are located south of the 38th parallel. Mail addressed to offices north of the 38th parallel will not be forwarded to destination but will be treated as undeliverable.\nCheju-do \nCholla-namdo\nCholla-pukto\nCh’ungch’ong-namdo \nCh’ungch’ong-pukto\n*Kangwon-do\n*Kyonggi-do\nKyongsang-namdo\nKyongsang-pukto'),('US','KW',NULL,'http://pe.usps.com/text/imm/il_018.htm','Lighters containing butane gas, and refills therefor.\nMagazines or other printed matter containing illustrations of nude or partly nude human figures.\nPerishable infectious biological substances.\nRadioactive materials. ','Addressees are required to obtain import licenses for preserved meat, dairy products, drugs, serums and vaccines.\nJewels, precious stones, and metals imported for commercial or resale purposes, are subject to prior authorization of the Ministry of Trade and Industry of Kuwait.\nMedicines and pills must be accompanied by a medical prescription or documents indicating their specifications or composition.\nTapes and cassettes must not be sent in Registered Mail. Such articles are admitted in ordinary mail.\nUsed clothing intended for sale must be accompanied by a certificate of disinfection or sterilization.','None'),('US','KY','GB','http://pe.usps.com/text/imm/ce_005.htm','Bees and materials used by beekeepers. \nCitrus fruits and plants and parts thereof. \nCocoa; coffee; condensed milk; cornmeal; edible oils; honey and beeswax; paints; and sugar. \nCotton seed and plants and parts thereof. \nLighters containing butane gas. \nMeats. \nRadioactive materials. \nSwitchblade knives. ','Electronic items, including cellular telephones, are not accepted unless they are sent in the original manufacturer‘s packaging. In addition, the items must be packed in accordance with UPU requirements.\nMedications must have the name and formula printed in English on the container and wrapper. Also, medications for treatments of venereal disease must be accompanied with directions for their use.','Many types of merchandise require an import permit, which the addressee must obtain. \nMerchandise valued over 60 USD, whether purchased or received as a gift, should be accompanied by an invoice. Failure to include an invoice could result in delivery delays.\nSenders must be assured that the addressee has such a permit or can obtain one if needed. '),('US','KZ',NULL,'http://pe.usps.com/text/imm/il_012.htm','Coins, banknotes, credit notes or any securities payable to bearer, checks, precious metals (whether manufactured or not), precious stones, natural diamonds, jewels and other valuable articles, and foreign currency are prohibited. Kazakhstan will accept no liability for loss of or damage to such items.\nCultural artifacts.\nDeer horns, hooves, and antlers.\nExplosives and explosive or inflammable substances, pyrotechnic articles (fireworks, etc.).\nFirearms and bladed weapons or articles of similar construction for civilian service, ammunition, special dual purpose (civilian and military) technical devices, and parts and accessories thereof.\nForeign currency.\nHuman organs and/or substances, and blood and blood parts.\nImplements for fishing aquatic biological resources.\nLive animals except bees, leeches, and silkworms.\nMilitary weapons.\nNarcotics, psychotropic substances, and precursors, including in drug form.\nNatural precious stones, waste thereof, powder from precious stones, pearls, yellow amber.\nNuclear materials and equipment; radioactive materials, fuels and corrosive materials.\nOriginals and copies of military service records, identity cards, and passports.\nPerishable foodstuffs.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nPlant protection products subject to the provisions of Annexes A and B to the Stockholm Convention on Persistent Organic Pollutants of May 22, 2001.\nPlants of any kind and in any form, including seeds.\nPoisons, toxic substances of animal origin.\nPrecious metals, alloys, minerals, concentrates, rubble and waste from precious metals.\nPrinted matter, plastic materials, stock footage, photographic material, audio and video material containing propaganda against the political regime and liable to threaten the integrity and security of the State or aimed at undermining its authority, materials that promote war, cruelty, violence and pornography, and materials that promote social, racial, national, religious, genetic or caste superiority.\nRare animal and vegetable products and endangered animals and plants.\nRare metals, raw materials, alloys, combinations and products.\nSpecial technical publications on the covert reception of intelligence.\nSturgeon and salmon caviar.\nSubstances harmful to the ozone layer.\nTobacco products and smoking mixtures of all kinds.','A certificate must accompany funeral urns containing ashes of the deceased from the licensed crematory or licensed mortuary stating that the ashes are those of the person named in the death certificate. \nAnimals and products of animal origin are subject to authorization from the veterinary control institutions of Kazakhstan. \nArticles subject to customs duty may not be sent in ordinary or registered First-Class Mail International shipments, First-Class Package International Service shipments, Priority Mail International Flat Rate Envelopes, or Priority Mail International Small Flat Rate Priced Boxes.\nRadio-electronic and high-frequency equipment requires authorization by the country’s Ministry of Transport and Communications. \nRecording media (diskettes, video, and audio) require that information be supplied on the type of computer and operating system used for recording. \nWorks of art, antiques, and other valuable objects of art, history, science, or culture require authorization by the country’s Ministry of Public Health, Education and Culture. ','\nAs of January 1, 2020, for a postal item destined to a private individual, the total duty-free value limit and weight import limit are 200 EUR and 31 kg (68 pounds), respectively. Customs duties apply as follows: the greater fee of either 15 percent of the amount exceeding 200 EUR, or at least 2 EUR per kg of the total weight of the postal item. On all Registered Mail service items sent to Kazakhstan, display the addressee’s first and last name and patronymic (if any) in the address field and the addressee’s national identity number (if possible) in the “importer’s reference” or “comments” field of the customs form. Kazakhstan requires one copy of a commercial invoice for each Priority Mail Express International package containing merchandise and/or any article subject to customs duty.       \n'),('US','LA',NULL,'http://pe.usps.com/text/imm/il_020.htm','Cameras.\nCoins; banknotes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nLaptop computers.\nLithium batteries, including any items containing lithium batteries.\nMobile telephones.\nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Most merchandise requires special permission from the Laotian authorities for importation. Senders should be advised in their own interest to ascertain before mailing whether their goods are admissible. ','The following are the only post offices in operation: Attapeu Houeisai Khammouane Luangnamtha Luangprabang Oudomxay Paksane Paksé Phonehong Phongsaly Samneua Saravane Savannakhet Sayaboury Sékong Vientiane Xiengkhouang '),('US','LB',NULL,'http://pe.usps.com/text/imm/il_022.htm','Artificial butters and adulterated or harmful products.\nAutomatic and electrical gambling devices.\nCigarette papers and machines for the manufacture or packing of cigarettes. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewelry; and other precious articles. \nEssences, essential oils, and products derived therefrom for the use in the manufacture of imitated beverages, ices, and pastries. \nFalse trade-marks, trade names, or indications of origin.\nLighters using butane gas.\nLiquids, easily liquefiable elements, and glass or similarly fragile articles.\nRadioactive materials.','Leaf tobacco, cigars, and cigarettes are subject to prior authorization from the Lebanese Ministry of Finance.\nMedicines, surgical and dental instruments are admitted only under permit from the Ministry of Public Health in Lebanon. ','\nCommercial shipments valued at 50 Lebanese pounds or over, require 3 copies of a combined certificate of origin and commercial invoice. The document must be certified by a chamber of commerce or similar organization and, if a Lebanese consular officer is located at the place of mailing, it must be legalized by him or her. Gift shipments regardless of value and commercial shipments valued at less than 50 Lebanese pounds are exempt from the requirement.  Articles must be carefully addressed to show the exact place of destination but not the names of other places nearby. The office of destination must be written legibly in Arabic characters, as far as possible, as well as in English or French.  Import licenses are required for many kinds of merchandise. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held. Items containing small quantities not exceeding 100 Lebanese pounds in value are not subject to an import permit.        \n'),('US','LC',NULL,'http://pe.usps.com/text/imm/ps_017.htm','Circulars and printed matter concerning lotteries; lottery tickets.\nCurrency.\nFirearms and ammunition except under license from the Police Dept. (Saint Lucia). \nShaving brushes made in Japan. \nUsed clothing. ','No list furnished. ','None '),('US','LI',NULL,'http://pe.usps.com/text/imm/il_026.htm','Arms and weapons. \nFiring caps and loaded metal cartridges for portable firearms, nonexplosive parts of artillery fuses, flammable films, or articles made of celluloid. \nHuman remains.\nLive plants and animals.\nLottery tickets and advertisements for lotteries.\nMini-spies (miniature wireless transmitters).\nRadar detectors.','No list furnished. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  A letter or card fully prepaid and bearing the same address as that of a Priority Mail International parcel may be tied to or otherwise securely attached to the outside of the parcel in such manner as to prevent its separation therefrom and not to interfere with the address of the parcel. Stamps to cover postage on the parcel must be affixed to the wrapper of the parcel. Stamps to pay postage on the letter must be affixed to the envelope thereof, or in the case of a postcard, to the address side of the card, preferably the upper-right portion. Priority Mail International parcels to which such letters or cards are attached are treated as parcel post.        \n'),('US','LK',NULL,'http://pe.usps.com/text/imm/ps_036.htm','Arms; ammunition; weapons; parts and components of weapons; and other related equipment. \nCoins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles except in insured Priority Mail International parcels. \nFoodstuffs containing saccharine in any amount. \nHuman remains. \nLive plants and animals. \nPerishable infectious biological substances. \nPlaying cards. \nRadioactive materials. \nTobacco (admitted only to the Canary Islands, Ceuta, and Melilla). ','Used clothing must be accompanied by a certificate of disinfection. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  Parcel service to the Canary Islands extends to the following offices only:        \n\nAgaete  Arrecife  Arucas  Galdar  Garachico  Granadilla  Gran Tarajal  Guia  Guia de Isora  Guimar  Haria  Hermigua  Icod  Ingenio  La Antigua   \nLa Cuesta  La Laguna  La Orotava  Las Palmas  Los Llanos Moya  Puerto Cabras  Puerto de la Cruz  Puerto Luz  Realejo Alto San Andres y Suaces  San Bartolome Tirajana   \nSan Mateo  San Miguel  Santa Brigida  Santa Cruz de la Palma  Santa Cruz de Tenerife  San Sebastian de la Gomera Tacoronte Tazacorte  Telde  Teror  Valverde del Hierro   \n      \n\n\n\nAgaete  Arrecife  Arucas  Galdar  Garachico  Granadilla  Gran Tarajal  Guia  Guia de Isora  Guimar  Haria  Hermigua  Icod  Ingenio  La Antigua   \nLa Cuesta  La Laguna  La Orotava  Las Palmas  Los Llanos Moya  Puerto Cabras  Puerto de la Cruz  Puerto Luz  Realejo Alto San Andres y Suaces  San Bartolome Tirajana   \nSan Mateo  San Miguel  Santa Brigida  Santa Cruz de la Palma  Santa Cruz de Tenerife  San Sebastian de la Gomera Tacoronte Tazacorte  Telde  Teror  Valverde del Hierro   \n\nAgaete \nArrecife \nArucas \nGaldar \nGarachico \nGranadilla \nGran Tarajal \nGuia \nGuia de Isora \nGuimar \nHaria \nHermigua \nIcod \nIngenio \nLa Antigua \nLa Cuesta \nLa Laguna \nLa Orotava \nLas Palmas \nLos Llanos\nMoya \nPuerto Cabras \nPuerto de la Cruz \nPuerto Luz \nRealejo Alto\nSan Andres y Suaces \nSan Bartolome Tirajana \nSan Mateo \nSan Miguel \nSanta Brigida \nSanta Cruz de la Palma \nSanta Cruz de Tenerife \nSan Sebastian de la Gomera\nTacoronte\nTazacorte \nTelde \nTeror \nValverde del Hierro '),('US','LR',NULL,'http://pe.usps.com/text/imm/il_024.htm','Coins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks, platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles unless sent in insured Priority Mail International. ','Pharmaceutical products are admitted only under prior permit from the National Public Health Dept., Official Bag 9009, Monrovia. ','None '),('US','LS',NULL,'http://pe.usps.com/text/imm/il_023.htm','Base or counterfeit coins.\nCharged butane gas lighters and refills.\nCoins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nEau de cologne.\nMilitary uniforms and equipment.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nPrison-made goods.\nPrinted matter relating to football pools.\nRadioactive materials.\nUsed clothing or used articles intended for resale.','No list furnished. ','Invoices must be inserted in all commercial shipments. '),('US','LT',NULL,'http://pe.usps.com/text/imm/il_027.htm','Arms, ammunitions, and parts and accessories; all types of hunting and sporting guns, crossbows, pneumatic and fighting weapons, gas pistols, and gas bombs. \nArticles whose nature and packaging may constitute a danger to postal employees or that may spoil or damage other postal items. \nArticles with immoral inscriptions and pictures. \nCoins; bank notes; currency notes (paper money) except quantities sent by the National Bank of Lithuania and its institutions; securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious metals and precious stones, including scrap and waste from such items; jewelry; and other valuable articles are prohibited in all classes of mail, including Priority Mail Express International shipments, that are sent to Lithuania. \nExplosive, combustible, and dangerous materials. \nNarcotic, psychotropic, and toxic substances and equipment for using them. \nNonprecious metals, their alloys, wastes, and scrap. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPrepared foodstuffs and raw materials of animal origin if their industrial packaging is damaged, the use-by-date has expired, or the sensory features (i.e., smell, taste, and touch) have been altered. \nRadioactive materials. \nTobacco and manufactured tobacco substitutes, except it is permitted to send 200 cigarettes or 250 g. of tobacco, or an assortment of these products, provided the gross weight does not exceed 250 g. (8.8 ounces). \nWatch straps, watch bands, and watch bracelets, and parts thereof, of precious metal or of metal clad with precious metal whether or not gold-plated or silver-plated. ','Articles subject to customs duty may not be sent in ordinary or registered First-Class Mail International items, First-Class Package International Service items, Priority Mail International Flat Rate Envelopes, or Priority Mail International Small Flat Rate Priced Boxes.\nFirearms (categories B, C, and D), ammunition, special surveillance and security equipment, crime-fighting instruments/equipment, and civilian pyrotechnic articles can be sent only with authorization from the Police Department of the Ministry of Home Affairs. \nObjects of cultural value, works of art, and antiques may be sent only with a permit from the Ministry of Culture’s Department of the Protection of Objects of Cultural Value. \nRadio-electronic apparatus and electrical equipment that may emit radio waves require authorization from the National Electrical Equipment and Communications Inspectorate. \nSugar may not exceed 5 kg (11 pounds) per shipment. ','A value-added tax (VAT) will be applied to books, newspapers, and periodicals. '),('US','LU',NULL,'http://pe.usps.com/text/imm/il_028.htm','Air guns, daggers, sword canes, loaded canes, and other hidden or secret defensive weapons. \nArms and weapons. \nHuman remains. \nLive plants and animals. \nLottery tickets, as well as printed papers, advertisements, posters, etc., relating to lotteries or sweepstakes. \nPerishable infectious biological substances. \nPostcards embellished with fabrics, embroidery, metal, spangles, or similar materials except in sealed envelopes.\nPrinted pamphlets, without indication of the name of the printer. \nRadioactive materials. ','An import license is required for the importation of a number of agricultural; textile; iron and steel; and general products. Therefore, the sender should ascertain from the addressee before mailing whether the necessary documents are held. \nCoins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles may only be sent in insured Priority Mail International parcels. These articles are not admitted in First-Class Mail International shipments, First-Class Package International Service shipments, or Priority Mail International Flat Rate Envelopes. \nSpecial authorization is required for plants, fruit, seeds, meat, and meat products for commercial purposes, saccharine and similar substances. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For Priority Mail International parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.        \n'),('US','LV',NULL,'http://pe.usps.com/text/imm/il_021.htm','Arms, ammunition, parts and accessories. \nCoins, bank notes, currency notes (paper money), securities of any kind payable to bearer; traveler’s checks, platinum, gold, and silver (manufactured or not); precious stones; jewelry and other valuable articles. \nExplosives and combustible materials. \nHyacinth bulb, carnation and chrysanthemum seedling and cuttings, seeds of leguminous plants and seeds in quarantine. \nLive animals except bees and leeches. \nNarcotics and psychotropic substances. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPublications harmful to young people; works contrary to public order; obscene or immoral articles. \nRadioactive materials. \nRaw animal products. ','A veterinary service certificate must accompany animal products (with the exception of canned foods). \nArticles subject to customs duty may not be sent in ordinary or registered First-Class Mail International items, First-Class Package International Service items, Priority Mail International Flat Rate Envelopes, or Priority Mail International Small Flat Rate Priced Boxes.\nPharmaceutical products may not be sent to private individuals who are resident in Latvia. Such products can only be mailed to pharmaceutical manufacturers, pharmaceutical wholesalers, or accredited representatives of foreign producers of medicines who have a business presence in Latvia. A quality certificate and a shipper’s invoice prepared by the product’s producer must accompany all mailpieces that contain pharmaceutical products. \nProducts of floras must be accompanied by a plant health (phytosanitary) certificate. ','Display the addressee’s landline or mobile telephone number, if available, on the address label or customs form of each item sent with any of the following services: Registered Mail, First-Class Package International Service, Priority Mail International, or Priority Mail Express International. This contact information enables Latvijas Pasts to alert the addressee, particularly via short message service (SMS) or other means of notification, that the item is due to be delivered or is available for collection.'),('US','LY',NULL,'http://pe.usps.com/text/imm/il_025.htm','Arms (other than sporting guns). \nCoins; banknotes; currency notes (paper money); securities of all kinds payable to bearer; traveler’s checks; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances.\nRadioactive materials.\nTea, salt.\nTobacco in any form.','Special authorization is required for plant material including seeds, salt, saccharine, sporting guns, serums, and vaccines. ','\nImport licenses are required for all shipments intended for commercial purposes. However, an import permit is not necessary for shipments containing goods whose value does not exceed 5 Libyan Dinar. Every shipment containing goods for sale must be accompanied by an invoice, in duplicate, dated and signed by the sender.  Commercial shipments should be accompanied by a certificate of origin from the dispatching firm that the contents of the shipments contain only goods of a commercial nature.  In accordance with Executive Order 12543 of January 7, 1986, merchandise is limited to donations of articles of food, clothing, medicines, and medical supplies that are intended strictly for medical purposes. First-Class Package International Service items and International Priority Airmail (IPA) items are subject to the content restriction. ISAL service is suspended because transportation is not available.       \n'),('US','MA',NULL,'http://pe.usps.com/text/imm/mo_017.htm','Coins; banknotes; currency notes (paper money); traveler’s checks; securities of any kind payable to bearer; platinum, gold, or silver, manufactured or not; precious stones; jewelry; and other valuable articles. However, coins for numismatic purposes are permitted.\nPerishable infectious biological substances.\nRadioactive materials. ','No list furnished. ','None '),('US','MC','FR','http://pe.usps.com/text/imm/fh_005.htm','Arms, ammunition.\nBanknotes, coins that are current and legal tender in France, and precious metals.\nCigarette lighters using butane gas.\nFeeding bottles.\nFuneral urns.\nGoods bearing false marks of French manufacture or origin.\nHuman remains.\nImitation pearls containing lead salts and any articles of jewelry made with pearls of this type.\nLive plants and animals.\nMeasuring instruments marked in units not complying with French law.\nPerishable infectious biological substances except as noted in Restrictions below.\nPerishable noninfectious biological substances except as noted under Restrictions below.\nRadioactive materials.\nSaccharine in tablets or packets.','Bees, honey, and beeswax must be accompanied by a certificate of origin and noninfection issued by a qualified official approved by the Government. Shipments of honey not exceeding 2 kilograms do not require the certificate.\nBooks in the French language printed abroad must have the names of the publisher and printer shown as prescribed by the French copyright laws.\nCanned vegetables, fish, plums, and nuts not bearing an indication of the country of origin by stamping, in plain raised or sunken letters at least 4 millimeters high, in the middle of the top or bottom and in a place not bearing any inscription.\nGold coins or other articles of gold require that the addressee have a permit issued by the Bank of France (not required for gold-plated articles or for ornaments or jewelry containing only small amounts of gold and weighing 500 grams or less).\nMedicines and medicinal products require an import license issued by the Central Pharmaceutical Service of the Ministry of Health.\nPerishable biological substances, infectious and noninfectious, are admitted when addressed to the following laboratories:\n\nPasteur Institute  25 rue du docteur Roux  75724 Paris CEDEX 14  FRANCE Pasteur Institute  1 rue du Professeur Calmette  59019 Lille CEDEX BB 245  FRANCE Pasteur Institute  77 rue Pasteur  69365 Lyon CEDEX  FRANCE \n\n25 rue du docteur Roux \n75724 Paris CEDEX 14 \nFRANCE\nPasteur Institute \n1 rue du Professeur Calmette \n59019 Lille CEDEX BB 245 \nFRANCE\nPasteur Institute \n77 rue Pasteur \n69365 Lyon CEDEX \nFRANCE\nPlants, seeds, bulbs must be accompanied by plant health certificate. \nThe importation of tobacco leaves and stems, manufactured tobaccos, cigars, cigarettes, chewing and smoking tobacco is permitted only on behalf of the State Monopoly, with the following exception: Manufactured tobaccos, including cigars and cigarettes, may be sent to individuals in France for personal use up to 10 kilograms (22 pounds) per person per year, subject to special customs authorization.','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box. For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration. It is recommended that all articles bear, as part of the address, the name of the Province in which the office of destination is located. Printed matter of value should have Form 2976 affixed, and it can be cleared more readily through French customs if an invoice is enclosed. Parcels whose senders or addressees are designated by initials will not be admitted. Shipments must not be fastened by means of wire, but straps not having sharp edges may be used, provided they are tightly fastened so that no sharp ends or corners are exposed.       \n'),('US','MD',NULL,'http://pe.usps.com/text/imm/mo_013.htm','Coins, bank notes, securities payable to bearer, and traveler’s checks.\nPerishable infectious biological substances. \nRadioactive materials. ','No list furnished. ','None '),('US','ME',NULL,'http://pe.usps.com/text/imm/mo_015.htm','Perishable infectious biological substances. \nRadioactive materials. ','No list furnished. ','None '),('US','MF','FR','http://pe.usps.com/text/imm/fh_018.htm','Arms in general, except certain arms for hunting; military supplies of all kinds. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewels; and other valuable articles. \nCremated remains.\nFeeding bottles and feeding bottles with glass tubes.\nGardenia plants and seeds.\nPolice whistles.\nPowder of all kinds.\nTelegraphic apparatus.','No list furnished. ','Tape, adhesive strips, or gummed paper should not be used to seal registered items unless the signature or name of the sender is written or stamped on the tape. '),('US','MG',NULL,'http://pe.usps.com/text/imm/mo_003.htm','Aphrodisiacs. \nArms, munitions, and similar articles. \nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles are prohibited in all classes of mail, including Priority Mail Express International shipments, that are sent to Malawi. \nCorrespondence concerning fraudulent enterprises or fortune telling. \nUsed clothing. ','Patent medicines must be plainly marked with the composition and dosage. ','None '),('US','MK',NULL,'http://pe.usps.com/text/imm/mo_002.htm','Articles violating the copyright laws.\nBoxes of preserved sardines weighing more than 1 kilogram.\nCoins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nCompound medicines not appearing in an official pharmacopoeia. \nPlaying cards. \nPreserved fish, vegetables, and plums not bearing on each receptacle a stamp showing their origin. \nProducts bearing false indications of origin. \nRadioactive materials. \nSaccharine. \nTobacco sauce (Praiss). ','Arms and ammunitions for military or sporting use are admitted only under permit issued by local authorities in Madagascar. \nConsignments of watches are admitted only in Priority Mail International parcels, the packing of which consist of strong metal boxes or cases made of wood. ','None'),('US','ML',NULL,'http://pe.usps.com/text/imm/mo_007.htm','Arms and weapons.\nFiring caps and loaded metal cartridges for portable firearms and ammunition. \nIndecent or obscene articles. \nLive plants and animals. \nLottery tickets and advertisements thereof. \nRadioactive materials. \nSwitchblade knives. ','Used clothing, sacks, bags, carpets, embroidery, fruit, vegetables, and many other foodstuffs are subject to local health regulations. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  Many items are completely prohibited or admitted only under special permit issued by the Controller of Customs, Malta. The sender, therefore, should ascertain from the addressee before mailing whether the necessary documents are held.        \n'),('US','MM',NULL,'http://pe.usps.com/text/imm/ab_034.htm','All goods manufactured outside Her Majesty’s dominions and bearing the British Royal Arms or imitations thereof; or bearing as a mark or label a portrait of any member of the Royal Family of England. \nCoins; banknotes; currency notes (paper money); traveler’s checks; platinum, gold, or silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nImitation and toy pistols and revolvers. \nMoney, gold or silver (in bullion) exceeding L5 in value, except coins obviously intended as ornaments. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Hypodermic syringes or needles may only be imported on behalf of the Government or addressed to practicing physicians. \nNoninflammable or safety films must be contained in a strong metal box packed in a solid wooden or thick cardboard receptacle, labeled very clearly in red “Contains only noninflammable films” on the outside of each package. \nWireless telegraph equipment, and transceivers and receivers, require a permit from the Director General of Posts and Telegraphs; receivers alone may be imported upon application to the customs authorities. ','\nThe following may not be sent as merchandise with First-Class Package International Service if they are liable to customs duty: Works of art (including photographs), printed forms, account books, manuscript books, labels, advertising matter (except trade catalogs and circulars), picture books, almanacs, maps, old paper, and old newspapers serving as packing paper.  Addressees are required to obtain import licenses to take delivery of shipments, including those sent as gifts. It is recommended that senders inform the addressees of the contents of shipment prior to mailing, so that they may apply for the necessary import license.       \n'),('US','MN',NULL,'http://pe.usps.com/text/imm/mo_014.htm','No list furnished. ','No list furnished. ','None '),('US','MO',NULL,'http://pe.usps.com/text/imm/mo_001.htm','Arms, except under permit.\nFiring caps and loaded metal cartridges for portable firearms.\nLithium cells and batteries, including those properly installed in the equipment they are intended to operate, mailed to or sent via Macao.\nPerishable infectious biological substances.\nRadioactive materials.','Coins; banknotes; currency notes; traveler’s checks; securities payable to bearer; platinum, gold, or silver, manufactured or not; precious stones; jewelry; and other valuable articles may only be sent in First-Class Package International Service with Registered Mail service shipments.','Effective December 20, 1999, Macao became a Special Administrative Region of the People’s Republic of China. Despite that change in territorial status, mail intended for delivery in Macao should continue to be addressed to Macao directly. '),('US','MQ','FR','http://pe.usps.com/text/imm/mo_009.htm','Coins; banknotes; currency notes (paper money); traveler’s checks; securities of any kind payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nPrinted or written matter, including designs or emblems, capable of promoting crime or public disorder. \nRadioactive materials. \nRough diamonds. \nSwitchblade knives, blackjacks, daggers, and other concealable offensive weapons. Firearms, except for government use. \nWatches. \nWeighing and measuring instruments not calibrated in the metric system. ','Tobacco or cigarettes. The packages must bear the words “Vente en Republique Islamique de Mauritanie” printed in letters at least 1-1/4 inches high below the trademark. ','Import permits or licenses are required for many types of goods; therefore, the sender should ascertain from the addressee before mailing whether the necessary documents are held. '),('US','MR',NULL,'http://pe.usps.com/text/imm/mo_010.htm','All varieties of maize; tea. \nAmmunition, charged metal firing caps, and cartridges for small arms. \nCoins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. \nSeditious printed matter, paintings, books, and publications. \nUsed clothing intended for sale. ','Drugs and medicines may only be addressed to physicians, dentists, pharmacists, or veterinarians. \nImport permit is required for radiosets and spare parts, thereof. ','Import permits or licenses are required for many types of goods; therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held. '),('US','MS','GB','http://pe.usps.com/text/imm/mo_016.htm','Coins; banknotes; currency notes (paper money); traveler’s checks; securities of any kind payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nLottery tickets and printed matter relating to lotteries.\nRadioactive materials.\nWeapons and parts thereof, except for the Ministry of War.','Import permits and quota certificates issued by the Ministry of Trade (Morocco) are required for many types of goods. Therefore, the sender should ascertain from the addressee or Moroccan Consulates before mailing whether the necessary documents are held or required. \nItems containing food supplements must be sent with the relevant health certificates.\nItems of a medical nature must be accompanied with the relevant prescriptions.\nUsed/second-hand clothes are subject to an import permit issued in advance by the Moroccan Ministry of Industry, Commerce, Mines, and Merchant Marine. ','Invoices must be provided for all commercial items.'),('US','MT',NULL,'http://pe.usps.com/text/imm/mo_008.htm','Perishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.\nOtherwise, same as for France.','Same as for France. ','Same as for France. '),('US','MU',NULL,'http://pe.usps.com/text/imm/mo_011.htm','Ammunition, firing caps, and loaded metal cartridges for portable firearms. \nCoins; banknotes; currency notes (paper money); securities or checks of any kind payable to bearer; traveler’s checks; platinum, gold, or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nElectronic cigarettes.\nMeat and products derived from pork.\nPerishable confectionery, pastries, fruit, and vegetables.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nPharmaceutical products, including pills, troches, tablets, granules, capsules, and lozenges.\nPistols and other devices for emitting tear gas.\nPowder of all kinds.\nRadioactive materials.\nTickets, lists, and circulars for foreign lotteries.\nWhey and serum proteins of animal origin.\nWorks infringing copyrights covering Mexico.','Chocolate and products made of chocolate require prior authorization from the Mexican Secretary of Commerce. \nMedicinal products, beauty products, cosmetics, and toilet articles are admitted only by prior approval of the Department of Public Health in Mexico. ','\nAs of March 1, 2019, import taxes (determined by the customs authority of Mexico) apply to goods with a declared value exceeding U.S. $50, and Correos de México requests that a commercial invoice accompany such goods. To speed delivery of items subject to customs duty, commercial shipments must contain two copies of the commercial invoice, inserted inside the package. An import permit or license is required for merchandise exceeding U.S. $1,000. Merchandise valued less than U.S. $1,000 does not require an import permit. Importers of food supplements must obtain a license in the form of a health certificate issued by the government of Mexico. Therefore, Correos de México advises that a mailer not dispatch food supplements without assurance that the importer possesses or is able to obtain the necessary license.    \n'),('US','MV',NULL,'http://pe.usps.com/text/imm/mo_006.htm','Coins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold, silver, manufactured or not; precious stones, jewelry and other valuable articles.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.\nWeights and measures not of the metric system.','Preserved fish, vegetables, and plums must be marked plainly with country of origin. Boxes of fish weighing more than one kilogram. \nThe following articles are subject to special regulations on importation: Firearms and airguns; distilling apparatus; saccharine and artificial flavors for beverages and confectionery; phonograph records, Arabic books, and prints. ','\nFirst-Class Package International Service items containing dutiable articles must be sent with Registered Mail service. Postal authorities of Mali collect domestic postage from addressees for inbound shipments.       \n'),('US','MW',NULL,'http://pe.usps.com/text/imm/mo_004.htm','Butane gas lighters and refills. \nCirculars or advertisements containing amulets, charms, or talismans. \nCoins or ingots of a value higher than 50 Malaysian dollars, except coins for ornament. \nFirearms, including gas guns, and any component parts of such weapons. \nHarpoons and spear guns used for undersea fishing. \nLottery tickets and advertisements thereof. \nPornographic articles. \nRadioactive materials. ','Coins; banknotes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles may only be sent in insured parcels. These articles are not admitted in First-Class Mail International items, First-Class Package International Service items, or Priority Mail International Flat Rate Envelopes. ','\nInsured parcels for Sabah (North Borneo and Labuan) and Sarawak are accepted only for delivery at the following offices:  Sabah (North Borneo and Labuan): Beaufort, Keningau, Kota Belud, Kota Kinabalu, Kudat, Labuan, Lahad Datu, Papar, Ranau, Sandakan, Semporna, Tawau, Tenom, and Tuoran.  Sarawak: Baran, Bintulu, Kuching, Limbang, Miri, Mukah, Sarikei, Sibu, and Simanggang.  Many types of merchandise require import licenses that addressees must obtain from the Malaysian authorities. Senders should be assured before mailing that addressees can obtain licenses if needed.        \n\nSabah (North Borneo and Labuan): Beaufort, Keningau, Kota Belud, Kota Kinabalu, Kudat, Labuan, Lahad Datu, Papar, Ranau, Sandakan, Semporna, Tawau, Tenom, and Tuoran. \nSarawak: Baran, Bintulu, Kuching, Limbang, Miri, Mukah, Sarikei, Sibu, and Simanggang. \nMany types of merchandise require import licenses that addressees must obtain from the Malaysian authorities. Senders should be assured before mailing that addressees can obtain licenses if needed. '),('US','MX',NULL,'http://pe.usps.com/text/imm/mo_012.htm','Bank notes; currency notes; and securities payable to bearer. \nExplosives, pyrotechnic products, matches; materials regarded as combustible or dangerous. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPrinted books, newspapers, pictures, publications, manuscripts, and other products of the printing industry that are contrary to public order; obscene or immoral articles. \nRadioactive materials. \nSoftware or technical devices specifically developed, manufactured, programmed, or adapted to intercept information.','Medicaments and other products used in medical treatment are subject to prior authorization granted by the Ministry of Health (Pharmaceutical and Medical Equipment) or by the Ministry of Agriculture and Food (Veterinary Service).','\n\nAs of January 1, 2020, Moldova applies customs duty to any item containing goods with a value exceeding the following:\nBusiness to business (B2B): 100 EUR. Business to consumer (B2C): 200 EUR. Consumer to business (C2B): 100 EUR. Consumer to consumer (C2C): \n430 EUR for items sent by airmail. 300 EUR for items sent by surface mail.\n\n\n\nValuable items and other expensive goods such as mobile phones, currency, precious stones, digital cameras, video cameras, and electronic devices should be sent as insured items. Moldova will not assume liability for loss of, or theft from, packages containing valuable articles or expensive goods. \n'),('US','MY',NULL,'http://pe.usps.com/text/imm/mo_005.htm','Any type of gunpowder; weapons of war; intoxicants; poisons; nitrates; pork; statues used for worship; pornographic material. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','No list furnished. ','None '),('US','MZ',NULL,'http://pe.usps.com/text/imm/mo_018.htm','Articles relating to lotteries.\nCharged butane gas lighters and refills.\nCigarettes exceeding 2 kg per thosand in weight.\nDiamonds or precious stones except in First-Class Package International Service with Registered Mail service shipments. \nHoney. \nPrison-made articles. ','None ','\nImport licenses are required for many types of goods. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held.  Licenses are not required for bona fide gifts not exceeding R 200 (Rand) in value.  The postal administration of Namibia does not deliver mail to street addresses. Therefore, all mailpieces sent to that country must be addressed to a private post office box. This condition of mailing applies to Priority Mail Express International shipments, registered and unregistered First-Class Mail International, First-Class Package International Service, and insured and uninsured parcels that are sent to Namibia.        \n'),('US','NA',NULL,'http://pe.usps.com/text/imm/mo_019.htm','Radioactive materials. ','No list furnished. ','As of February 20, 2019, Nauru Post requests that each item addressed to Nauru include the postcode “NRU68,” preferably on the next-to-the-last line in the address (below the district name and above the country name), as in this example:\nMR IAN MONTGOMERYISLAND RING ROADYAREN DISTRICTNRU68NAURU'),('US','NC',NULL,'http://pe.usps.com/text/imm/mo_023.htm','Air guns, stun guns, tasers, and stun batons.\nAmmunition, including bullets.\nAntiques and collectibles, including numismatic (collector’s) coins.\nArtwork including paintings, sculptures, and of other works of art.\nBank cards, including credit cards, debit cards, electronic-funds-transfer-at-point-of-sale cards (EFTPOS), and gift cards.\nCoins; bank notes; currency notes (paper money); bullion; stamps (unused); bonds, shares, and securities of any kind payable to bearer; traveler’s checks; bills of exchange; and other negotiable instruments. \nFirearms; and parts thereof.\nFirst aid kits.\nFurs and skins of animals (untreated).\nHuman or animal remains (including cremated remains).\nInert grenades.\nJewelry, precious metals or stones, watches.\nKeys.\nLithium batteries — including items containing properly installed lithium batteries under IMM 135.6.\nLive organisms, such as bees, leeches, silkworms, and harmless insects.\nMagnets and magnetic material, such as refrigerator magnets and compasses.\nMedicines including over-the-counter and prescription drugs.\nObscene and immoral articles contained in publications and on any media, including videotapes, films, records, and CD–ROMs.\nOffensive weapons and knives (including knuckledusters and swordsticks), bows (including crossbows and arrows), harpoons, spear guns, sling shots, catapults, and defensive chemical dispensers (including mace, pepper spray, and tear gas).\nPassports and national identification cards (including applications and renewals for such cards), and original copies of other identity, travel, ownership, or legal documents.\nPesticides, herbicides, and other poisons not classified as hazardous materials.\nRadioactive materials.\nVouchers, event tickets, and tickets for games of chance.','Addressees are required to obtain import licenses from the New Zealand customs authorities for all shipments except the following: \nBona fide gifts not exceeding 100 New Zealand dollars in value. \nMeat or meat products and fish and fish products are admitted only conditionally. \nMerchandise for the addressee’s personal use, not for his or her business or professional use or for sale or trade, and not exceeding 20 New Zealand dollars in value. \nUsed clothing and used bedding must be for personal use of persons in New Zealand, or with permission of the New Zealand Minister of Customs. Worn out clothing not for personal use must be clean and disinfected, or it will be done at the addressee’s expense. ','\nEach commercial shipment must be covered by a commercial invoice showing the current domestic price of the goods (that is, what the price would be if sold in the United States) and the selling price to the purchaser in New Zealand. The invoice must include a certificate as to the value of the goods, prepared in prescribed form, and signed by the shipper. Printed blanks for the invoice and certificate can be purchased from printing firms specializing in such supplies.  The completed invoice must be sent to the addressee by First-Class Mail International. It is desirable to send one copy by air and another by ordinary means. Goods purchased online from the United States with an individual value not exceeding 1,000 New Zealand Dollars (NZD) may have the Goods and Services Tax (GST) collected by the seller at the point of sale. To avoid double taxation, New Zealand Post recommends that a U.S. mailer include a copy of the receipt or commercial invoice showing the GST number and the amount of GST paid. New Zealand Customs Service (NZCS) will use the documentation to assess tax liability at the border. When no proof of payment of GST is available, NZCS may charge the GST to the addressee before completing importation.       \n'),('US','NE',NULL,'http://pe.usps.com/text/imm/mo_026.htm','Arms, ammunition, caps and metal cartridges for firearms.\nCoins; banknotes; currency notes, except from a bank and addressed to a bank in Nigeria. \nHardware of all kinds. \nLottery circulars, advertisements. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Medicines including proprietary preparations; penicillin, streptomycin, and similar substances require a license.\nPrecious stones and manufactured gold, platinum, or silver are admitted only if not more than 5 francs in value. \nUsed clothing must be accompanied by a certificate of disinfection. ','None '),('US','NF',NULL,'http://pe.usps.com/text/imm/ab_012.htm','Antiquities, art fossils, historical documents, numismatic material, specimens of flora and fauna, and similar cultural heritage objects that are significant to a nation’s identity.\nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (except for jewelry items meeting the requirement in “Restrictions” below); precious stones (except when contained in jewelry items meeting the requirement in “Restrictions” below); and other valuable articles are prohibited.\nDog collars with protrusions designed to puncture or bruise an animal’s skin.\nFruit cartons (used or new).\nFur, including raw, tanned, or processed furs or pelts, and goods that may contain such fur that are derived from domesticated cat and dog breeds.\nGoods bearing the name “Anzac.”\nGoods produced wholly or partly in prisons or by convict labor.\nLaser pointers and similar handheld devices designed or adapted to emit a laser beam with an accessible emission level greater than 1 megawatt (MW).\nMost food, plant, and animal products, including the use of products such as straw and other plant material as packing materials.\nPerishable infectious biological substances.\nRadioactive materials.\nRegistered philatelic articles with fictitious addresses.\nReplica firearms, including any article that has the appearance of a firearm that could reasonably be mistaken as a firearm.\nSeditious literature.\nSignal jammers capable of preventing or disrupting mobile telephone and satellite navigation services.\nSilencers for firearms.\nTobacco products, including cigarettes and loose-leaf tobacco. Exception: Cigars. Note: Although Australia also permits chewing tobacco and oral snuff in amounts up to 3.3 pounds (1.5 kg), the U.S. Postal Service does not permit these types of smokeless tobacco in international mail — see 136.4.\nUsed bedding.','Airsoft (BB) guns that do not have the appearance of fully automatic firearms require prior approval granted by relevant police representatives. The addressee must submit an application to import the item via the police certification test.\nDrugs, medicines, and therapeutic substances such as antibiotics, growth hormones, kava, psychoactive substances, and steroids require an import permit from the Australian Department of Health, Office of Drug Control. \nFish or parts of fish, including all species of bony fish, sharks, rays, crustaceans, mollusks, and other marine organisms (but not including marine mammals, marine reptiles, or toothfish), whether fresh, frozen, smoked, or preserved in airtight containers, require an import permit from the Australian Fisheries Management Authority (AFMA).\nJewelry is permitted only when sent as an insured parcel using Priority Mail International service. In addition, Australian Customs regulations prohibit importation of jewelry that is made with ivory or from endangered species, such as snake, elephant, or crocodile, that does not have an accompanying Import/Export Permit in relation to the Convention on International Trade in Endangered Species of Wild Fauna and Flora (CITES).\nKnives (such as daggers and throwing knives), throwing blades, or throwing axes require written Police Certification (B709B form or B709X form) from the Australian Police Firearms Registry.\nMeat and other animal products; powdered or concentrated milk; and other dairy products requires permission to import from the Australian quarantine authorities. \nPermission of the Australian Director-General of Health is required to import medicines.','Duty may be levied on catalogs, price lists, circulars, and all advertising introduced into Australia through the mail, regardless of the class of mail used.'),('US','NG',NULL,'http://pe.usps.com/text/imm/mo_027.htm','No list furnished. ','No list furnished. ','No list furnished. '),('US','NI',NULL,'http://pe.usps.com/text/imm/mo_025.htm','Daggers, knives, weapons. \nFiring caps, and loaded metal cartridges for portable firearms; ammunition. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nProducts using the Red Cross or Geneva Cross as a trademark. \nPublications in Arabic. \nRadioactive materials. \nRough, uncut diamonds. \nTins of fish exceeding 1 kg in weight. \nWeights and measures not of the metric system. ','No list furnished. ','First-Class Package International Service items containing dutiable articles must be sent with Registered Mail service. '),('US','NL',NULL,'http://pe.usps.com/text/imm/mo_022.htm','Perishable infectious biological substances.\nRadioactive materials.\nTobacco leaves or manufactured tobacco.\nWeights and measures not of the decimal system.','No list furnished. ','\nImport permits and import certificates are required for some types of goods. Therefore, senders should ascertain before mailing whether the necessary documents are held.  Import permits are not required for items valued less than 2000 f CFP.  Certificates of origin and accompanying documents should be sent to the consignees by First-Class Mail International or First-Class Package International Service; they should not be enclosed in Priority Mail International.        \n'),('US','NO',NULL,'http://pe.usps.com/text/imm/mo_028.htm','Firing caps, loaded metal cartridges for portable firearms, non-explosive elements of artillery fuses and matches. \nPharmaceutical products of any kind, whether of synthetic extraction or classified as naturopathic preparations.\nRadioactive materials. \nSubstances considered explosive; inflammable or dangerous. ','Cosmetics (perfumes, cosmetics, and sanitary products containing alcohol) must be approved by the Technical Alcohol committee. \nImportation of radio and telecommunications equipment (equipment like radio remote controls or other wireless systems including walkie-talkies, remote controls, and wireless telephones) is prohibited without the authorization of the Norwegian Telecommunication Regulatory Authority, Olso. Ordinary TV and radio receivers are exempt from the regulation. Any imported dutiable equipment must be reported to the Norwegian Broadcasting Corporation by the importer. \nMedicaments and other products used for medical treatment require authorization by the Ministry of Health. Serum, vaccines, and other bacteriological and serological preparations may be imported by labs and institutes approved by the Norwegian State. \nNorwegian bank notes and coins and Norwegian and foreign securities of all kinds require authorization of the national Bank of Norway. Bills for exchange and bank drafts in payment of goods exported from Norway may be imported without prior authorization. \nProducts of animal origin intended for consumption/use by humans or pet animals are subject to authorization by the Veterinary Department of the Ministry of Agriculture in addition to customs clearance permission. Exception is made for some products. A list can be obtained from the Ministry of Agriculture in Norway. \nThe importation of firearms, ammunition, and parts of such and other military equipment is subject to the authorization of the Norwegian Police. ','\nA commercial invoice in duplicate is required for customs clearance of all commercial items. \nAs of January 1, 2020, Norway applies a value-added tax (VAT) to all goods containing food, goods with import restrictions, and goods that are subject to excise duty, regardless of value. (Previously, Norway exempted these low-value goods from a VAT.) Goods containing food include, but are not limited to, candy, food supplements, health food, protein powders, soft drinks, spices, and teas. For additional information and guidance, see the following two web sites: www.skatteetaten.no/en/person/duties/purchases-from-abroad, and www.skatteetaten.no/en/business-and-organisation/vat-and-duties/vat/foreign/exporting-goods-to-consumers-in-norway--important-changes.       \n'),('US','NP',NULL,'http://pe.usps.com/text/imm/mo_021.htm','Arms and weapons.\nFirearms and parts thereof, except under permit.\nHuman remains. Only cremated remains (human ashes) are permitted.\nLive plants and animals.\nRadioactive materials.\nTickets and publicity for lotteries.','Articles sent for commercial purposes will not be admitted unless the addressee has obtained an import permit issued by the Centrale Dienst voor Inen Uitvoer, van Stolkweg 14, Gravenhage, and where necessary, a currency permit issued by the Nederlandsche Bank at Amsterdam. \nAuthorization from the Nederlandsche Bank is required to be obtained by the addressee for the importation of current instruments of payment; securities; acknowledgments of debt; and shares of stock. \nCigarettes are prohibited. In addition, gift shipments of the following tobacco product from one individual to another are limited to the following maximum quantities and a value of no more than 45 EUR: 1) 10 cigars; 2) 25 cigarillos (maximum weight, 3 grams each); or 3) 50 grams of pipe tobacco.\nMeat or meat products (including poultry and wild game) and milk or milk products cannot exceed 1 kilogram (approximately 2.2 lbs.), and any such products must be accompanied by a veterinary certificate issued by the responsible official authority from the country of origin. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.        \n'),('US','NR',NULL,'http://pe.usps.com/text/imm/mo_020.htm','Bearings of all kinds.\nCameras.\nCardamon.\nCinnamon.\nCloves.\nCoins, banknotes; currency notes (paper money); securities of \nany kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances.\nPhotographic paper.\nRadioactive materials.\nSynthetic fibres (75 denier or less).\nWatches and spare parts.','No list furnished. ','First-Class Mail International items, First-Class Package International Service items, and Priority Mail International Flat Rate Envelopes may not contain dutiable articles. '),('US','NU',NULL,'http://pe.usps.com/text/imm/mo_024.htm','Ammunition. \nCoins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry, and other valuable articles unless sent in insured Priority Mail International. \nCommunist material or literature. \nForeign lottery tickets. \nLighters. \nPharmaceutical specialties not registered in Nicaragua: pharmaceutical preparations or secret remedies of unknown composition whose formulas have not been made public. \nPolice whistles. \nTelegraph equipment. ','Firearms require the permission of the Government. \nPlant- and animal-based substances are subject to seizure unless they are accompanied by a phytosanitary export certificate from the country of origin.','Tape, adhesive strips, or gummed paper should not be used to seal registered items unless the signature or name of the sender is written or stamped on the tape. '),('US','NZ',NULL,'http://pe.usps.com/text/imm/mo_024.htm','Ammunition. \nCoins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry, and other valuable articles unless sent in insured Priority Mail International. \nCommunist material or literature. \nForeign lottery tickets. \nLighters. \nPharmaceutical specialties not registered in Nicaragua: pharmaceutical preparations or secret remedies of unknown composition whose formulas have not been made public. \nPolice whistles. \nTelegraph equipment. ','Firearms require the permission of the Government. \nPlant- and animal-based substances are subject to seizure unless they are accompanied by a phytosanitary export certificate from the country of origin.','Tape, adhesive strips, or gummed paper should not be used to seal registered items unless the signature or name of the sender is written or stamped on the tape. '),('US','OM',NULL,'http://pe.usps.com/text/imm/mo_029.htm','Arms; ammunition or parts thereof.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','Medicines of all kinds must be authorized by the Ministry of Health. \nRadio sets, transmitters, receivers, and telegraphic apparatus require a permit from the Ministry of Posts, Telegraphs, and Telephones. ','First-Class Package International Service items containing dutiable articles must be sent with Registered Mail service. '),('US','PA',NULL,'http://pe.usps.com/text/imm/ps_002.htm','Coins; banknotes; currency notes (paper money); securities of any kind, payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nFatty, liquid, or easily liquefiable substances.\nLottery tickets and circulars.\nPerishable fruits and plants.\nPerishable infectious biological substances.\nRadioactive materials.\nSweetmeats and pastries.','No list furnished. ','First-Class Mail International and First-Class Package International Service items may not contain dutiable articles. '),('US','PE',NULL,'http://pe.usps.com/text/imm/ps_005.htm','Agricultural pesticides containing active ingredients (ethylene dichloride, ethylene oxide, monocrotophos).\nCoins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nDrinks manufactured abroad under the brand name “Pisco.”\nLithium batteries, liquids, and aerosols, including in misrouted items and transit mail items sent via Peru.\nOrganochlorinated pesticides and their derivatives and components.\nPerishable infectious biological substances. \nPyrotechnic products.\nRadioactive materials. \nUsed clothing and shoes.\nUsed tires.\nVitamins.','Telecommunications equipment (including mobile telephones) requires a license from the Ministry of Transportation and Communications before mailing.','\nFirst-Class Mail International and First-Class Package International Service items may not contain dutiable articles.  Each shipment valued at U.S. $200 or over must be accompanied by a consular invoice if there is a Peruvian consulate located at the place of mailing. If there is none, a commercial invoice must be furnished instead. The commercial invoice must be legalized by a Peruvian consulate or countersigned by a chamber of commerce, or if neither is available, it may bear the notarized signatures of two well-known local merchants. If the value is under U.S. $200, a commercial invoice must be furnished but need not be legalized. The consular or commercial invoice may be either enclosed in the parcel or sent separately to the addressee so as to arrive before the parcel, but the legalization must not be dated later than the day of mailing.  Peruvian consuls are located in principal cities of the United States.  Gifts addressed to persons native to the country do not require a commercial invoice unless the value of such gifts exceeds U.S. $450 per calendar year.  Many items are prohibited import into Peru. Therefore, senders should ascertain from the addressee before mailing whether the item may be received or not.        \n'),('US','PF',NULL,'http://pe.usps.com/text/imm/fh_007.htm','Coins; currency notes (paper money); securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, silver; precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Banknotes admitted only in First-Class Package International Service with Registered Mail service items.','None '),('US','PG',NULL,'http://pe.usps.com/text/imm/ps_003.htm','Perishable infectious biological substances. \nPerishable noninfectious biological substances. ','No list furnished. ','None '),('US','PH',NULL,'http://pe.usps.com/text/imm/ps_006.htm','Coins; currency notes or securities of any kind payable to bearer; traveler’s checks; platinum, gold, or silver (whether manufactured or not); precious stones; or other valuable articles.\nFirearms and weapons and parts thereof including replicas of weapons; ammunition. \nGambling devices. \nLiquids, easily liquefiable items, and glass or similarly fragile articles.\nLottery tickets, circulars, or advertisements relating to lotteries. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Powdered coffee, coffee beans, or ground coffee, used for personal consumption only. Powdered coffee may not exceed two plastic bottles, each containing 500 grams (approximately 17.64 ounces), and coffee beans or ground coffee may not exceed 2 kilograms (approximately 4.4 pounds). Approval from the Food and Drug Administration (FDA) – Philippines is required for items that exceed these limits.\nPlants and similar items require sanitary and phytosanitary import clearances and phytosanitary certificates from the Philippines Bureau of Plant Industry (National Plant Protection Organization). Philippines national legislation authorizes the disposal or destruction of items that do not contain the proper documentation.','\nCommercial invoices that have a dutiable value of 3000 pesos and above are subject to authentication by the Philippine Consulate and to the payment of a fee of U.S. $30.  Philippine postal authorities recommend that letters containing checks or other negotiable instruments be sent by Registered Mail.  The following documents should accompany all mail items containing cremated human remains: \n\n\nCertificate of cremation. Transport permit information. Death certificate/cause of death. Quarantine certificate/permit. \n\nThe mailer must place the documents in a transparent plastic envelope (such as PS Form 2976-E, Customs Declaration Envelope CP 91) and affix the envelope to the exterior of the box with a “cremated human remains” label (such as Label 139, Cremated Remains).'),('US','PK',NULL,'http://pe.usps.com/text/imm/ps_001.htm','Arms, ammunition except when sent on behalf of the Government. \nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles are prohibited in all classes of mail, including Priority Mail Express International shipments, that are mailed to Pakistan. \nLottery tickets or circulars relating to lotteries. \nPerishable infectious biological substances.\nRadioactive materials. ','Bank checks, immigration documents, original educational documents, Graduate Record Examination (GRE), Test of English as a Foreign Language (TOEFL), and International English Language Testing System (IELTS) tests may be sent only by Priority Mail Express International service or with Registered Mail service. \nMobile telephones, watches, fountain pens, cameras, eyeglasses, toys, and other valuable consumer products must be mailed in insured parcels. ','\nImport permits or licenses are required for many types of goods. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held.  Import licenses are not required for unsolicited gift shipments involving no remittance of foreign exchange from Pakistan provided that such parcels do not contain textiles (other than made up garments and second-hand clothing), imitation jewelry, watches and watch bands, fountain pens, cameras, radio sets, and trophies (such as of animals and birds). All goods sent in gift shipments are subject to a maximum value of 1,000 rupees per person per year. For this purpose the year commences on 1 July and ends on 30 June.        \n'),('US','PL',NULL,'http://pe.usps.com/text/imm/ps_008.htm','Arms and ammunition. \nArticles, printed matter, written documents or other articles contrary to interests of Poland. \nCoins; bank notes; currency notes (paper money) including currency in circulation in the Polish Republic; traveler’s checks; platinum, gold, or silver (manufactured or not); precious stones; jewelry; and other valuable items. \nPerishable infectious biological substances \nPerishable noninfectious biological substances \nRadioactive materials. ','Urns containing human ashes require an import permit issued by the Presidium of the Municipal Council of the locality where the urn is to be buried. ','Import permits are required for many goods. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held. '),('US','PM','FR','http://pe.usps.com/text/imm/ps_018.htm','Perishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','No list furnished. ','None '),('US','PN','GB','http://pe.usps.com/text/imm/ps_007.htm','Coins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','No list furnished. ','None '),('US','PT',NULL,'http://pe.usps.com/text/imm/ps_009.htm','Arms and weapons.\nCigarette lighters and refills containing butane gas.\nCoins; banknotes; traveler’s checks; currency notes (paper money); securities payable to bearer; platinum, gold, or silver, (manufactured or not); precious stones; jewelry; and other valuable articles. Banknotes will be permitted if the addressee has a license issued by the Bank of Portugal. \nHuman remains.\nLive plants and animals.\nLottery tickets and advertisements concerning lotteries.\nTobacco.','Import permits must be obtained for shipments regarded by the Portuguese authorities as commercial shipments.\nMedicaments require the authorization of the Director General of Health of Portugal. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.        \n'),('US','PY',NULL,'http://pe.usps.com/text/imm/ps_004.htm','Arms and munitions except under permit.\nBatteries.\nMost foodstuffs including butter and cheeses; sugar; peanuts; salt; fats of vegetable origin; rice; fruit; and tomato juices. \nPlastic toys. \nSoaps. \nStocking and socks except those made of jersey. \nSuitcases; leather bags. \nUsed clothing and apparel. \nWool blankets. ','Medicines, drugs require a permit from the Ministry of Public Health. \nPrinted matter in general use such as check books; forms; receipts; posters; notices of sale and commercial invoices; and statements are not admitted in Priority Mail International parcels. \nUsed linen must be accompanied by a disinfection certificate. ','Each item mailed to Paraguay must include the appropriate postcode. Information on Paraguay postcodes is available from the Dirección Nacional de Correos del Paraguay (DINACOPA) website at apps.senatics.gov.py/dinacopa/#/zona/zonaspostales (in Spanish only). Customers can obtain additional information by calling +595 21 444 592.'),('US','QA',NULL,'http://pe.usps.com/text/imm/ps_010.htm','Advertising articles for promoting cigarettes.\nAlcoholic beverages of all kinds.\nAmmunition.\nCigarettes and tobacco products.\nClothing bearing the name of Allah or verses from the Koran.\nCounterfeit currency.\nFish and crustaceans, mollusks, and other aquatic invertebrates.\nInflammable, explosive, or dangerous substances.\nLiquids of any type.\nLive animals.\nMeats and edible offal.\nMilitary or similar clothing.\nMusical greetings cards.\nObscene or immoral articles.\nOrdinary items containing coins; banknotes; currency notes or any security payable to the bearer; traveler’s checks; platinum, silver, precious stones, jewels, or any precious articles.\nPerishable infectious biological substances.\nPolitical printed matter and publications of a subversive nature and prejudicial to national security.\nPork fat products.\nRadioactive materials.\nRemote-controlled aircraft for children and games of chance.\nSpoiled products which are harmful to health; products unfit for human consumption.\nWeapons or parts of weapons.','Bees, leeches, silkworms, and parasites are prohibited unless they are enclosed in boxes so constructed as to avoid any danger during transport.\nImportation of motor vehicle headlights is prohibited without prior authorization of the appropriate authorities.\nInstruments of weights and measures used for weighing are prohibited without authorization from the Weights and Measures Department of the Ministry of Finance, Economy and Trade.\nTelecommunication transmitters and receivers, long-distance telephone apparatus, printed matter, and audiovisual material are prohibited without prior authorization of the appropriate authorities.','None '),('US','RE',NULL,'http://pe.usps.com/text/imm/ps_011.htm','Coins; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. \nOtherwise, same as for France. ','Banknotes, currency notes, and securities payable to bearer may only be sent in First-Class Package International Service with Registered Mail service shipments.\nSame as for France. ','None '),('US','RO',NULL,'http://pe.usps.com/text/imm/ps_012.htm','Arms, ammunitions, and parts and accessories thereof, except that hunting guns or similar guns belonging to legal persons are admitted with agreement of the Romanian police department. \nCoins; bank notes; currency notes; or securities of any kind payable to bearer; traveler’s checks; platinum, gold, or silver (whether manufactured or not), precious stones; jewelry; or other valuable articles. \nExplosives, pyrotechnic products; matches, pyrophoric alloys, and combustible preparations. \nIndecent or obscene books, cards, photographs, manuscripts, typescripts, or other products of the printing industry. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. \nTobacco and manufactured tobacco substitutes. ','Many items are admitted conditionally subject to permits or certificates (such as veterinary health or phytosanitary certificates for products of animal or vegetable origin) issued by the Romanian legal authorities. \nPharmaceutical products are admitted only with the agreement of the Ministry of Health. \nVitamins require a permit issued by the Ministry of Health or Ministry of Agriculture. ','None'),('US','RS',NULL,'http://pe.usps.com/text/imm/ps_025.htm','Weapons and ammunition by private individuals.\nCigarette paper.\nCoins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold, and silver, manufactured or not; precious stones; jewelry; and other valuable articles except in insured Priority Mail International parcels. \nLottery tickets and advertisements concerning lotteries.\nRadioactive materials.\nYugoslav money.','Importation of medicine into Serbia is possible only through a legal entity that has permission to import medicine and medical equipment from the National Law of Medicines and Medical Equipment of the Republic of Serbia. Individuals may receive samples of medicine in compliance with that law. ','\nPostal items addressed to natural persons of Yugoslav or foreign nationality may contain personal travel articles, articles for personal use, and for the use of members of a family (medicines and medical instruments, teaching material, and leisure material), and articles for the use of their household in quantities not intended for resale. Such articles shall be imported against payment of Customs duty and other fees.  Items inherited abroad as well as articles provided for in contracts concluded between States may be freely imported in accordance with such contracts.  Items addressed to natural persons of Yugoslav or foreign nationality, the total equivalent value of which in dinars does not exceed 30 United States of America dollars (USD), are exempted from Customs duty; items the total equivalent value of which exceeds 30 United States dollars do not enjoy this privilege.  Natural persons of Yugoslav nationality exercising a profession are entitled to import articles serving to exercise that profession (equipment, reproduction material, and spare parts); importation will be subject to special conditions.  The sender is required to show clearly on the Customs declaration the special entitlement to import items containing articles imported under special conditions and regulations. Failing this, the addressee will be required to produce proof before delivery.  The value restriction does not apply to certain articles sent to persons who are entitled under special rules and conditions to import certain articles or to items containing articles inherited abroad.        \n'),('US','RU',NULL,'http://pe.usps.com/text/imm/ps_013.htm','Alcohol products and ethyl alcohol, beer.\nAmmunition, and parts thereof.\nCalls to extreme and terrorist activities or public justification of terrorism.\nCurrency of the Russian Federation; foreign currency.\nDocuments of current and personal correspondence and any correspondence exchanged by the persons not being the sender and recipient or a person residing therewith.\nElectric fishing systems and equipment consisting of electric signal generators with connected conductors and accumulators (batteries), employed together to fish biological aquatic resources using electric current.\nEquipment for fishing/catching the aqueous biological resources.\nExplosives; inflammatory substances, blasting devices, and firing agents.\nHazardous wastes.\nIndecent and immoral items.\nItems that by their nature or packaging may be hazardous for the postal personnel or ordinary population, or may soil or damage other mail units, postal equipment, or property of the third party.\nReady mesh fishing nets made from synthetic or other polyamide monothreads, with a thread diameter less than 0.5 mm and mesh size less than 100 mm (length of mesh at one side less than 50 mm).\nLive animals (see exception for bees, leeches, and silkworms in the Restrictions list).\nMaterials containing Nazi ideas or symbols, or ideas or symbols that might be confused with those of Nazi ideology.\nNarcotics, psychotropic substances, and precursors, including in drug form.\nOzone-depleting substances.\nPathogenic or potentially pathogenic organisms.\nPerishable items.\nPlant-protection products subject to the provisions of Annexes A and B to the Stockholm Convention on Persistent Organic Pollutants of May 22, 2001.\nPoisonous substances other than precursors of narcotics and psychotropic substances.\nPornographic materials.\nPrecious stones of any kind or natural diamonds, except for jewelry.\nPrinted books, newspapers, pictures, and other products of the printing industry, manuscripts, and miscellaneous documents containing information that could be detrimental to State security, social order, public morals, or property rights, including intellectual property and other interests of natural and legal persons.\nPrinted or audiovisual materials that are manufactured or distributed in violation of the legal requirements on elections and referenda in member countries of the Eurasian Economic Community Customs Union.\nPrinted or audiovisual materials if any of the following apply:\n\nThey are items that propagate extremist or terrorist activities or publicly justify terrorism. They are items of a pornographic nature. They are items intended to spread propaganda containing Nazi ideas or symbols, or ideas or symbols that might be confused with those of Nazi ideology. They are items containing information that could be prejudicial to the political and economic interests of Russia, to public safety, or to the health and morality of its citizens. \n\nTobacco products or smoking mixtures of any kind.\nWeapons of any kind, and parts thereof.','The following items may be sent only when used for personal use subject to appropriate permission from the Russian national controlling authority:\n\nCryptographic devices and equipment with the cryptographic function. Radioelectric devices and/or high-frequency civil devices, including built-ins or parts of other goods. Bees, leeches, and silkworms accompanied by a veterinary certificate. \n\nThe following items are prohibited when sent to or from the address of private individuals for needs that are not related to company activities:\n\nScrap and waste from ferrous and non-ferrous metals. Nonmanufactured precious metals, precious metal scrap and waste, ores and concentrated precious metal products, and primary products containing precious metals. Mineral substances (nonmanufactured natural stones). Information about the Earth’s interior. Technical devices designed for eavesdropping. Human organs and/or tissues, and blood and its components. Radioactive materials. Cultural artifacts. Plants of any kind and in any form, including seeds. \n','\nArticles or parts therefor imported for repair or replacement are exempt from customs duty if the sender’s written declaration is included in the postal item.  Articles prohibited as imports into Russia and falsely indicated or not indicated at all on the customs declaration are confiscated.  If prohibited articles are sent, one of the following measures is taken:  \n\n\nSeizure of the prohibited articles only, the rest delivered to the addressee.  Return of the item to the country of origin.  Seizure of the whole item.  \n\nInherited goods from abroad are admitted and are exempt from customs duties on the basis of certificates issued by consulates of the Russian Federation abroad on the basis of the law of inheritance and the composition of the legacy. \nIt is prohibited to import into Russia postal items from commercial companies intended for private individuals permanently resident in Russia with the exception of legacies as well as articles admitted for repairs or replacement. However, licensed parcels from private parcel companies that have entered into a contract with VO “Vnieshintorg” are admitted. All dispatch formalities must be complied with in accordance with the current regulations in the Russian Federation. \nAs of January 1, 2020, for a postal item arriving to a private individual, the total duty-free value limit and weight import limit are 200 EUR and 31 kg (68 pounds), respectively. If the postal item exceeds either limit, a customs duty fee applies as follows: the greater fee of either 15 percent of the amount exceeding 200 EUR, or at least 2 EUR per kg of the total weight of the postal item.\nItems not intended for the addressee’s personal use are understood to be items sent systematically in bulk even if they have different addresses and the regulation limit of the articles is complied with for each item separately. Such items are returned to the country of origin. '),('US','RW',NULL,'http://pe.usps.com/text/imm/ps_014.htm','Coins, banknotes, currency notes (paper money), traveler’s checks, and securities payable to bearer except in First-Class Package International Service with Registered Mail service shipments. \nPerishable infectious biological substances.\nPrecious metals.\nRadioactive materials.','Medicines are admitted provided the addressee has a permit issued by the Chief Pharmacist in Rwanda. ','None '),('US','SA',NULL,'http://pe.usps.com/text/imm/ps_023.htm','Arms, munitions, and war material.\nBooks and prints contrary to the Islamic faith.\nCoins, banknotes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances. \nRadioactive materials. ','Medicines, pharmaceutical, and plant-based products and foodstuffs for medical purposes are not admissible unless accompanied by prior authorization from the General Food and Medicine Authority of the Kingdom of Saudi Arabia. First-Class Mail International, First-Class Package International Service, postal parcels, registered items, and Priority Mail Express International shipments are all subject to that documentation requirement. \nRecorded tapes (cassettes) are not admitted in Registered Mail. Such items are admitted only in ordinary mail. ','\nFirst-Class Mail International and First-Class Package International Service items may not contain dutiable articles.  All items containing goods sent to Saudi Arabia are subject to a value-added tax (VAT) payable by the addressee at the rate of 5 percent of the item‘s total value.       \n'),('US','SB',NULL,'http://pe.usps.com/text/imm/ps_032.htm','No list furnished. ','Used clothing must be accompanied by a health certificate issued by the official health authorities. ','None '),('US','SC',NULL,'http://pe.usps.com/text/imm/ps_026.htm','Arms and weapons except under license. \nCoins; banknotes; currency notes (paper money); securities payable to bearer; traveler checks; platinum, gold, and silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nRadioactive materials. ','No list furnished. ','None '),('US','SD',NULL,'http://pe.usps.com/text/imm/ps_037.htm','Coffee products. \nCoins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver manufactured or not; precious stones; jewelry; and other valuable articles unless sent in insured Priority Mail International parcels. \nFish products—tinned or canned.\nLeather goods (handbags, sports goods (volleyballs, footballs, etc.)).\nMost foodstuffs and grains (sugar, flour, fruits, and oils). \nPaper and writing products (envelopes, ink, pencils, pens, erasers, chalk, etc.). \nRadios; tape recording machines and parts thereof. \nTextile, apparel, haberdashery, perfume, and cosmetics.\nTobacco products. ','No list furnished. ','\nImports into Sri Lanka are restricted not by name but by value and quantity. Any person is eligible to receive gifts other than sarees, suitings, textile, flowers, and flower plants subject to the following provisions:  \n Import does not involve any remittance abroad. Goods are imported bona-fide for personal use. Goods are not in a commercial quantity and not forresale. Import does not involve any abuse of importregulations. \nA license, to be obtained by the addressee in advance, is required for most goods imported by mail. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held.  No license/import permit is required for bona fide gift shipments (excluding saris, clothing or textiles) provided that the value of the shipment including postage and fees, does not exceed R 250 (rupees).        \n'),('US','SE',NULL,'http://pe.usps.com/text/imm/ps_040.htm','Arms and weapons.\nDaggers and flick knives.\nFiring caps and charged metal cartridges for small arms and artillery fuses. \nHuman remains. \nLive plants and animals. \nLottery tickets and advertisements concerning lotteries.\nRadioactive materials. ','Addressees in Sweden must obtain prior authorization from the Swedish national food administration to import foodstuffs of animal origin such as meat, sausage, fat, and soups. \nArticles of gold or silver must comply with Swedish regulations as to fitness. \nBanknotes and coins exceeding 100 Swedish crowns in value, and securities require prior authorization of the Bank of Sweden. \nLive bees must be sent direct to the Department of Bee Research of the University of Agricultural Sciences, Lantbruksuniversitetet, Forsoksavdelningen for bin, S-750 07 Uppsala, Sweden. \nPharmaceutical drugs are admitted only by authorized importers. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  As of March 1, 2018, in accordance with Sweden’s national legislation, addressees are required to declare and pay a value-added tax (VAT) on all items with a declared value imported into Sweden from outside the European Customs Union. PostNord Group AB requests that the mailer provide both the sender’s and addressee’s telephone number and email address, if available, on the customs form of each item sent with any of the following services: Registered Mail, First-Class Package International Service, Priority Mail International, or Priority Mail Express International. This contact information assists PostNord Group AB to expedite delivery.       \n'),('US','SG',NULL,'http://pe.usps.com/text/imm/ps_028.htm','Advertisements for charms, amulets and talismans. \nArms and firearms and parts thereof. \nBullion of a value higher than $50 Singapore dollars \nButane gas lighters and refills therefor. \nCoins except coins for purposes of ornament; banknotes; currency notes; traveler’s checks; securities payable to bearer; precious stones; jewelry; and other valuable articles. However, unmounted precious stones may be sent in First-Class Package International Service with Registered Mail service shipments if authorization is obtained from the Postmaster General of Singapore. \nLotteries and advertisements concerning lotteries. ','Meat or meat products including animal by-products require an import permit issued by Director of Primary Production, Singapore, and these articles must be addressed to the addressee care of the above Director. ','Many types of merchandise require import licenses that addressees must obtain from the authorities of Singapore. Senders should be assured before mailing that the addressees can obtain licenses if needed. '),('US','SH','GB','http://pe.usps.com/text/imm/ps_015.htm','No list furnished. ','No list furnished. ','None '),('US','SI',NULL,'http://pe.usps.com/text/imm/ps_031.htm','No list furnished. ','No list furnished. ','No list furnished. '),('US','SK',NULL,'http://pe.usps.com/text/imm/ps_030.htm','Chain letter items.\nPublications, drawings, photographs, records, sheets of music, etc., contrary to the State public order. \nPerishable infectious substances. \nPerishable noninfectious substances. \nPlaying cards.\nRadioactive materials. ','Coins; paper money; securities and other paper values of any kind; as well as savings-bank booklets; and unmanufactured gold, silver, and platinum may be imported only by authorization of the State Bank. \nGift shipments must be sent by private individuals. Those sent by commercial firms are not admitted. \nImport permits are required for gift shipments exceeding three per year for one addressee, or for any parcel exceeding 3,000 Slovak Republic crowns in value. Permits may be issued to addressees or withheld at the discretion of the customs authorities after the shipment arrives. \nMedicines are admitted provided the addressee is in possession of an import permit granted by the Slovak Republic health authorities. \nPhilatelic articles and stamps exchanged between member philatelists must not exceed 1,000 Slovak Republic crowns in any calendar year. Gift packages containing philatelic articles are restricted to 3 per year and the shipment cannot exceed a total of 100 stamps or philatelic articles and 100 Slovak Republic crowns in value. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  Import licenses and quantity restrictions are applicable for many articles sent to the Slovak Republic. Therefore, senders should ascertain from the addressee before mailing whether the contents are permitted and whether the necessary documents are held.  Gift shipments for the personal use of the addressee or the addressee’s family do not require an import permit if the contents do not exceed 5,000 Slovak Republic crowns. When the total exceeds 2,000 Slovak Republic crowns, the addressee must provide a gift certificate authenticated by an authorized agent in that country. Slovak Republic customs decides the value of the contents on the basis of internal prices of identical articles.  Articles imported in postal items are exempt from customs duties if their total value does not exceed 300 Slovak Republic crowns.        \n'),('US','SL',NULL,'http://pe.usps.com/text/imm/ps_027.htm','Banknotes, checks, and securities of any kind payable to bearer in ordinary and registered First-Class Mail International and First-Class Package International Service items. \nBrushes of all kinds made in Japan other than nylon toothbrushes. \nDistilling apparatus. \nPostage stamps, whether used or not, except in First-Class Package International Service with Registered Mail service shipments. \nWest African paper currency. ','Arms and munitions require a license from the Governor. \nCoins or precious metal sent in First-Class Package International Service with Registered Mail service shipments may not exceed L5 in value. ','None '),('US','SM',NULL,'http://pe.usps.com/text/imm/ps_021.htm','Albums of any kind (of photographs, postcards, postage stamps, etc.). \nArms and weapons. \nArticles of platinum or gold; jewelry; and other valuable articles unless sent as insured packages. \nArtificial flowers and fruits and accessories for them. \nBells and other musical instruments and parts thereof. \nCartridge caps; cartridges. \nClocks and supplies for clocks. \nCoins; banknotes; securities payable to bearer circulating abroad; and precious stones. However, Italian metal coins, banknotes and securities payable to bearer sent direct by foreign banks to Italian banks for exchange or replacement are permitted. \nCompound medicaments and medicines. \nCoral mounted in any way. \nEther and chloroform. \nExposed photographic and cinematographic films. \nFootwear of any kind. \nHaberdashery and sewn articles of any kind, including trimmings and lace; handkerchiefs; scarves; shawls, needlework including stockings and gloves; bonnets, caps, and hats of any kind. \nHair and articles made of hair. \nHuman remains. \nLeather goods. \nLighters and their parts, including lighter flints. \nLive plants and animals. \nNutmeg, vanilla; sea salt, rock salt; saffron. \nPerfumery goods of all kinds (except soap). \nPlaying cards of any kind. \nPostage stamps in sealed or unsealed First-Class Mail International or First-Class Package International Service shipments. \nRadioactive materials. \nRibbons for typewriters. \nRoasted or ground coffee and it substitutes; roasted chicory. \nSaccharine and all products containing saccharine. \nSalted, smoked or otherwise prepared meats; fats; and lard. \nTobacco. \nToys not made wholly of wood. \nTreated skins and furs. \nWeapons of any kind and spare parts for them. ','Postage stamps for philatelic purposes are admitted in First-Class Package International Service with Registered Mail service shipments on condition that the package bears a completed PS Form 2976 and the addressee complies with the Italian financial regulations. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.  First-Class Mail International and First-Class Package International Service shipments may not contain dutiable articles.  Shipments containing books must bear a PS Form 2976.  Many articles are subject to an import license or quantity restrictions. Senders should ascertain from the addressee before mailing whether the articles will be admitted or whether the necessary documents, if required, are held.        \n'),('US','SN',NULL,'http://pe.usps.com/text/imm/ps_024.htm','Articles with markings, labels, or wrappings indicating falsely that they are of French origin. Articles using the “Red Cross” or “Geneva Cross” as a trademark. \nCoins; banknotes; currency notes; securities of any kind payable to bearer; traveler’s checks; platinum, gold, or silver (manufactured or not); precious stones, jewelry; and other valuables. \nWeights and measures not of the metric system. ','The following articles are subject to special regulations on importation: firearms and airguns; distilling apparatus; saccharine and artificial flavors for beverages and confectionery; phonograph records; Arabic books and prints; and medicines. ','First-Class Package International Service items containing dutiable articles must be sent with Registered Mail service.'),('US','SR',NULL,'http://pe.usps.com/text/imm/ps_038.htm','Arms and their spare parts. \nCoins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nLiquids, easily liquefiable items, and glass or similarly fragile articles.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nPlaying cards.\nRadioactive materials.\nSeditious literature.\nUnginned cotton.','Banknotes greater than 2 Sudanese pounds in value are admitted ONLY in First-Class Package International Service with Registered Mail service shipments. ','Used clothing must be accompanied by a health certificate issued by the official health authorities. '),('US','ST',NULL,'http://pe.usps.com/text/imm/ps_022.htm','No list furnished. ','No list furnished. ','None '),('US','SV',NULL,'http://pe.usps.com/text/imm/ce_027.htm','Coins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewelry; and other valuable articles. \nGambling equipment.\nPerishable infectious biological substances.\nRadioactive materials.\nUnstamped cigarette paper.','Cigarettes must have the words “Importacion a El Salvador” printed or stamped on each package. ','\nFirst-Class Mail International and First-Class Package International Service items may not contain dutiable articles.  Commercial invoices are required for all commercial shipments regardless of value and for gift parcels valued at $50 or more. No invoices are required for gift shipments valued at less than $50.  For all shipments valued at $50 or more, the sender should submit to a Salvadoran consulate copies of the commercial invoice in the form prescribed by the Salvadoran regulations. The consulate returns 2 legalized copies to the sender, who should mail them to the addressee direct, not enclosed in the parcel.  For commercial shipments valued at less than $50, 3 copies of the invoice (which need not be legalized) should be mailed directly to the addressee.  Certificates of origin are required only if exemption from or modification of customs duty is claimed under a trade agreement.  Salvadoran consuls are located in principal cities of the United States. Correos de El Salvador requests that the mailer place the addressee’s landline or mobile telephone number on the customs form for each trackable item (i.e., an item sent with Registered Mail service, Priority Mail Express International service, or Priority Mail International service). This contact information assists Correos de El Salvador in calling or sending a text message to the addressee when the item has arrived.       \n'),('US','SX',NULL,'http://pe.usps.com/text/imm/ps_029.htm','Coins; banknotes; currency; securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles, unless they are sent in First-Class Package International Service with Registered Mail service. \nCopper, bronze, or nickel coins.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','Importation of arms requires special permission. ','None '),('US','SZ',NULL,'http://pe.usps.com/text/imm/ps_039.htm','Coins; banknotes; currency notes (paper money); traveler’s checks; platinum, gold, or silver (manufactured or not); precious stones; jewelry; and other valuable articles, unless sent in insured Priority Mail International parcels. \nRadioactive materials. ','No list furnished. ','None '),('US','TC','GB','http://pe.usps.com/text/imm/tz_013.htm','Coins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. ','The importation of firearms requires a permit. ','None '),('US','TD',NULL,'http://pe.usps.com/text/imm/ce_007.htm','Arms and ammunition. \nCoins; banknotes; currency notes; securities payable to bearer; traveler’s checks; manufactured and unmanufactured platinum, gold, and silver; precious stones; jewelry; and other valuable articles. \nPamphlets and leaflets containing propaganda derogatory to the countries of Equatorial Africa. \nPerishable infectious biological substances \nPreserved fish, vegetables and plums not bearing in large type the mark of origin or contained in tins weighing more than 1 kg. ','Medical or pharmaceutical products, may only be addressed to licensed pharmacists. \nTobacco products are subject to import duties and taxes. The immediate container (box, case, cigarette package) must be marked “Vente en U.D.E.” (Sale in Equatorial Customs Union) below the trademark. ','Postal authorities of Chad collect domestic postage from addressees for inbound shipments.'),('US','TG',NULL,'http://pe.usps.com/text/imm/tz_006.htm','Arms, munitions, and war material.\nArticles or advertisements relating to lotteries.\nBanknotes, currency notes, securities payable to bearer, and traveler’s checks may only be sent in First-Class Package International Service with Registered Mail service shipments. \nCoins; platinum, gold, or silver (manufactured or not); precious stones, jewelry; and other valuable articles. \nForeign silver coins. \nPoniards, sword-canes, loaded canes, brass knuckles, blackjacks, and all other arms for offense. \nSaccharine and similar products. \nWeights and measures other than those of the decimal metric system. ','Hunting arms require prior authorization. \nMedical thermometers must bear the stamp of the Laboratory of Arts and Crafts. ','None '),('US','TH',NULL,'http://pe.usps.com/text/imm/tz_004.htm','Coins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nFiring caps and charged metal cartridges for small arms and non-explosive parts of artillery fuses. \nLithium cells and batteries — including items containing properly installed lithium cells and batteries under IMM 135.6 — mailed to or sent via Thailand.\nPlaying cards.','Firearms, air guns, and their accessories, require special authorization from the Government; however, toy air guns for children as well as firearms and air guns kept exclusively as curios may be imported without permit. ','Mail can be addressed directly to refugee camps. '),('US','TJ',NULL,'http://pe.usps.com/text/imm/tz_002.htm','Coins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, or silver (manufactured or not); precious stones, jewelry; and other valuable articles. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','None furnished. ','None'),('US','TL',NULL,'http://pe.usps.com/text/imm/tz_005.htm','No list furnished.','No list furnished.','None'),('US','TM',NULL,'http://pe.usps.com/text/imm/tz_012.htm','All foodstuffs if the time left until the “use-by” date is less than 70% (calculated from the date of manufacture). \nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles are prohibited in all classes of mail, including Priority Mail Express International shipments, that are mailed to Turkmenistan. \nFoodstuffs that are manufactured using genetically modified organisms (GMOs). \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nProducts or alcoholic beverages that contain more than 18% ethyl alcohol (finished products, polystyrene, “Tetrapak” packaging). \nRadioactive materials. \nFirearms and ammunition, explosives, combat weapons. \nPrinted materials, plates, negatives, developed films, photographs, movies, video recordings, magnetic computer information storage media, manuscripts, records and other sound recordings, drawings and other printed materials, and forms of plastic art politically or economically damaging to Turkmenistan. \nPornographic, vulgar, and erotic materials. \nSoviet and foreign currency, government securities and Soviet lottery tickets, Soviet Vnieshposyltorg and Vniesheconombanque checks. \nEurocheck system forms and access cards. \nUndeveloped movies and photographic films, photographic plates and paper. \nEggs, honey, pollen, wax, honeycomb. \nHigh-frequency radio-electronic devices (transmitters and receivers) regardless of strength, high frequency ultrasound equipment, and generators for industrial, scientific, and medical use, and location detection devices used to measure transportation speed. \nCopying/reproduction equipment (with the exception of typewriters).','Hunting weapons require prior authority of the Ministry of the Interior. \nSeeds, plants, root tubers, bulbs and other plant parts, fruits, legumes, and fresh vegetables are admitted as authorized by the State Quarantine Inspectorate Agroindustrial Committee. Seeds and plants must be accompanied by plant health certificates and import/export permits. \nMedicines and vitamins are admitted as authorized by the Bureau for Registration of Medicines and Pharmaceuticals. \nCanceled or uncanceled postage stamps are admitted within the framework of organized philatelic exchanges. \nThe following articles may be mailed provided the specific quantity is observed and the articles are for the personal use of the addressee: \n\n\n\nDescription of Articles  \nUnit of Measurement  \nMaximum Quantity Allowed  \n\n \nClothing (coats, overcoats, jackets)  \n \npiece/pair  \n3 of each   \n\n \nFabric  \n \nmeter  \n10  \n\n \nStandard electronic radio and video equipment, spare parts, and accessories  \n \npiece  \n1 of each  \n\n \nCameras, VCRs and movie cameras, lenses, spare parts and accessories  \n \npiece   \n1 of each   \n\n \nElectronic music equipment and electronic musical instruments (keyboards, synthesizers, etc.), accessories and spare parts  \n \npiece  \n 1 of each   \n\n \nAll types of sound recording devices (cassettes, reels, laser disks)  \n \n piece  \n10   \n\n \nAll types of video recording devices (cassettes, reels, disks, etc.)  \n \npiece   \n   \n\n \nPersonal computers and peripheral equipment  \n \nset  \n1  \n\n \nPersonal computer information storage media. Information storage media with prerecorded information are admissible only with information from the sender on the type of microcomputer and operating system used to record the information in question  \n \npiece  \n total of 15   \n\n \nPhonograph records \n \npiece/set  \n15/2   \n\n\nDescription of Articles\nUnit of Measurement\nMaximum Quantity Allowed\npiece/pair\n3 of each \nmeter\n10\npiece\n1 of each\npiece \n1 of each \npiece\n 1 of each \n piece\n10 \npiece \nset\n1\npiece\n total of 15 \npiece/set\n15/2 \nExcept for articles whose import is expressly prohibited, items not subject to the above limits will be admitted, without restrictions, provided that they are for the personal use of the addressee. ','\nFirst-Class Mail International and First-Class Package International Service items must not contain any articles other than written personal messages, documents, receipts, invoices, statements, and personal photographs.  Postal items containing admitted articles in the quantities specified are delivered to the addressee upon payment of customs duty. No duty is collected when the aggregate value of the contents does not exceed the equivalent of a retail price of 30 Russian roubles.  If prohibited articles are sent in postal items, one of the following three procedures is followed:  \nConfiscation of the entire item. Confiscation of the prohibited articles, the rest of the contents delivered to the addressee. Return of the item to the country of origin.  \nReturn Receipts (Advice of Delivery) are initialed or signed by a postal official to indicate delivery. The addressee will not sign the receipt.  All customs declaration forms must list the contents in English and include an interline translation in French, Russian, or a language used in the country. If additional space is necessary to list the contents, a second customs form should be used and the original form annotated to that effect.  Books, newspapers, magazines, and other printed materials are admitted without restriction with the exception of printed materials that are referred to above under Prohibitions.  Commercial shipments must be accompanied by the necessary invoices and permits.        \n'),('US','TN',NULL,'http://pe.usps.com/text/imm/tz_010.htm','Arms of all kinds. \nAspirin, sulfa drugs, and vitamin compounds; chalk; pencils; soap; and detergents containing it; leather and articles of artificial leather; carpets, tapestries, and bed coverings; footwear of rubber or plastic; hosiery of cotton or synthetic fibers, except women’s stockings; jewelry made of precious metal or plated with it; household articles of galvanized iron, galvanized steel or aluminum; and nonelectric cooking and heating appliances for household use. \nCoins; currency notes (paper money); traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nCopper coins and obsolete silver coins. \nLottery tickets and advertisements relating to lotteries. \nNursing bottles, nipples, and pacifiers that are not made of pure rubber and marked accordingly, and vulcanized by heat. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPlaying cards. \nRadioactive materials. \nSaccharine and similar products, except in very small amounts imported as remedies by pharmacies or physicians. ','Banknotes require a permit issued by the Tunisian exchange authorities unless imported by a bank. \nHunting and commercial arms may be imported with authorization of the Director of Public Safety. \nManufactured tobaccos, cigars, and cigarettes for personal use of the importer may be admitted up to 10 kilograms per year, subject to authorization of the Tunisian revenue authorities. ','None'),('US','TO',NULL,'http://pe.usps.com/text/imm/tz_007.htm','Firing caps and cartridges for small arms, components of non-explosive artillery fuses. \nPerishable infectious biological substances. \nTobacco, cigars, cigarettes, and snuff packages over 11 lbs. or packed with other goods. ','No list furnished. ','None '),('US','TR',NULL,'http://pe.usps.com/text/imm/tz_011.htm','Arms and munitions of war and their accessories. \nCoins; banknotes; traveler’s checks; securities payable to bearer; platinum, gold or silver, manufactured or not; precious stones; jewelry; and other valuable articles except in insured Priority Mail International service. Currency notes (paper money) are permitted in insured Priority Mail International or with Registered Mail service.\nCosmetic products.\nFish items, canned animal products, cured spiced beef and sausage, edible fresh and dried fruits and vegetables, and other animal and vegetable products.\nLiquids of any type.\nLottery tickets and advertisements relating to lotteries.\nNarcotic substances of all kinds and products containing bonsai (JWH-018) as defined in the “World Drug Report 2011” from the United Nations Office on Drugs and Crime.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nPlaying cards, other than children’s games.\nSilver coins and all foreign coins (except gold coins and ancient coins for collections). \nTea.','Clinical thermometers must be accompanied by an official certificate of inspection. \nFood supplements and foods for athletes may be sent to Turkey only when a medical report, prescription, or national sportsperson‘s certificate is enclosed with the item by the addressee.\nMailable tobacco and tobacco products may not be declared as a “gift” on customs declarations, irrespective of whether they are subject to or exempt from Turkish customs duties.\nMobile phones may not be declared as a “gift” on customs declarations, irrespective of whether they are subject to or exempt from Turkish customs duties.\nStocks, bonds, and coupons, unless addressed to the Central Bank of the Turkish Republic, require the authorization from the Turkish exchange control authorities. \nThe following may be imported only by the Monopoly Administration: The permission of the Turkish authorities is required for the importation of pharmaceutical specialties, except small quantities for medical or veterinary use or samples by physicians. \nThe value of gift shipments must not exceed 500 DM. \nTurkish money, as well as checks and drafts expressed in Turkish money, require authorization from the ministry of Finance. If imported without advance permission, such remittances are liable to confiscation. \nUsed bedding, linens, clothing, carpets, empty sacks, etc., must be accompanied by a certificate of disinfection. ','\nThe value and net weight of each kind of article or goods must be shown on the customs declarations, also the country of origin of the merchandise.  Each commercial shipment for Turkey must have enclosed a combined certificate of origin and consular invoice, which must be certified by a chamber of commerce or other trade organization or by a notary public, and be legalized by a Turkish consul.  Each commercial shipment of printed matter, such as books, newspapers, or magazines, must likewise be accompanied by an invoice and, except in the case of daily newspapers, by a certificate of origin also.  Import license must be obtained for many types of merchandise, and others are subject to import quotas.  The customs duty exemption limit for the value of postal items containing books or other printed publications for personal use is 150 EUR; the general customs duty rate of 20 percent applies to all other goods.       \n'),('US','TT',NULL,'http://pe.usps.com/text/imm/tz_008.htm','Charged metal caps and cartridges for portable firearms and non-explosive parts of artillery shells. \nCoins exceeding L5 in value, except old coins intended as ornaments. \nFirearms, switchblade knives, and sword-canes. \nHoney. \nLottery tickets or articles relating to lotteries. \nPerishable infectious biological substances. \nRadioactive materials. ','Arms not prohibited, require the permission of the Trinidad police authorities. \nSaccharine requires the permission of the Trinidad health authorities. ','None '),('US','TV',NULL,'http://pe.usps.com/text/imm/tz_014.htm','Radioactive materials. ','No list furnished. ','None'),('US','TW',NULL,'http://pe.usps.com/text/imm/tz_001.htm','Banknotes in “new Taiwan dollars.”\nCigars, cigarettes, and prepared tobacco.\nCoins over one hundred years old.\nExtracts, essences, and concentrates of tea.\nRadioactive materials.\nSugar, molasses, saccharine, and other sweetening substances. ','Addressees must obtain import licenses for all items except (1) gifts not exceeding $1000 in value for personal or family use, and (2) printed books not exceeding $1000. ','\nFirst-Class Package International Service items containing dutiable articles must be sent with Registered Mail service.  Addresses must be complete and written when possible in Chinese characters in addition to English.  The Chinese postal authorities recommend the addition of Via Taiwan in the address of articles intended for the Quemoy and Matsu Islands.        \n'),('US','TZ',NULL,'http://pe.usps.com/text/imm/tz_003.htm','Coins; banknotes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nFirearms and ammunition of all types except under license.\nJapanese shaving brushes.\nLottery tickets and advertisements concerning lotteries.\nPerishable infectious biological substances.\nRadioactive materials.','Coins must not exceed 100 shillings in value and must be sent in First-Class Package International Service with Registered Mail service shipments. ','\nMany types of merchandise intended for resale require authorization to import from the Ministry of Commerce and Cooperatives at Dar es Salaam.  Mailers should be assured that the addressees have such a permit or can obtain one if needed.        \n'),('US','UA',NULL,'http://pe.usps.com/text/imm/tz_016.htm','Agricultural products. \nArticles of cultural value (works of art, collectors’ pieces, and antiques). \nCoins; banknotes; currency; securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles are prohibited. \nMedicines and medicinal products. \nPassports and personal identity cards are prohibited entry in all classes of mail, including Priority Mail Express International shipments. \nPrescription narcotics and psychotropic drugs which have potentially addictive or hallucinogenic effects.\nSoftware and technical devices that have been specially developed, manufactured, programmed, or adjusted to intercept secret information and that are addressed to persons or entities other than the Ukrainian government.\nTobacco products and manufactured tobacco substitutes. ','\nIn order to be admissible, the food items listed below must (a) be packed by the manufacturer; (b) conform to Ukraine’s sanitary standards; (c) be accompanied by a certificate of conformity which has been issued by the Ukrainian State Committee for Standardization and Measures or by a comparable regulatory authority in the country of origin; (d) be addressed to an individual who is a resident of Ukraine; (e) be shipped in quantities not to exceed 2 kilograms (4 pounds) when enclosed in a First-Class Package International Service shipment; or (f) be shipped in quantities not to exceed 10 kilograms (22 pounds) when enclosed in a Priority Mail International parcel or a Priority Mail Express International item:  Meats, fish, shell fish, milk and dairy products, birds’ eggs, natural honey, fruits and nuts, coffee, tea, spices, vegetables, grains, cereals, flour, fats and oils, animal and vegetable by-products, sugar, cocoa, dietary supplements, foods for special dietary consumptions, functional foods, and other processed foodstuffs.  Radios and mobile telephones for personal use may be sent to Ukraine, provided that the addressee has obtained prior authorization from the Ukrainian State Center of Radio Frequencies and Telecommunications Supervision. The Center is responsible for assigning radio frequencies and registering official authorization for the design, manufacture, and use of radio-electronic equipment. Customers who require additional information about the mailing of radio-electronic equipment to Ukraine should send their inquiries directly to the Center’s headquarters in Kiev. The applicable fax number is 011-38-044-450-2765.  Prescription medicines for personal use may be sent to Ukraine in quantities that are necessary for a complete course of treatment, provided that the addressee has obtained prior authorization from the Ukrainian Ministry of Health.  Funeral urns admitted for import are authorized only upon presentation of the following documentation to Customs authorities: A death certificate or any other document confirming death, issued by a competent body; or a certificate declaring that the urn does not contain other articles that may not be imported into Ukraine.  Used goods (e.g., clothes, footwear) that are unclean or that are not accompanied by supporting documents certifying that they have been fumigated cannot be sent via Priority Mail Express International service. Goods that fall into categories 1 through 24 (i.e., “animal and animal products,” “vegetable products,” and “foodstuffs”) of the Harmonized Systems Codes (HS Codes) cannot be sent via Priority Mail Express International service, except for foodstuffs weighing less than 10 kilograms (22 pounds) in total and packed in their original packaging. \n\nMeats, fish, shell fish, milk and dairy products, birds’ eggs, natural honey, fruits and nuts, coffee, tea, spices, vegetables, grains, cereals, flour, fats and oils, animal and vegetable by-products, sugar, cocoa, dietary supplements, foods for special dietary consumptions, functional foods, and other processed foodstuffs. \nRadios and mobile telephones for personal use may be sent to Ukraine, provided that the addressee has obtained prior authorization from the Ukrainian State Center of Radio Frequencies and Telecommunications Supervision. The Center is responsible for assigning radio frequencies and registering official authorization for the design, manufacture, and use of radio-electronic equipment. Customers who require additional information about the mailing of radio-electronic equipment to Ukraine should send their inquiries directly to the Center’s headquarters in Kiev. The applicable fax number is 011-38-044-450-2765. \nPrescription medicines for personal use may be sent to Ukraine in quantities that are necessary for a complete course of treatment, provided that the addressee has obtained prior authorization from the Ukrainian Ministry of Health. \nFuneral urns admitted for import are authorized only upon presentation of the following documentation to Customs authorities: A death certificate or any other document confirming death, issued by a competent body; or a certificate declaring that the urn does not contain other articles that may not be imported into Ukraine. \nUsed goods (e.g., clothes, footwear) that are unclean or that are not accompanied by supporting documents certifying that they have been fumigated cannot be sent via Priority Mail Express International service.\nGoods that fall into categories 1 through 24 (i.e., “animal and animal products,” “vegetable products,” and “foodstuffs”) of the Harmonized Systems Codes (HS Codes) cannot be sent via Priority Mail Express International service, except for foodstuffs weighing less than 10 kilograms (22 pounds) in total and packed in their original packaging.','\nGoods that are mailed in one dispatch from one sender to a private individual and that have a value of 100 EUR or less are not subject to customs charges. For legal entities or individual entrepreneurs, the tax-free limit is 150 EUR for goods sent from one sender to one addressee in one dispatch. Shipments that exceed these limits are subject to a 10-percent import duty and a 20-percent value-added tax. On each item with Registered Mail service and on the customs form on each parcel sent to Ukraine, display the addressee’s mobile telephone number. Ukrposhta provides an SMS notification regarding the arrival of these items.       \n'),('US','UG',NULL,'http://pe.usps.com/text/imm/tz_015.htm','Firearms and ammunition except under permit.\nJapanese shaving brushes.\nLottery tickets and advertisements concerning lotteries.\nRadioactive materials.\nSwitchblade knives.','Coins; banknotes; currency notes (paper money); securities payable to bearer; traveler checks; platinum, gold, or silver, manufactured or not; precious stones; jewelry; and other valuable articles may only be sent in First-Class Package International Service with Registered Mail service shipments. \nUsed clothing, bedding, and similar articles for sale must be accompanied by a certificate of disinfection. ','\nMany types of merchandise require authorization to import, which the addressee must obtain from the Ministry of Commerce and Industry at Kampala.  Mailers should be assured that the addressees have such permits or can obtain them if needed.  On every item, include both the addressee’s and sender’s telephone number and email address, if available. This contact information assists Uganda Post Limited to expedite delivery.       \n'),('US','US',NULL,NULL,NULL,NULL,NULL),('US','UY',NULL,'http://pe.usps.com/text/imm/tz_019.htm','Coins; banknotes; currency notes (paper money); securities payable to bearer; precious stones; jewelry; and other valuable articles. However, old coins intended for collections are admitted up to the maximum of 10 per package.\nEyeglasses, including lenses and frames.\nFirearms.\nLottery tickets. \nMedicines or medical products (including vitamins, homeopathic medicines, nail polish, cosmetics, creams, and perfumes) unless authorized under the applicable legislation.\nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Plants or parts of plants must be accompanied by a health certificate. ','\nCertificate of origins and detailed invoices are required for commercial shipments.  Applicable customs regulations on articles received in Uruguay are as follows:  \nUp to $10 U.S., exemption.  Up to $50 U.S., exemption when it can be proved that item is a gift, sent by a member of the family or containing clothes for personal use.  Up to $100 U.S., exemption for the portion between 0-50, while the portion between 51-100 is subject to customs duty on importation.  Over $100 U.S.: the intervention of a customs representative is obligatory.  \nGoods sent via Priority Mail Express International service must include the original receipt of purchase together with documentation indicating the amount of the postage and insurance paid. Generally, goods sent via Priority Mail Express International service with a weight not over 20 kilograms (44 pounds) and a value not over $200 are exempt from customs duty and value-added taxes to the same person (for no-commercial use) up to five times a year. This limit does not apply to medicines for personal use for which authorization has been obtained from a competent authority.    \n'),('US','UZ',NULL,'http://pe.usps.com/text/imm/tz_020.htm','Coins, bank notes in circulation, checks, postage stamps, currency, securities of any kind payable to bearer, or foreign currency. Uzbekistan will not accept liability in cases of loss or damage to such items if they are accepted.\nFirearms and essential firearm components, flare guns, pneumatic weapons, gas weapons, munitions, bladed weapons, electroshock weapons, and stun guns.\nNarcotics, as well as psychotropic items.\nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nPress publications, manuscripts, cliches, drawings, films, negatives, cinematographic films, video recordings, audio recordings, gramophone records that are designed to undermine the State and social system and to violate the territorial integrity, the political independence and the foundations of the State, advocating war, terrorism, violence, nationalism and religious hate, fascism in all its forms, and materials with pornographic content. \nRadioactive materials. \nThe government of Uzbekistan has instituted a temporary prohibition against mailing meats and meat products, milk and dairy products, and seeds to Uzbekistan. ','Cinematographic films, video recordings, and audio recordings may be imported with the authorization of the Ministry of Culture. \nMany items are admitted as imports under licenses issued by the Ministry of Foreign and Economic Affairs in Uzbekistan. \nSeeds and other agricultural products are permitted only under authorization issued by the Head of Quarantine Inspection in Uzbekistan. ','The duty-free import limit is 100 USD. Customs duties apply to the amount exceeding 100 USD.'),('US','VA',NULL,'http://pe.usps.com/text/imm/tz_022.htm','Arms and weapons.\nHuman remains.\nLive plants and animals.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.\nSame as Italy.','No list furnished. ','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box.  For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration.        \n'),('US','VC',NULL,'http://pe.usps.com/text/imm/ps_019.htm','Arms and ammunition except under license.\nCurrency.\nRadioactive materials.','No list furnished. ','None '),('US','VE',NULL,'http://pe.usps.com/text/imm/tz_023.htm','Cigarette papers. \nCoffee, coffee extracts, and similar preparations containing coffee. \nCoins; banknotes; currency notes (paper money); traveler’s checks; securities payable to bearer; postage stamps; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nCredit cards and debit cards.\nLottery and similar tickets.\nNatural and cultivated pearls.\nPension checks.\nPerishable infectious biological substances.\nPerishable noninfectious biological substances.\nRadioactive materials.','Pharmaceutical specialties/products must be authorized by the Minister of Health, Agriculture and Boviculture of Venezuela. \nPrior authorization of the Venezuelan authorities is required for most foodstuffs, plants and plant parts, and most merchandise. \nPriority Mail Express International, First-Class Mail International, and First-Class Package International Service items may not contain dutiable articles (merchandise).','\nImport licenses/permits are required for most goods. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held.  Items containing printed matter must have affixed to the wrapper PS Form 2976.  Customs duty is generally assessed on printed matter.        \n'),('US','VG','GB','http://pe.usps.com/text/imm/ab_030.htm','Currency is not admitted in registered items.\nRadioactive materials.','None','\n\nThe U.S. Virgin Islands are a United States overseas possession comprised of the islands of Saint Thomas, Saint Croix, and Saint John. Mailpieces destined for any of those islands are subject to domestic postage rates, mail classification definitions, preparation requirements, weight and size limits, ZIP Code specifications, markings and endorsements, and other mailing conditions that are referenced in Mailing Standards of the United States Postal Service, Domestic Mail Manual (DMM).  \nThe British Virgin Islands are a foreign destination comprised of the islands of Anegada, Tortola, Jost Van Dyke, Peter Island, and Virgin Gorda. Mailpieces destined for any of those islands are subject to international postage rates, mail classification definitions, preparation requirements, weight and size limits, addressing standards, customs form requirements, and other country specific conditions for mailing that are referenced in the International Mail Manual (IMM).       \n'),('US','VN',NULL,'http://pe.usps.com/text/imm/tz_024.htm','Arms of all kinds, electric stun guns, knives, munitions, war material, and accessories. \nCigarettes and cigars. \nCoins; banknotes; currency notes; securities payable to bearer; platinum, gold, or silver (manufactured or not); precious stones; jewelry; and other valuable articles. \nCosmetics, with the exception of Harmonized Systems (HS) Code 3600 (oral and hygiene dental products in individual packaging) and HS Code 3700 (preshave, shaving, or aftershave preparations).\nInvisible ink, codes, cyphers, symbols or other types of secret correspondence, and shorthand notes. \nMobile (cellular) telephones.\nNarcotics, psychotropic substances.\nPerishable infectious biological substances. \nProducts made from non-Vietnamese tobacco. \nRadio transmitters and receivers and radio set accessories of any kind. \nRadioactive materials. \nSealed tinned foodstuffs. \nUnused postage stamps. \nUsed clothing, blankets, mosquito nets, and shoes. ','Any kind of merchandise of commercial value sent for trade must have the authorization of the Ministry of External Trade of the Socialist Republic of Vietnam. \nCurrency, postage stamps for sale or exchange, checks, and securities and other financial instruments must be licensed by the U.S. Treasury Department. \nPaintings, pictures, books, newspapers, cinema films, photographic films, records, miscellaneous articles for the stage, all other literary and artistic productions, objects of art and of sculpture, all kinds of children’s toys must have the authorization of the Ministry of Culture of the Socialist Republic of Vietnam. \nThe following quantity limits are imposed by Vietnam on the indicated items: \n\n\n\nCommodity  \nQuantity Limit   \n\n\nCoffee Tea Paddy Rice Beans (all kinds) Dried Manioc Dried sweet potatoes Groundnuts Cooked fat Dried meat Salted meat Dried fish Dried cuttlefish   \n200 g 500 g 1000 g 1000 g 1000 g 1000 g 1000 g 1000 g 1000 g 1000 g 1000 g 1000 g 1000 g  \n\n\nCommodity\nQuantity Limit \nCoffee\nTea\nPaddy\nRice\nBeans (all kinds)\nDried Manioc\nDried sweet potatoes\nGroundnuts\nCooked fat\nDried meat\nSalted meat\nDried fish\nDried cuttlefish \n200 g\n500 g\n1000 g\n1000 g\n1000 g\n1000 g\n1000 g\n1000 g\n1000 g\n1000 g\n1000 g\n1000 g\n1000 g','Gift shipments containing merchandise valued at under $200 may be mailed without a validated export license. Mark address side of shipment “GIFT—EXPORT LICENSE NOT REQUIRED.” '),('US','VU',NULL,'http://pe.usps.com/text/imm/tz_021.htm','Perishable infectious biological substances. \nRadioactive materials. ','No list furnished. ','None '),('US','WF',NULL,'http://pe.usps.com/text/imm/tz_025.htm','Perishable infectious biological substances.\nRadioactive materials.\nTobacco leaves or manufactured tobacco.\nWeights and measures not of the decimal system.','Restrictions apply to the importation of flowers, fruit plants, products of animal origin, records, and sound recordings. ','\nImport permits and import certificates are required for some types of goods. Therefore, senders should ascertain before mailing whether the necessary documents are held.  Import permits are not required for items valued less than 5,000 CFP francs per item.        \n'),('US','WS',NULL,'http://pe.usps.com/text/imm/ps_020.htm','Same as for New Zealand. ','No list furnished. ','None '),('US','XK',NULL,'http://pe.usps.com/text/imm/il_017.htm','Weapons and ammunition by private individuals.\nCigarette paper.\nCoins; banknotes; currency notes (paper money); securities payable to bearer; traveler’s checks; platinum, gold, and silver, manufactured or not; precious stones; jewelry; and other valuable articles. \nLottery tickets and advertisements concerning lotteries.\nRadioactive materials.','No list furnished. ','Certain shipments may require a license by the U.S. Commerce Department under the Export Administration Regulations (see 530).'),('US','YE',NULL,'http://pe.usps.com/text/imm/tz_026.htm','Circulars concerning lotteries.\nCoin or bullion exceeding L5 in value.\nFiring caps and loaded metal cartridges for portable firearms, non-explosive parts of artillery fuses. \nPerishable infectious biological substances. \nPerishable noninfectious biological substances. \nRadioactive materials. ','Arms and military supplies may only be imported by or on behalf of the Government of Aden. \nCoins, banknotes, currency notes, securities payable to bearer, and traveler’s checks may only be sent in First-Class Package International Service with Registered Mail service shipments. \nGift shipments containing items for personal use are restricted to one shipment per month per addressee, on condition that the value of the contents does not exceed $85. ','Mail may be addressed by the short form of the country name Yemen (Aden). '),('US','YT','FR','http://pe.usps.com/text/imm/fh_005.htm','Arms, ammunition.\nBanknotes, coins that are current and legal tender in France, and precious metals.\nCigarette lighters using butane gas.\nFeeding bottles.\nFuneral urns.\nGoods bearing false marks of French manufacture or origin.\nHuman remains.\nImitation pearls containing lead salts and any articles of jewelry made with pearls of this type.\nLive plants and animals.\nMeasuring instruments marked in units not complying with French law.\nPerishable infectious biological substances except as noted in Restrictions below.\nPerishable noninfectious biological substances except as noted under Restrictions below.\nRadioactive materials.\nSaccharine in tablets or packets.','Bees, honey, and beeswax must be accompanied by a certificate of origin and noninfection issued by a qualified official approved by the Government. Shipments of honey not exceeding 2 kilograms do not require the certificate.\nBooks in the French language printed abroad must have the names of the publisher and printer shown as prescribed by the French copyright laws.\nCanned vegetables, fish, plums, and nuts not bearing an indication of the country of origin by stamping, in plain raised or sunken letters at least 4 millimeters high, in the middle of the top or bottom and in a place not bearing any inscription.\nGold coins or other articles of gold require that the addressee have a permit issued by the Bank of France (not required for gold-plated articles or for ornaments or jewelry containing only small amounts of gold and weighing 500 grams or less).\nMedicines and medicinal products require an import license issued by the Central Pharmaceutical Service of the Ministry of Health.\nPerishable biological substances, infectious and noninfectious, are admitted when addressed to the following laboratories:\n\nPasteur Institute  25 rue du docteur Roux  75724 Paris CEDEX 14  FRANCE Pasteur Institute  1 rue du Professeur Calmette  59019 Lille CEDEX BB 245  FRANCE Pasteur Institute  77 rue Pasteur  69365 Lyon CEDEX  FRANCE \n\n25 rue du docteur Roux \n75724 Paris CEDEX 14 \nFRANCE\nPasteur Institute \n1 rue du Professeur Calmette \n59019 Lille CEDEX BB 245 \nFRANCE\nPasteur Institute \n77 rue Pasteur \n69365 Lyon CEDEX \nFRANCE\nPlants, seeds, bulbs must be accompanied by plant health certificate. \nThe importation of tobacco leaves and stems, manufactured tobaccos, cigars, cigarettes, chewing and smoking tobacco is permitted only on behalf of the State Monopoly, with the following exception: Manufactured tobaccos, including cigars and cigarettes, may be sent to individuals in France for personal use up to 10 kilograms (22 pounds) per person per year, subject to special customs authorization.','\nA parcel may be addressed to a street address or to a post office box. A local telephone number for the addressee should be provided when the item is addressed to a street address and must be provided when the item is addressed to a post office box. For parcels, an invoice, in duplicate, is required for all commercial shipments regardless of value and all personal shipments valued at $300 or more. The invoices must be affixed to the outside of the parcel or may be enclosed in PS Form 2976-E with the customs declaration. It is recommended that all articles bear, as part of the address, the name of the Province in which the office of destination is located. Printed matter of value should have Form 2976 affixed, and it can be cleared more readily through French customs if an invoice is enclosed. Parcels whose senders or addressees are designated by initials will not be admitted. Shipments must not be fastened by means of wire, but straps not having sharp edges may be used, provided they are tightly fastened so that no sharp ends or corners are exposed.       \n'),('US','ZA',NULL,'http://pe.usps.com/text/imm/ps_034.htm','Articles relating to lotteries.\nCharged butane gas lighters and refills.\nCigarettes exceeding 2 kg per thousand in weight.\nDiamonds or precious stones except in First-Class Package International Service shipments with Registered Mail service. \nHoney. \nLiquids of any type.\nLithium batteries.\nPrison-made articles. ','None ','\nImport licenses are required for many types of goods. Therefore, senders should ascertain from the addressee before mailing whether the necessary documents are held.  Licenses are not required for bona fide gifts not exceeding R 200 (Rand) in value.  Coins; banknotes; currency notes (paper money); traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles are admitted only in First-Class Package International Service with Registered Mail service shipments.        \n'),('US','ZM',NULL,'http://pe.usps.com/text/imm/tz_027.htm','Lottery tickets or circulars relating to lotteries.\nPrison-made goods.\nRadioactive materials.','Coins; paper currency; banknotes; currency notes; securities payable to bearer; jewelry; manufactured and unmanufactured platinum, gold, and silver; precious stones; and other valuable articles are admitted only if sent in First-Class Package International Service with Registered Mail service shipments. \nThe following articles are limited to quantities valued at 25 pounds sterling or less, whether sent in single shipments or in commercial consignments of multiple shipments: Cigars, cigarettes, manufactured or unmanufactured tobacco; blankets; quilts, mattresses, pillows and cushions; carpets, rugs, and mats; clothing; gloves; hats, caps and other headwear; footwear, stockings and socks; piece goods and lace; perfumes and cosmetics; cutlery; books; playing cards; watches; jewelry, articles of gold or silver; sporting and athletic goods; cups, medals, trophies, etc.; and harness and saddlery. \nMedicines must be clearly marked as to their nature or composition in English on the label. ','None '),('US','ZW',NULL,'http://pe.usps.com/text/imm/tz_028.htm','Articles made in prisons. \nCoins; bank notes; currency notes (paper money); securities of any kind payable to bearer; traveler’s checks; platinum, gold, and silver (manufactured or not); precious stones; jewelry; and other valuable articles are prohibited in all classes of mail, including Priority Mail Express International shipments, that are mailed to Zimbabwe. \nFirearms except under permit.\nHoney.\nLottery tickets or circulars relating to lotteries.\nPerishable infectious biological substances.','Medicines must be labeled with the name, formula, and composition in English. ','None ');
